(1, 1, 'Welcome aboard!', '<div class=\"gmail_default\" style=\"line-height: 21px;\"><div class=\"gmail_default\" style=\"line-height: 21px;\"><div class=\"gmail_default\" style=\"line-height: 21px;\"><div class=\"gmail_default\" style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 21px;\"><font style=\"line-height: 21px;\"><span style=\"line-height: 21px;\"><span style=\"line-height: 21px; font-size: 14px;\"><b>Dear {name},</b></span></span></font></div><div class=\"gmail_default\" style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 21px;\"><br></div><div class=\"gmail_default\" style=\"line-height: 21px;\"><span id=\"docs-internal-guid-106dfd51-7fff-3100-ec7d-04b2225f4c3f\" style=\"\"><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"color: rgb(136, 136, 136); font-family: Calibri, sans-serif; font-size: 11pt; white-space: pre-wrap;\"><b>Greetings!</b></span></p><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><font color=\"#888888\" face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">This is to keep up the trend of creating delighted users. We are sure that you are the best fit for the role you are appointed for &amp; would ensure that you exceed our soul objective expectations that we have with you.</span></font><br></p><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><font color=\"#888888\" face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">For any queries or concerns you may have or come across while you work on the system, feel free to get in touch with us and we will make sure that you become a champ and never get bothered by it again. We have a highly sophisticated system in place to keep you comfortable, agile &amp; highly responsive so that you can respond to your clients efficiently and win them. So let\'s get going and may you have the best of your time with us.</span><br></font></p><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><font color=\"#888888\" face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Wishing you All the Best!</span><br></font></p></span></div></div></div></div>', '<table width=\"90%\" align=\"center\" role=\"presentation\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin: 0px auto;margin-top:20px; min-width: 100%;\">                                                            <tbody><tr>                                                               <td>                                                                     <table width=\"100%\" align=\"center\" role=\"presentation\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin: 0px auto;margin-top:20px; min-width: 100%;\">                                                                           <tbody><tr align=\"left\"><td style=\"text-align=left;\"><i style=\"font-family: Roboto, sans-serif; font-size:small; background-color:= rgb(255,255,255);\">Warm Regards</i></td></tr><tr>                                                                     </tr></tbody></table>                                                               </td>                                           \n        \n         </tr></tbody></table>', 'Active'),
(2, 2, 'Welcome aboard!', '<div class=\"gmail_default\" style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 21px;\"><font face=\"trebuchet ms, sans-serif\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 21px; font-family: Roboto, sans-serif;\"><span style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 21px; font-family: Roboto, sans-serif;\"><span style=\"color: rgb(51, 51, 51); line-height: 21px; font-family: Roboto, sans-serif; font-size: 14px;\"><b>\nDear {name},</b></span></span></font></div><div class=\"gmail_default\" style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 21px;\"><br></div><span id=\"docs-internal-guid-26405389-7fff-7663-f767-c238f26deb8f\" style=\"\"><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt; display: block !important;\"><font color=\"#888888\" face=\"Calibri, sans-serif\" style=\"\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Thank you for choosing us for your exciting vacation with your family or friends. We assure you the best of the services ensure that you simply enjoy the tour, create cherishing memories & leave all the worries about making your tour a great one to us.</span></font></p><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt; display: block !important;\"><font color=\"#888888\" face=\"Calibri, sans-serif\" style=\"\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">For your highest convenience we are happy to provide you access to our system wherein you can check our upcoming offers, download various documents like Service Vouchers, Air Tickets Booked through us, etc. With this we hope that you travel along with us, when it comes to create cherished memories and lasting </span></font><font color=\"#888888\" face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">experience.</span></font></p></span>', '<table width=\"90%\" align=\"center\" role=\"presentation\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin: 0px auto;margin-top:20px; min-width: 100%;\"><tbody><tr><td><table width=\"100%\" align=\"center\" role=\"presentation\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin: 0px auto;margin-top:20px; min-width: 100%;\">                                                                           <tbody><tr align=\"left\"><td style=\"text-align=left;\"><i style=\"font-family: Roboto, sans-serif; font-size:small; background-color:= rgb(255,255,255);\">Warm Regards</i></td></tr><tr>                                                                     </tr></tbody></table>                                                               </td>                                           \n        \n         </tr></tbody></table>', 'Active'),
(3, 3, 'Welcome Aboard', '<div class=\"gmail_default\" style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 21px;\"><div class=\"gmail_default\" style=\"line-height: 21px;\"><font style=\"line-height: 21px;\"><span style=\"line-height: 21px;\"><span style=\"line-height: 21px; font-size: 14px;\"><b>Dear {name},</b></span></span></font></div><div class=\"gmail_default\" style=\"line-height: 21px;\"><br></div><div class=\"gmail_default\" style=\"line-height: 21px;\"><span id=\"docs-internal-guid-106dfd51-7fff-3100-ec7d-04b2225f4c3f\"><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"color: rgb(136, 136, 136); font-family: Calibri, sans-serif; font-size: 11pt; white-space: pre-wrap;\"><b>Greetings!</b></span></p><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;line-height: 1.38; margin-top: 0pt; margin-bottom: 10pt;\"><span style=\"color: rgb(136, 136, 136); font-family: Calibri, sans-serif; font-size: 11pt; white-space: pre-wrap;\">Our entire team welcomes you from the bottom of our hearts. We hereby look forward to succeed &amp; grow mutually with you.</span></p></span></div></div>', '<table width=\"90%\" align=\"center\" role=\"presentation\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin: 0px auto;margin-top:20px; min-width: 100%;\">                                                            <tbody><tr>                                                               <td>                                                                     <table width=\"100%\" align=\"center\" role=\"presentation\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin: 0px auto;margin-top:20px; min-width: 100%;\">                                                                           <tbody><tr align=\"left\"><td style=\"text-align=