(4, 4, 'Enquiry Acknowledgment', '<div class=\"gmail_default\" style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 21px;\"><font face=\"trebuchet ms, sans-serif\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 21px; font-family: Roboto, sans-serif;\"><span style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 21px; font-family: Roboto, sans-serif;\"><span style=\"color: rgb(51, 51, 51); line-height: 21px; font-family: Roboto, sans-serif; font-size: 14px;\"><b>\nDear {name},</b></span></span></font></div><div class=\"gmail_default\" style=\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 20px; line-height: 21px;\"><br></div><span id=\"docs-internal-guid-26405389-7fff-7663-f767-c238f26deb8f\"><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;line-height:1.3800000000000001;margin-top:0pt;margin-bottom:10pt;\"><span style=\"font-size:11pt;font-family:Calibri,sans-serif;color:#888888;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">We are glad to inform you that we\'ve received your tour request.</span></p><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;display:block!important;line-height:1.3800000000000001;margin-top:0pt;margin-bottom:10pt;\"><span id=\"docs-internal-guid-7087a39f-7fff-1479-0ea7-d481ab92d6a5\"></span></p><p dir=\"ltr\" style=\"display:block!important;display:block!important;display:block!important;line-height:1.3800000000000001;margin-top:0pt;margin-bottom:10pt;\"><span style=\"font-size:11pt;font-family:Calibri,sans-serif;color:#888888;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">We look forwa