INSERT INTO `custom_package_program` (`entry_id`, `package_id`, `attraction`, `day_wise_program`, `stay`, `meal_plan`) VALUES
(1, 1, 'Arrival at Cochi', 'Welcome to your Kochi. Upon arrival at the Kochi international airport start on your journey to the hotel in Kochi.  Once you reach Kochi Hotel, complete the check-in formalities at the hotel.', 'Cochin', ''),
(2, 1, 'Travel from Kochi - Munnar', 'After delicious breakfast, check out from the hotel and Set out on a sightseeing tour in Kochi. Later in Afternoon driver to Munnar. Munnar is a beautiful hill town which is located in the Western Ghats. The place is full of rolling hills, stunning tea plantations, spice plantations and much more. It is the ideal holiday destination to unwind all your stress. Enroute visit Cheeyappara Waterfall and Valara Waterfalls. Upon your arrival in Munnar, check into your hotel and then unwind youself. Rest of the day is at Leisure.', 'Munnar', ''),
(3, 1, 'Travel from Munnar - Thekkady', 'Relish the lip-smacking breakfast at the hotel, check-out and we will drive you to a next highly picturesque destination Thekkady. Enroute visit Spice Plantation. On arrival, check-in at the hotel and relax for some time. Later walk on the street on Thekkady and visit Epephant Junction to enjoy Elephant Ride and watch Elephant Bathing. Later In evening be mesmerized by a live show of Kalaripayattu. After a joyfull day return back to hotel for dinner.', 'Thekkady', ''),
(4, 1, 'Travel Thekkady Alleppey & Departure', 'After breakfast, check out of the hotel. Drive to Alleppey and transfer to airport/railway station for your onward journey.', 'Tour End', ''),
(5, 2, 'Arrival at Cochi', 'Welcome to your Kochi. Upon arrival at the Kochi international airport start on your journey to the hotel in Kochi.  Once you reach Kochi Hotel, complete the check-in formalities at the hotel.', 'Cochi', ''),
(6, 2, 'Travel from Kochi - Munnar', 'After delicious breakfast, check out from the hotel and Set out on a sightseeing tour in Kochi. Later in Afternoon driver to Munnar. Munnar is a beautiful hill town which is located in the Western Ghats. The place is full of rolling hills, stunning tea plantations, spice plantations and much more. It is the ideal holiday destination to unwind all your stress. Enroute visit Cheeyappara Waterfall and Valara Waterfalls. Upon your arrival in Munnar, check into your hotel and then unwind youself. Rest of the day is at Leisure.', 'Munnar', ''),
(7, 2, 'Munnar Local Sightseeing', 'After breakfast, take a sightseeing tour of Munnar visiting the Eravikulam National Park, Mattupetty Dam, Old Munnar Town and the town market. Enjoy rest of the day at leisure. ', 'Munnar', ''),
(8, 2, 'Travel Thekkady- Alleppey & Departure', 'After breakfast, check out of the hotel. Drive to Alleppey and transfer to airport/railway station for your onward journey.', 'Tour End', ''),
(9, 3, 'Arrival at Port Blair', 'Arrive at Port Blair and you will be taken to your hotel where you relax and rest and after lunch proceed for local sightseeing of Port Blair. Later you will be taken to Cellular Jail (closed on Mondays) to enjoy beautiful Light and Sound show. Evening is free for leisure activities.', 'Port Blair', ''),
(10, 3, 'Port Blair to Havelock', 'Morning we go to Corbyns Cove Beach the most active beach side of Port Blair. We start our journey towards Havelock Island via ferry from Port Blair Harbor. On arrival at Havelock Island, our representative will receive and escort you to check-in to the resort. After relax, day free for own leisure at Havelock Island.', 'Havelock', ''),
(11, 3, 'Havelock - Neil Island', 'After buffet breakfast, check out from the hotel. Transfer to the Havelock jetty to board the ferry for Neil Island. Post lunch (on direct payment), proceed to visit Bharatpur beach, Laxmanpur beach and Howrah Bridge (depending on tide conditions).  Return to the hotel in the evening. Enjoy your dinner and a comfortable overnight stay at the hotel.', 'Neil Island', ''),
(12, 3, 'Neil Island-Port Blair', 'This morning after breakfast you will transfer to Port Blair airport in time to board your flight. Depart Port Blair with fond memories of these mesmerizing Islands.', 'aa', ''),
(13, 4, 'Arrival at Port Blair', 'Arrive at Port Blair and you will be taken to your hotel where you relax and rest and after lunch proceed for local sightseeing of Port Blair. Later you will be taken to Cellular Jail (closed on Mondays) to enjoy beautiful Light and Sound show. Evening is free for leisure activities.', 'Port Blair', ''),
(14, 4, 'Port Blair to Havelock', 'Morning we go to Corbyns Cove Beach the most active beach side of Port Blair. We start our journey towards Havelock Island via ferry from Port Blair Harbor. On arrival at Havelock Island, our representative will receive and escort you to check-in to the resort. After relax, day free for own leisure at Havelock Island.', 'Havelock', ''),
(15, 4, 'Havelock - Radhanagar Beach and Kalapathar Beach', 'After breakfast day free for own leisure, afternoon we proceed to Radhanagar Beach, the Times Magazine rated the finest beach among the best beaches in Asia. It is an ideal place for swimming, sea bathing and basking on the sun kissed beaches. Later Visit the Kalapathar Beach for its blue waters.', 'Havelock', ''),
(16, 4, 'Havelock - Neil Island', 'After buffet breakfast, check out from the hotel. Transfer to the Havelock jetty to board the ferry for Neil Island. Post lunch (on direct payment), proceed to visit Bharatpur beach, Laxmanpur beach and Howrah Bridge (depending on tide conditions).  Return to the hotel in the evening. Enjoy your dinner and a comfortable overnight stay at the hotel.', 'Neil Island', ''),
(17, 4, 'Neil Island- Port Blair', 'This morning after breakfast you will transfer to Port Blair airport in time to board your flight. Depart Port Blair with fond memories of these mesmerizing Islands.', 'Tour End', ''),
(18, 5, 'Arrive Goa', 'Transfer from Goa Airport/Thivim Railway Station to Hotel', 'Goa', ''),
(19, 5, 'In Goa', 'Day at Leisure.', 'Goa', ''),
(20, 5, 'In Goa', 'Day at Leisure', 'Goa', ''),
(21, 5, 'Transfer to Airport/ Railway station.', 'Transfer from Hotel to Goa Airport/Thivim Railway Station.', 'Tour End', ''),
(22, 6, 'Arrive Goa', 'Transfer from Goa Airport/Thivim Railway Station to Hotel', 'Goa', ''),
(23, 6, 'In Goa', 'Day at Leisure.', 'Goa', ''),
(24, 6, 'In Goa', 'Day at Leisure', 'Goa', ''),
(25, 6, 'In Goa', 'Day at Leisure', 'Goa', ''),
(26, 6, 'Travel to Airport', 'Transfer from Hotel to Goa Airport/Thivim Railway Station.', 'Tour End', ''),
(27, 7, 'Ahmedabad / Rajkot  Jamnagar  Dwarka', 'Morning after breakfast proceeds to Dwarka, en-route visit Jamnagar Bala Hanuman Temple - Bala Hanuman Temple is a pilgrim place venerated by the devotees of Lord Ram. It is a world famous temple, known for the continuous chanting of Jai Ram, Shri Ram. The chanting is going on since 1964 and has found a place for it in the Guinness Book of World Records. People chant the name of the Lord in shifts, 24 hours a day. Later Proceed to Dwarka, visit Lords Dwarkadhish Temple. Attend evening Aarti Darshan at Dwarkadhish.', 'Dwarka', ''),
(28, 7, 'Dwarka', 'Attend early morning Aarti at Dwarkadhish temple, have breakfast & thereafter visit Bet Dwarka, Nageshwar Jyotirling & Rukmani Temple.\n\nVisit Nageswar Mahadev & Rukmani Temple. Back to the Hotel', 'Dwarka', ''),
(29, 7, 'Dwarka-Porbandar  Somnath', 'Morning after breakfast proceeds to Porbandar, visit Kirti temple, Sudam known as house & born place of Mahatma Gandhi. In back side house of Kasturba wife of Gandhi. Also visit of Gandhi museum, study room of Mahatma Gandhi in the Kirti temple.\n\nLater visit of Sudama temple & continue proceed to Somnath, evening aarti Darshan at Somnath Temple', 'Somnath', ''),
(30, 7, 'Somnath-Ahmedabad Departure', 'Morning after early Breakfast proceeds to Ahmedabad and transfer to airport / railway station for onward journey', 'Tour End', ''),
(31, 8, 'Arrives at Ahmedabad', 'Arrival at Ahmadabad, Meet to Greet visit Akshardham Temple (Monday Closed) Akshardham is situated in the capital city of Gandhinagar, which lies near Ahmadabad.\n\nLater drive to Adalaj, visit step well is an architectural wonder built by Queen Rudabai and is certainly one of the finest monuments of Gujarat.', 'Ahmedabad', ''),
(32, 8, 'Ahmedabad-amnagar  Dwakra', 'Morning after breakfast drive to Dwarka, en-route visit Jamnagar Bala Hanuman Temple - Bala Hanuman Temple is a pilgrim place venerated by the devotees of Lord Ram.\n\nLater Proceed to Dwarka, visit Lords Dwarkadhish Temple. Attend evening Aarti Darshan at Dwarkadhish Temple  Temple of Lord Krishna.', 'Dwarka', ''),
(33, 8, 'Dwarka-Porbandar  Somnath', 'Morning proceed to Porabandar, Visit Kirti temple, Sudam known as house & born place of Mahatma Gandhi. In back side house of Kasturba wife of Gandhi. Also visit of Gandhi museum, study room of Mahatma Gandhi in the Kirti\n\ntemple. Later visit of Sudama temple & continue proceed to Somnath, evening Aarti Darshan at Somnath Temple - A lord', 'Somnath', ''),
(34, 8, 'Somnath-Diu', 'Morning after breakfast visit Bhalika Tirth & Triveni Ghat. Later drive to Diu, visit Diu: A beautiful blend of sun, sand and sea, Diu is a Gods gift to those in quest of a blessed land where the weary weight of this unintelligible world can, for a while, be lightened and the waking soul can hear the music of the nature. ', 'Dui', ''),
(35, 8, 'Somnath-Ahmedabad Departure', 'Morning after breakfast drive to Ahmedabad and transfer to Airport /Railway station for onward journey.', 'Tour End', ''),
(36, 9, 'Arrival Chandigarh', 'Welcome onboard a wonderful tour to one of the most happening destinations - Himachal!\n\nArrival at the Chandigarh Airport. Complimentary Transfer from Airport to the Regenta Central Cassia  Amritsar at 1200 Hrs. \nwe start Chandigarh City Tour visit Sukhna Lake, Rock Garden, Elante Mall, and the local Punjabi food of Chandigarh', 'Chandigarh', ''),
(37, 9, 'Chandigarh To Manali', 'After an early breakfast, depart for Manali by road.  Manali is a high-altitude Himalayan resort town in Indias northern Himachal Pradesh state. It has a reputation as a backpacking centre and honeymoon destination. Set on the Beas River, it\'s a gateway for skiing in the Solang Valley and trekking in Parvati Valley. It\'s also a jumping-off point for paragliding, rafting and mountaineering in the Pir Panjal mountains , Arrive Manali check in at the hotel.', 'Manali', ''),
(38, 9, 'Manali To Shimla', 'After an early breakfast, depart for Shimla by road. Shimla The town is famous for pleasant walking experiences on hillsides surrounded by pine and oak forests. This capital city of Himachal Pradesh is famous for The Mall, ridge, and toy train. With colonial style buildings, the town has relics of ancient past that lend it a distinct look.  Arrive shimla check in hotel and overnight at Resorts.', 'Shimla', ''),
(39, 9, 'Chandigarh Departure', 'Today after early breakfast, proceed to Chandigarh Airport at. Arrive Airport drop at airport for onward journey.', 'Tour End', ''),
(40, 10, 'Arrival Chandigarh', 'Welcome onboard a wonderful tour to one of the most happening destinations - Himachal!\n\nArrival at the Chandigarh Airport. Complimentary Transfer from Airport to the Regenta Central Cassia  Amritsar at 1200 Hrs. \nwe start Chandigarh City Tour visit Sukhna Lake, Rock Garden, Elante Mall, and the local Punjabi food of Chandigarh', 'Chandigarh', ''),
(41, 10, 'Chandigarh To Manali', 'After an early breakfast, depart for Manali by road.  Manali is a high-altitude Himalayan resort town in Indias northern Himachal Pradesh state. It has a reputation as a backpacking centre and honeymoon destination. Set on the Beas River, it\'s a gateway for skiing in the Solang Valley and trekking in Parvati Valley. It\'s also a jumping-off point for paragliding, rafting and mountaineering in the Pir Panjal mountains , Arrive Manali check in at the hotel.', 'Manali', ''),
(42, 10, 'Manali To Shimla', 'After an early breakfast, depart for Shimla by road. Shimla The town is famous for pleasant walking experiences on hillsides surrounded by pine and oak forests. This capital city of Himachal Pradesh is famous for The Mall, ridge, and toy train. With colonial style buildings, the town has relics of ancient past that lend it a distinct look.  Arrive shimla check in hotel and overnight at Resorts.', 'Shimla', ''),
(43, 10, 'Shimla Tour', 'After breakfast Drive to Kufri derives its name from Kufri which means lake. It is especially popular among trekkers. The salubrious climate and stunning natural beauty makes Kufri a perfect summer getaway. Kufri is also a haven for nature enthusiasts and wildlife lovers as the Himalayan Nature Park is situated on the outskirts of the town. Thereafter visit Shimla followed by Indira Bungalow and Himalayan Zoo. Later we stroll on the famous Mall Road to we view Christ Church, Scandal Point, The Ridge. After visit back to resort and relax. Over-night at the resort.', 'Shimla', ''),
(44, 10, 'Chandigarh Departure', 'Today after early breakfast, proceed to Chandigarh Airport at. Arrive Airport drop at airport for onward journey.', 'Tour End', ''),
(45, 11, 'Arrive Srinagar', 'Arrival at Srinagar Airport. The vehicle to the hotel departs from Srinagar Airport. Guests are requested to time their flights as per this schedule to avail the complimentary transfers or else they may opt for the add-on transfers on extra payment basis. Reach your hotel. Check in and freshen up. In Evening Enjoy Shikara ride on Dal Lake.', 'Srinagar', ''),
(46, 11, 'Srinagar- Pahalgam', 'Today after an early breakfast Visit Shankaracharya Temple situated on top of the Shankaracharya Hill on the Zabarwan Range in Srinagar, Jammu and Kashmir, India.\n\nArrive Pahalgam and transfer to your hotel. Rest of the day is at leisure.', 'Pahalgam', ''),
(47, 11, 'Pahalgam - Gulmarg', 'Today after breakfast enjoy a picturesque drive to Gulmarg. You may enjoy an optional sledge ride or Cable car ride on the snow covered slopes (on direct payment basis)', 'Gulmarg', ''),
(48, 11, 'Gulmarg - Srinagar', 'After breakfast You Can Enjoy Gulmarg Gondola , Asia\'s largest and highest and world\'s second-largest and second highest cable car project, Gulmarg Gondola is the top attraction in Gulmarg. In fact, a Gulmarg tour without a ride on the popular cable car is considered incomplete.', 'Tour End', ''),
(49, 12, 'Arrive Srinagar', 'Arrival at Srinagar Airport. The vehicle to the hotel departs from Srinagar Airport. Guests are requested to time their flights as per this schedule to avail the complimentary transfers or else they may opt for the add-on transfers on extra payment basis. Reach your hotel. Check in and freshen up. In Evening Enjoy Shikara ride on Dal Lake.', 'Srinagar', ''),
(50, 12, 'Srinagar- Pahalgam', 'Today after an early breakfast Visit Shankaracharya Temple situated on top of the Shankaracharya Hill on the Zabarwan Range in Srinagar, Jammu and Kashmir, India.\n\nArrive Pahalgam and transfer to your hotel. Rest of the day is at leisure.', 'Pahalgam', ''),
(51, 12, 'Pahalgam-Gulmarg', 'Today after breakfast enjoy a picturesque drive to Gulmarg. You may enjoy an optional sledge ride or Cable car ride on the snow covered slopes (on direct payment basis)', 'Gulmarg', ''),
(52, 12, 'Gulmarg Local sightseeing', 'After breakfast, proceed for Skiing. Gulmarg is having one of the best skiing slops in world and its famous for amateur as well as advance skiing. One can also opt for a fun-filled pony ride and gondola rides (on direct payment). Evening is free for leisure activities.', 'Gulmarg', ''),
(53, 12, 'Gulmarg - Srinagar', 'After breakfast You Can Enjoy Gulmarg Gondola , Asia\'s largest and highest and world\'s second-largest and second highest cable car project, Gulmarg Gondola is the top attraction in Gulmarg. In fact, a Gulmarg tour without a ride on the popular cable car is considered incomplete.', 'Tour End', ''),
(54, 13, 'Arrival at Jaipur', 'Upon arrival at Jaipur (also known as Pink City), check in at the hotel and relax. Later in the afternoon, proceed to visit the City Palac, Shri Govind Deo Temple. En-route, visit the Hawa Mahal. We will also visit Jantar Mantar, a stone observatory, which is the largest of Jai Singh\'s five remarkable observatories.', 'Jaipur', ''),
(55, 13, 'Jaipur-Jodhpur', 'Early breakfast, check out from the Hotel & drive to Jodhpur (also known as Blue City). En-route visit to Pushkar. Arrival Jodhpur & check in hotel. Spend the evening at leisure. Dinner and overnight stay at the hotel.', 'Jodhpur', ''),
(56, 13, 'Jodhpur-Udaipur', 'After breakfast, check out from the Hotel & drive to Udaipur in the morning. Check in and overnight stay at the hotel in Udaipur, the City of Lakes.', 'Udaipur', ''),
(57, 13, 'Departure Udaipur', 'Today after breakfast, check out of the hotel and you are transferred to the Udaipur airport or railway station for your onward journey.', 'Tour End', ''),
(58, 14, 'Arrival at Jaipur', 'Upon arrival at Jaipur (also known as Pink City), check in at the hotel and relax. Later in the afternoon, proceed to visit the City Palac, Shri Govind Deo Temple. En-route, visit the Hawa Mahal. We will also visit Jantar Mantar, a stone observatory, which is the largest of Jai Singh\'s five remarkable observatories.', 'Jaipur', ''),
(59, 14, 'Jaipur-Jodhpur', 'Early breakfast, check out from the Hotel & drive to Jodhpur (also known as Blue City). En-route visit to Pushkar. Arrival Jodhpur & check in hotel. Spend the evening at leisure. Dinner and overnight stay at the hotel.', 'Jodhpur', ''),
(60, 14, 'Jodhpur - Udaipur', 'After breakfast, check out from the Hotel & drive to Udaipur in the morning. Check in and overnight stay at the hotel in Udaipur, the City of Lakes.', 'Udaipur', ''),
(61, 14, 'Jodhpur City tour- Osian', 'After breakfast local city sightseeing tour Jodhpur, stronghold of the fierce Rathore clan, was founded in 1459 by Prince Jodha. Visit the Mehrangarh Fort, situated on a low sandstone hill. Within the fort, visit Moti Mahal and Phool Mahal. Also visit Jaswant Thada, an imposing marble cenotaph, built in memory of Maharaja Jaswant singh II around 1899 and afternoon visit to Umaid Bhawan Palace and evening enjoy leisure time at Umaid Public gardens & Mandore Garden. Later drive to Osian on arrival check in at the Tents, after that enjoy Camel rider at nearby Sand Dunes and Evening Return back to Return back to Resort for Dinner & overnight stay.', 'Osian', ''),
(62, 14, 'Osian-Udaipur', 'Today after breakfast, check out of the hotel and you are transferred to the Udaipur airport or railway station for your onward journey.', 'Tour End', ''),
(63, 15, 'Arrival in Bali', 'Arrive in Bali upon arrival at the Ngurah Rai, Bali International Airport, meet & greet by our local guide who lead you to the parking area to board on vehicle for your transfer to your hotel.\n\nUpon arrival at the hotel, directly check in and freshen up.', 'Bali', ''),
(64, 15, 'Tanah Lot Tour', 'Breakfast at the hotel\n\nIn the afternoon, proceed for Tanah Lot Floating Temple as your first itinerary in this trip. This temple is very beautiful in the particular of the sunset time. We can view this temple from several spot points with spectacular view of the ocean and sunset. The word of Tanah Lot is consisted of two words that are Tanah word interpreted as a reef looking like gili or island. Lot or Lod word has meaning the sea. So Tanah Lot is meaning the small island floating on the sea.  Transfer back to hotel for overnight', 'Bali', ''),
(65, 15, 'Full Day Kintamani Tour with Ubud', 'Breakfast at hotel\n\nWe pick up from your hotel, and start the tour program by visiting the Tegenungan Waterfall. Waterfall located right in the southern area of the island.\n\nWe continue to visit Kintamani Village to see Mt Batur. Kintamani is a district. Then we then continue to visit Ubud Monkey Forest.', 'Bali', ''),
(66, 15, 'Departure', 'Breakfast at hotel\n\nPick up from the hotel to transfer to the Airport according to the scheduled Flight.', 'Tour End', ''),
(67, 16, 'Arrival-Tanah Lot Tour', 'Upon arrival in Bali at the Ngurah Rai, Bali International Airport, meet & greet by our local guide who will assist you to board a vehicle for your transfer to your hotel.\n\nTransfer back to hotel for overnight', 'Bali', ''),
(68, 16, 'Full Day: Ubud & Kintamani Tour', 'Breakfast at hotel. We pick up from your hotel, and start the tour program by visiting Batuan Temple. Batuan Temple, referred to locally as Pura Puseh lan Pura Desa Adat Batuan.\n\nWe are then continue to visit Silver Village Celuk.\n\nThe Last stop will be Bali Ubud Royal Palace & Ubud Art Market.', 'Bali', ''),
(69, 16, 'Today the day is free at leisure', 'Overnight at the hotel', 'Bali', ''),
(70, 16, 'Today the day is free at leisure', 'Overnight at the hotel', 'Bali', ''),
(71, 16, 'Departure', 'Breakfast at hotel. Pick up from the hotel to transfer to the Airport according to the scheduled Flight', 'Tour End', ''),
(72, 17, 'Arrive Male', 'Upon arrival in Male, you will be transferred to your resort. Check in at the hotel. Enjoy the rest of the day at leisure.\n\nOvernight at the resort', 'Male', ''),
(73, 17, 'Male', 'Enjoy breakfast at the hotel. Later enjoy your day at leisure, explore the island on your own\n\nOvernight at the resort', 'Male', ''),
(74, 17, 'Male', 'Enjoy breakfast at the hotel. Later enjoy your day at leisure, explore the island on your own\n\nOvernight at the resort', 'Male', ''),
(75, 17, 'Depart Male', 'After breakfast, check out (standard 1200 hrs) and transfer from the hotel to International Airport for the departure flight back to India or to your onwards destination.', 'Tour End', ''),
(76, 18, 'Arrive Male', 'Upon arrival in Male, you will be transferred to your resort. Check in at the hotel. Enjoy the rest of the day at leisure.\n\nOvernight at the resort', 'Male', ''),
(77, 18, 'Male', 'Enjoy breakfast at the hotel. Later enjoy your day at leisure, explore the island on your own\n\nOvernight at the resort', 'Male', ''),
(78, 18, 'Male', 'Enjoy breakfast at the hotel. Later enjoy your day at leisure, explore the island on your own\n\nOvernight at the resort', 'Male', ''),
(79, 18, 'Male', 'Enjoy breakfast at the hotel. Later enjoy your day at leisure, explore the island on your own\n\nOvernight at the resort', 'Male', ''),
(80, 18, 'Depart Male', 'After breakfast, check out (standard 1200 hrs) and transfer from the hotel to International Airport for the departure flight back to India or to your onwards destination.', 'Tour End', ''),
(81, 19, 'Arrive Kathmandu', 'Meeting at airport upon arrival by Office Personnel. Kathmandu is the capital of Nepal and the Kathmandu Valley is the political and cultural heart of the Kingdom.\n\nAfter arrival you will be transferred to the hotel.', 'Kathmandu', ''),
(82, 19, 'Kathmandu', 'This morning you will be taken for a visit of the Hindu culture in Nepal, Pashupatinath.\n\nWe then continue to the holiest shrine for the Buddhist culture in Nepal, Bouddhanath, with its large stupa, this is the place where Buddhists devout come for a pilgrimage.', 'Kathmandu', ''),
(83, 19, 'Kathmandu-Chandragiri Hills - Kathmandu', 'This morning you will be taken for Chandragiri Hills, 17 kilometres approx from city center, lies on the South-West of Kathmandu Valley.\n\nDrive from your hotel to Thankot and then take a cable car to Chandragiri Hills. Chandragiri Cable Car is a gondola lift transportation system located in Kathmandu, Nepal. Opened on 2016, the Chandragiri Cable Car runs from Thankot to Chandragiri hills.\n\nLater visit Thamel which is the Tourist hub of Nepal.', 'Kathmandu', ''),
(84, 19, 'Kathmandu to Airport', 'Morning will be comparatively free and closer to the time of your flight you will be transferred to the airport in time to board your flight for onward journey.', 'Tour End.', ''),
(85, 20, 'Arrive Kathmandu', 'Meeting at airport upon arrival by Office Personnel. Transfer to hotel. Kathmandu is the capital of Nepal and the Kathmandu Valley is the political and cultural heart of the Kingdom.\n\nAfter short relaxation at the hotel, visit one of the Hindu CULTURES in Nepal, Pashupatinath.', 'Kathmandu', ''),
(86, 20, 'Pokhara', 'This afternoon you will visit Bindebasini Temple. This is one of the oldest temples in Pokhara was a part of Kaski Kingdom, the main deity of the temple, GODDESS Durga, was brought from INDIA.', 'Pokhara', ''),
(87, 20, 'Pokhara-Kathmandu', 'Retracing the same path, drive back to Kathmandu and transfer to Hotel. Rest day at leisure. One can indulge in shopping or visit the casinos trying their lady luck on your own. Overnight at hotel.', 'Kathmandu', ''),
(88, 20, 'Kathmandu-Airport', 'This morning your tour will take you for a visit to Patan. Also known AS LALITPUR, the city of beauty is separated from Kathmandu only by the Bagmati River and is the second largest town in the valley. Lalitpur is fragmented from other cities due to its substantive architectural ancient masterpieces.\n\nYou will then go to Swayambhunath the golden spire of the 5th-century Swayambhu stupa is adorned with a colorful fluttering of prayer flags; it crowns a hill overlooking the Kathmandu Valley and offers fantastic views over the city of Kathmandu.\n\nLater, you will be transferred to the airport in time to board your flight for onward journey.', 'Tour End.', ''),
(89, 21, 'Arrive Singapore : Day at Leisure', 'Welcome to Singapore! Upon arrival at Singapore Airport, transfer to the Hotel & check in. The island of Singapore gives you a panoramic view of paradise, you will find the atmosphere of Singapore calming yet exotic making it a persuasive combination of all one would want in a place to reside in.', 'Singapore', ''),
(90, 21, 'Singapore: Sentosa tour', 'Post breakfast, around proceed to Sentosa - Singapore\'s good-time island dedicated to unabashed fun, fake surf and cool beach bars. Enjoy the 02 way cable car ride, Madame Tussauds 4 in1 including Ultimate Film Star Experience & Wings Of Time Show.\n\nIn the evening enjoy Wings of Time  and then transfer back to the hotel', 'Singapore', ''),
(91, 21, 'Singapore Half Day City Tour', 'This morning we proceed on a half day city tour of Singapore . Discover the history, culture and lifestyle of multi racial Singapore in this Tour. The tour begins with a drive around the Civic District past  Suntec City, City Hall, & Fountain of Wealth (The Fountain of Wealth is listed by the Guinness Book of Records in 1998 as the largest fountain in the world ) Stop at the Merlion Park which is located near Marina Bay, Singapore.\n\nReturn back to the hotel', 'Singapore', ''),
(92, 21, 'Depart Singapore', 'This morning after breakfast, you will be transferred to the airport for your onward flight home.', 'Tour End', ''),
(93, 22, 'Arrive Singapore : Day at Leisure', 'Welcome to Singapore! Upon arrival at Singapore Airport, transfer to the Hotel & check in. The island of Singapore gives you a panoramic view of paradise, you will find the atmosphere of Singapore calming yet exotic making it a persuasive combination of all one would want in a place to reside in.', 'Singapore', ''),
(94, 22, 'Singapore: Sentosa tour', 'Post breakfast, around proceed to Sentosa - Singapore\'s good-time island dedicated to unabashed fun, fake surf and cool beach bars. Enjoy the 02 way cable car ride, Madame Tussauds 4 in1 including Ultimate Film Star Experience & Wings Of Time Show.\n\nIn the evening enjoy Wings of Time  and then transfer back to the hotel', 'Singapore', ''),
(95, 22, 'Singapore Half Day City Tour', 'This morning we proceed on a half day city tour of Singapore . Discover the history, culture and lifestyle of multi racial Singapore in this Tour. The tour begins with a drive around the Civic District past  Suntec City, City Hall, & Fountain of Wealth (The Fountain of Wealth is listed by the Guinness Book of Records in 1998 as the largest fountain in the world ) Stop at the Merlion Park which is located near Marina Bay, Singapore.\n\nReturn back to the hotel', 'Singapore', ''),
(96, 22, 'Day at leisure', 'Enjoy a leisurely breakfast. The day is free to relax or choose from one of the suggested optional tours.\n\nOvernight: Hotel in Singapore', 'Singapore', ''),
(97, 22, 'Depart Singapore', 'This morning after breakfast, you will be transferred to the airport for your onward flight home.', 'Tour End', ''),
(98, 23, 'Arrive DubaiTime at Leisure', 'On arrival at Dubai International Airport, you\'ll be transferred to your hotel. Upon arrival check in to the hotel and relax. ', 'Dubai', ''),
(99, 23, 'Dubai: Morning at Leisure; Evening Dhow Cruise with Dinner', 'Enjoy breakfast at the hotel.\n\nIn the evening get ready to experience the Dhow Cruise. Cruising down Dubai creek is a novel experience, one which you cannot miss when in Dubai. Having fancy dinner on a Dhow Cruise with the fascinating lights of Dubai Creek and the soft music in the background, sip your favorite drink and enjoy a buffet dinner on board the cruise.', 'Dubai', ''),
(100, 23, 'Dubai Half Day City Tour  Followed By At the Top Burj Khalifa', 'After breakfast, proceed for a half day morning city tour, viewing some of the city most beautiful landmarks. The Magnificent Jumeriah Mosque built in 1979 is a fine example of modern Islamic architecture.\n\nYoull be dropped back to Dubai Mall. You can use this time to have your lunch\n\nTake a closer look at the world below through avant-garde, high powered, telescopes. Step out onto the world\'s highest public outdoor observation terrace overlooking the ever growing skyline of Sheikh Zayed Road and surrounding panorama.\n\nReturn to hotel for a comfortable overnight stay.', 'Dubai', ''),
(101, 23, 'Dubai Departure', 'Today enjoy breakfast at the hotel. Later check out and Transfer to Dubai airport for your departure flight. We hope you take back many happy memories of your holiday.', 'Tour End', ''),
(102, 24, 'Arrive Dubai Time at Leisure', 'On arrival at Dubai International Airport, you\'ll be transferred to your hotel. Upon arrival check in to the hotel and relax. ', 'Dubai', ''),
(103, 24, 'Dubai: Morning at Leisure; Evening Dhow Cruise with Dinner', 'Enjoy breakfast at the hotel.\n\nIn the evening get ready to experience the Dhow Cruise. Cruising down Dubai creek is a novel experience, one which you cannot miss when in Dubai. Having fancy dinner on a Dhow Cruise with the fascinating lights of Dubai Creek and the soft music in the background, sip your favorite drink and enjoy a buffet dinner on board the cruise.', 'Dubai', ''),
(104, 24, 'Dubai Half Day City Tour  Followed By At the Top Burj Khalifa', 'After breakfast, proceed for a half day morning city tour, viewing some of the city most beautiful landmarks. The Magnificent Jumeriah Mosque built in 1979 is a fine example of modern Islamic architecture.\n\nYoull be dropped back to Dubai Mall. You can use this time to have your lunch\n\nTake a closer look at the world below through avant-garde, high powered, telescopes. Step out onto the world\'s highest public outdoor observation terrace overlooking the ever growing skyline of Sheikh Zayed Road and surrounding panorama.\n\nReturn to hotel for a comfortable overnight stay.', 'Dubai', ''),
(105, 24, 'Dubai-Abu Dhabi City Tour with a visit to Sheikh Zayed  Grand  Mosque', 'After breakfast, check out from your hotel in Dubai and proceed towards Abu Dhabi. \n\nAbu Dhabi, the capital of the UAE, is a gem to discover.\n\nProceed for an Abu Dhabi city tour, Abu Dhabi is the largest of the seven Emirates. Explore the majesty of the Sheikh Zayed Grand Mosque.\nVisit Ferrari World or Yas Waterworld, Yas Waterworld, Warner Bros Park. After spending time at the park return to hotel for a comfortable overnight stay. ', 'Abu Dhabi', ''),
(106, 24, 'Dubai Departure', 'Today enjoy breakfast at the hotel. Later check out and Transfer to Dubai airport for your departure flight. We hope you take back many happy memories of your holiday.', 'Tour End', ''),
(107, 25, 'Arrive Paro by Air & transfer to Thimphu', 'On arrival at Paro Airport. After immigration formalities and baggage collection, you will be met by our representative and afterwards drive to Thimphu, the capital town of Bhutan with en-route stop at Chuzom, the confluence of Thimphu and Paro rivers.', 'Thimphu', ''),
(108, 25, 'Thimpu', 'In the morning, visit handmade paper mill, School of Arts and crafts where students learn 13 different arts used predominantly in Bhutan. Later Simply Bhutan museum.', 'Thimphu', ''),
(109, 25, 'Thimphu-Punakha', 'Today\'s drive passes through Dochula pass making the most beautiful pass in Bhutan. 108 Druk Wangyel Chortens, built over the pass by queen mother in 2003 marks the pass more important than another passes. When the weather permits one can enjoy a spectacular view of the highest mountains of Bhutan at a site that stretches almost 180 degrees. After a photo break, we will continue our drive to warm valley of Punakha.', 'Punakha', ''),
(110, 25, 'Depart Paro', 'After early breakfast at the hotel, drive to the airport for flight to your onward destination. Our representative will help you with exit formalities and then bid you farewell.', 'Tour End', ''),
(111, 26, 'Arrive Paro by Air & transfer to Thimphu', 'On arrival at Paro Airport. After immigration formalities and baggage collection, you will be met by our representative and afterwards drive to Thimphu, the capital town of Bhutan with en-route stop at Chuzom, the confluence of Thimphu and Paro rivers.', 'Thimphu', ''),
(112, 26, 'Thimpu', 'In the morning, visit handmade paper mill, School of Arts and crafts where students learn 13 different arts used predominantly in Bhutan. Later Simply Bhutan museum.', 'Thimphu', ''),
(113, 26, 'Thimphu-Punakha', 'Today\'s drive passes through Dochula pass making the most beautiful pass in Bhutan. 108 Druk Wangyel Chortens, built over the pass by queen mother in 2003 marks the pass more important than another passes. When the weather permits one can enjoy a spectacular view of the highest mountains of Bhutan at a site that stretches almost 180 degrees. After a photo break, we will continue our drive to warm valley of Punakha.', 'Punakha', ''),
(114, 26, 'Punakha & Wangdue  Paro', 'After breakfast drive back to Paro descending back down from Dochu La, follow the way back up the dramatic Wang Chhu and Paro Chhu river valleys, before crossing through Paro town towards the north end of the valley.\n\nLater in the day after checking into hotel, proceed to visit Ta Dzong, originally built as Watchtower, which now houses National Museum.\n\nThen walk down the trail to visit Rinpung Dzong, meaning, which has a long and fascinating history.\n\nLater in the afternoon experience Traditional Bhutanese hot stone bath.\n\nAlso, medicinal herbs are added to the water before it is ready for the soak.', 'Paro', ''),
(115, 26, 'Depart Paro', 'After early breakfast at the hotel, drive to the airport for flight to your onward destination. Our representative will help you with exit formalities and then bid you farewell.', 'Tour End', ''),
(116, 27, 'Arrive at Muscat international Airport. ', 'Arrive at Muscat international Airport. After Immigration clearance, baggage collection & customs proceed to the arrival hall to meet the representative and proceed to the Hotel.', 'Muscat', ''),
(117, 27, 'HALF DAY MUSCAT CITY TOUR', 'After breakfast, pick-up from the hotel and proceed to visit the Grand Mosque (not possible on Friday & other public holidays), highlight of the Muscat city.\n\nProceed to visit Bait Al Zubair Museum to have a glimpse of Omans history.\n\nProceed back to the Hotel.', 'Muscat', ''),
(118, 27, 'DOLPHIN WATCHING TOUR', 'Breakfast at the hotel\n\nTransfer from the Muscat hotel to the Marina to embark on a boat as we search the seas for Dolphins and Whales.\n\nReturn to the Marina and proceed back to the hotel. Rest of the day at leisure on your own to explore the city or enjoy hotel facilities.', 'Muscat', ''),
(119, 27, 'DEPARTURE', 'Breakfast at the hotel\n\nCheck out of the hotel and transfer to Muscat International Airport to catch flight back home.', 'Tour End', ''),
(120, 28, 'Arrive at Muscat international Airport. ', 'Arrive at Muscat international Airport. After Immigration clearance, baggage collection & customs proceed to the arrival hall to meet the representative and proceed to the Hotel.', 'Muscat', ''),
(121, 28, 'HALF DAY MUSCAT CITY TOUR', 'After breakfast, pick-up from the hotel and proceed to visit the Grand Mosque (not possible on Friday & other public holidays), highlight of the Muscat city.\n\nProceed to visit Bait Al Zubair Museum to have a glimpse of Omans history.\n\nProceed back to the Hotel.', 'Muscat', ''),
(122, 28, 'DOLPHIN WATCHING TOUR', 'Breakfast at the hotel\n\nTransfer from the Muscat hotel to the Marina to embark on a boat as we search the seas for Dolphins and Whales.\n\nReturn to the Marina and proceed back to the hotel. Rest of the day at leisure on your own to explore the city or enjoy hotel facilities.', 'Muscat', ''),
(123, 28, 'MUSCAT-NIZWA-JABAL AKHDAR', 'Breakfast at the hotel\n\nProceed to Nizwa, capital of the interior, is the birthplace of Islam in the Sultanate of Oman.\n\nEnjoy the cool climate up in the mountains.', 'Jabal Akhdar', ''),
(124, 28, 'DEPARTURE', 'Breakfast at the hotel\n\nCheck out of the hotel and transfer to Muscat International Airport to catch flight back home.', 'Tour End', ''),
(136, 3, 'd', 'd', 'Tour End', 'Dinner');
