(5, 1, 'Baratang Island is an island of the Andaman Islands. It belongs to the North and Middle Andaman', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Baratang_Island.jpg'),
(6, 1, 'The main archipelago of the Andaman Islands of India. It comprises seven major islands.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Great_Andaman.jpg'),
(7, 1, 'Great Nicobar is the southernmost and largest of the Nicobar Islands of India, north of Sumatra.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Great_Nicobar_Island.jpg'),
(8, 1, 'It is part of Ritchie\'s ArchipelagoIt\'s known for its dive sites and beaches with its coral reefs.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Havelock_Island.jpg'),
(9, 1, 'It is famous beaches of Neil Island,It is ideal for places for swimming and sun bathing.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Lakshmanpur.jpg'),
(10, 1, 'Little Andaman Island is the fourth largest of the Andaman Islands of India with an area of 707 km.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Little_Andaman.jpg'),
(11, 1, 'Is a national park of India near Wandoor on the Andaman Islands..', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Mahatma_Gandhi_Marine_National_Park.jpg'),
(12, 1, 'Neil Island is an Islands, in the Bay of Bengal. Bharatpur Beach has coral reefs teeming with fishs.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Neil_Island.jpg'),
(13, 1, 'North Andaman Island is the northern island of Great Andaman of the Andaman Islands. ', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_North_Andaman_Island.jpg'),
(14, 1, 'Port Blair on South Andaman Island is the capital city of the Andaman and Nicobar Islands.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_portblai.jpg'),
(15, 1, 'South Andaman Island, the island of the Great Andaman and home for majority of the population.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_South_Andaman_Island.jpg'),
(16, 1, 'Wandoor is a small village near the southern tip of South Andaman.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Wandoor.jpg'),
(17, 1, 'A village in the Nicobar district of Andaman Islands, It is located in the Great Nicobar.', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Indira_Point.jpg'),
(18, 1, 'A large island in Middle Andaman with pristine beaches, waterfalls, and interesting islands. ', 'https://itourscloud.com/destination_gallery/asia/india/andaman_and_nicobar_islands/Asia_India_Andaman_and_Nicobar_Islands_Rangat.jpg'),
(19, 2, 'Flight-landing', 'https://itourscloud.com/destination_gallery/asia/flight-landing.jpg'),
(20, 2, 'Flight-take-off', 'https://itourscloud.com/destination_gallery/asia/flight-take-off.jpg'),
