(22, 2, 'Train-depature', 'https://itourscloud.com/destination_gallery/asia/train-depature.jpg'),
(23, 2, 'The Dhyana Buddha statue is a statue of a Buddha in Amaravathi, India.', 'https://itourscloud.com/destination_gallery/asia/india/andhra_pradesh/Asia_India_AP_Amaravati.jpg'),
(24, 2, ' ISKCON temple is in the shape of a horse drawn chariot, with statues of 4 huge horses in front.', 'https://itourscloud.com/destination_gallery/asia/india/andhra_pradesh/Asia_India_AP_Anantapur.jpg'),
(25, 2, 'Annavaram is one of the most famous Holy Shrines in India and enjoying second place after Tirupati.', 'https://itourscloud.com/destination_gallery/asia/india/andhra_pradesh/Asia_India_AP_Annavaram.jpg'),
(26, 2, 'Araku Valley is a hill station surrounded by the thick forests of the Eastern Ghats mountain range. ', 'https://itourscloud.com/destination_gallery/asia/india/andhra_pradesh/Asia_India_AP_araku_valley.jpg'),
(27, 2, 'Chandragiri Fort, a historical fort, built in the 11th century in Chandragiri, in Andhra Pradesh.', 'https://itourscloud.com/destination_gallery/asia/india/andhra_pradesh/Asia_India_AP_Chandragiri.jpg'),
(28, 2, 'Horsley Hills is an enthralling, charming little hill station in Andra Pradesh.', 'https://itourscloud.com/destination_gallery/asia/india/andhra_pradesh/Asia_India_AP_Horsley_Hills.jpg'),
