INSERT INTO `itinerary_master` (`entry_id`, `dest_id`, `special_attraction`, `daywise_program`, `overnight_stay`) VALUES
(1, 1, 'Arrive Port Blair-Cellular Jail-Light & Sound Show', 'On arrive at <b>Port Blair airport</b>, our representative will receive and escorted to the hotel. After check-in at the hotel and little relax, we proceed to covers Cellular Jail (National Memorial), and after Light & Sound Show at <b>Cellular Jail</b>: At evening, we move for the Light and Sound Show at Cellular Jail where the saga of the freedom struggle brought alive.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Port blair'),
(2, 1, 'Port Blair-Havelock Island-Radhanagar Beach', 'Today, we start our journey towards<b> Havelock island</b> via ferry from Port Blair Harbor. On arrival at Havelock Island, our representative will receive and escort you to check-in to the resort. Later we proceed to <b>Radhanagar Beach</b> (Beach No. 7), the Times Magazine rated the finest beach among the best beaches in Asia. It is an ideal place for swimming, sea bathing and basking on the sun kissed beach.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Havelock Island'),
(3, 1, 'Havelock Island Sightseeing', 'After breakfast, day free at <b>Havelock Island </b>for own leisure activities.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Havelock Island'),
(4, 1, 'Havelock Island - Neil Island', 'Today, we start our journey from Havelock island to<b> Neil Island</b> via ferry. On arrival at Neil Island, our representative will receive and escort you to check-in to the Hotel. Then we proceed to visit the sandy beaches at <b>Bharatpur</b> and <b>Lakshmanpur </b>which are very attractive for spending holidays. Tourists who like to spend vacations in an eco-friendly locale will find this Island ideal.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Havelock Island'),
(5, 1, 'Travel from Havelock to Port blair. Later visit Chadiatapu sunset', 'Return back from the amazing experience of Havelock Island to<b> Port Blair.</b> On arrival in Port Blair our representative attends you and drops you to your hotel. Later we proceed to visit <b>Andaman Islands</b> best sunset point, Chidiatapu. Chidiatapu is an amazing destination for bird watching and sunset.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Port blair'),
(6, 1, 'Travel from Port blair to Diglipur Island', 'Depart from Port Blair to <b>Diglipur Island</b> by road through the dense tropical forest and Jarawa Tribal reserve. Often you might see a member of the Jarawa Tribe while passing through the tribal reserve. On your journey you will take the route of Andaman Grand Trunk road passing through Baratang Island, Rangat & Mayabunder. Reach Diglipur, and check into the hotel for overnight stay. During this trip also experience the lifeline of the <b>Andaman Islands</b>, Vehicle Ferry that carries vehicles from one island to the other.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Diglipur'),
(7, 1, 'Trip to Ross and Smith Island. Also visit arial bay beach', 'This day we visit the heart of Diglipur,<b> Ross </b>and<b> Smith Island</b>. 2 Islands separated by a Sand bar is a treat to see and experience. Your journey begins from Arial Bay Jetty by boat. By boat to reach the twin Island. Virgin beaches on this island is a treat to experience. Spend your day enjoying the turquoise water and walk on the Sand bar that adjoins both Ross and Smith Island. We then return back from this trip and visit <b>Aerial bay beach</b> that is one among the turtle nesting grounds in Diglipur.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Diglipur'),
(8, 1, 'Turtle nesting ground. Later diglipur to Rangat', 'Today, we begin our journey to a <b>Turtle nesting ground</b>, Ramnagar Beach. This beach is consistently visited by Olive Ridleys turtles to hatch eggs. The support staff in this destination helps these turtles to protect the laid eggs and to help the young turtles take their first swim in the open waters. Get a chance to experience this during your trip to <b>Ramnagar beach</b>. Later return back from Diglipur to<b> Baratang Island</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Rangat'),
(9, 1, 'Neil Island-Port Blair-City Sightseeing -Shopping', 'After breakfast we start our journey towards Port Blair via ferry from<b> Neil Island</b>. Afternoon we take you for the tour of Port Blair city which covers Samundrika (Naval Marine Museum), Anthropological Museum, which displays the tools, models habitats, art and handcrafts of the aboriginal tribes of Andaman & Nicobar Islands.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Port Blair'),
(10, 1, 'Port Blair-Ross Island-North Bay Island (Coral Island)', 'Today, after breakfast we will proceed for a full day cruising towards <b>Ross Island</b>, & <b>North Bay</b>(Coral Island)\nRoss Island: First we starts the exhilarating journey to Ross Island the erstwhile capital of Port Blair during the British regime, it now stands an imposing relic, with the structure almost in debris. A small museum displays photographs and other antiques of the Britishers, relevant to these islands.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Coral Island'),
(11, 1, 'Joyful trip to North Bay island', '<b>North Bay</b> (Coral Island): From Ross Island, we proceed for a joyful trip to North Bay island (Coral Island) offering exotic coral, colorful fishes and underwater marine life. We can view these colorful corals & underwater marine life via in glass bottom boat and Snorkeling (optional).<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'North Bay island'),
(12, 1, 'Day at Leisure. We do nothing-We Just relax.', 'Day at leisure. How, about relaxing in the lap of nature? Today, you can relax and spend the day enjoying white sand beaches. Additional activities such as <b>Scuba Diving</b> and Sea Walk can be done on this day.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Port blair'),
(13, 1, 'Depart from Port Blair Islands', 'Drop to Port Blair for Return journey.', 'Tour Ends'),
(14, 5, 'Arrival Ahmedabad', 'Arrive <b>Ahmedabad</b> early morning. Proceed to Hotel, Later visit <b>Sabarmati Aashram</b>, Akshardham Temple.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Ahmedabad'),
(15, 5, 'Ahmedabad-Dwarka', 'After breakfast proceed to<b> Dwarka</b>. Overnight stay at Dwarka.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dwarka'),
(16, 5, 'Dwarka Temple sightseeing', 'After breakfast visit<b> Dwarkadheesh Temple</b>, Rukmmini Temple. After lunch Take ferry to Bet Dwarka (Island) Original Dwarka,Nageshwar Temple. Overnight stay at Dwarka.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dwarka'),
(17, 5, 'Travel Dwarka-Somnath', 'After breakfast proceed to <b>Somnath</b>. After refreshment go for Somnath Darshan, then visit Bhallaktirth, Dehotsarg and Prabhas Patan.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Somnath'),
(18, 5, 'Somnath-Gir-Junagarh', 'After breakfast proceed to <b>Junagarh</b>, on the way visit <b>Gir Forest</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Junagarh'),
(19, 5, 'Junagarh-Girnar-Junagarh', 'Today visit<b> Girnar Parvat</b> in morning. Later visit Ashok Shaila-lehk, Uparkot Fort.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Junagarh'),
(20, 5, 'Junagarh-Vearval', 'After breakfast proceed Veraval Airport/Railway station.', 'Tour Ends'),
(21, 5, 'Ahmedabad to Barods', 'After breakfast check out from hotel and drive to <b>Baroda</b>. Proceed for Darshan to Shree Ranchhodraiji Temple at Dakor and then transfer to Baroda. Check in to your hotel. Then visit Baroda Sayaji Baugh and Museum.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Baroda'),
(22, 5, 'Day Tour to tatue Of Unity', 'After breakfast we go for day trip from Baroda. First we visit <b>Neelkath Dham</b>, Kuber Bhandari Mahadev and Narmada River Darshan and later transfer for lunch at Rajpipda Village. After lunch we visit Rajwant Palace Museum and later transfer to Visit Statue of Unity, <b>Shree Sardar Vallabh Bhai Patel\'s </b>182Meter tall Statue -the world\'s tallest statue. We also enjoy Laser Show and later transfer to Baroda.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Baroda'),
(23, 5, 'Baroda to Ahmedabad', 'After breakfast check out from Hotel and visit <b>Laxmi Vilas Palace</b> and later transfer to Ahmedabad, as per time we visit Hathi Singh Jain Temple, Vintage Car museum, Siddi Saiyad Mosque, and now its time to say good bye and drop at Railway Station / Airport.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(24, 5, 'Baroda to Ahmedabad Airport', 'After breakfast check out from Hotel its time to say good bye and drop at Railway Station / Airport.', 'Tour Ends'),
(25, 6, 'Arrival Chandigarh Airport', 'Arrival at Chandigarh Airport. Drive you to <b>Shimla</b>. On reaching Shimla check into your hotel. Evening Proceed for local sightseeing in and around Shimla such as the ridge to walk along the Mall, Lakkar Bazaar, Jakhoo Hill, St. Michaels Cathedral, State Museum, Kali bari Temple, Hanuman Temple.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Shimla'),
(26, 6, 'Shimla Local Sightseeing', 'Local Sightseeing After breakfast proceed for wonderful day excursion to <b>Kufri</b>. In Kufri enjoy a walk through thick cedar woods to Mahasu Pick for amazing view of mighty <b>Himalayas</b>. You can do wonderful photography also. Evening do some shopping at very famous Mall road of Shimla. <b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Shimla'),
(27, 6, 'Travel Shimla to Manali', 'After having breakfast transfer to <b>Manali</b>. on the way, you can view beautiful flora of nature. On reaching Manali check into your Hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Manali'),
(28, 6, 'Manali Local Sightseeing', 'After breakfast proceed for full day local sightseeing of<b> Manali </b>like Hadimba Temple, Tibetan Monastery, Lord Buddha and Tankha paintings, Vashistha Temple for Hot & Cold water Kund, Club House. The evening is free leisure & you can move around to the Mall Road for shopping.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Manali'),
(29, 6, 'Manali - Rohtang Pass', 'After breakfast proceed on a day excursion to the <b>Rohtang Pass</b> also called Snow Point of Himachal-enjoy the beauty of year around snow caped mountains. Guests enjoy Skiing experience. On the way, back visit Solang Valley, hub of adventure sports in Manali such as Paragliding, Zorbing etc. Solang Valley turns into a Ski resort in Winter. The rest of the day is free to explore this picturesque town on your own<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Manali'),
(30, 6, 'Manali- Atal Tunnel- Manali', 'After breakfast visit <b>Atal tunnel </b>after that visit Mall Road, overnight at Hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Manali'),
(31, 6, 'Manali to Dharamshala', 'After breakfast, travel to <b>Dharamshala</b>- on the way stopping at Baijnath known for its Shiva Temple and further at Palampur famous For Tea Garden. Dharamhsala is a hill-station lying on the spur of the Dhauladhar Mountains about 18 kms north-east of Kangra, It is known for its scenic beauty set amidst high pine and oak trees.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dharamshala'),
(32, 6, 'Dharamshala To Dalhousie', 'After Breakfast drive from Dharamshala towards <b>Dalhousie</b> after doing the local sightseeing of Places which includes, His holiness Dalai lama residence at Mc Leodgunj, War memorial, Bhagsunath temple and <b>Dal Lake</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dalhousie'),
(33, 6, 'Dharmshala-Manali (215 Kms)', 'After breakfast, leave for Manali, Reach<b> Manali</b> by evening. En route visit Kullu Valley & Kullu Shawl factory, check in hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Manali'),
(34, 6, 'Dalhousie to Khajjiar', 'After Breakfast local sightseeing of<b> Dalhousie</b> includes visit to Panjipula, Subhash Baoli and excursion to Khajjiar. Surrounded by varied vegetation, pines, dodders, oaks and flowering rhododendron.from Dalhousie surrounded by thick Deodar forest. Drive from Dalhousie to <b>Khajjiar </b>is awesome.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Khajjiar'),
(35, 6, 'Dalhousie to Delhi', 'After breakfast proceed to <b>Delhi airport</b> for your onward journey<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour End'),
(36, 6, 'Manali - Chandigarh', 'After taking breakfast proceed to <b>Chandigarh</b> (275 kms / 9 Hrs). on reaching at Chandigarh you can visit Sukhna lake and enjoy boating there later check into your hotel. Enjoy your Dinner.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Chandigarh'),
(37, 6, 'Dalhousie to Chandigarh', 'After breakfast you check out the hotel and proceed for city tour, Start with <b>Rock Garden </b>which consists of various arts and objects made of industrial and urban waste. Later proceed for Delhi Airport to Catch the Flight for back to home with sweet memories.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour End'),
(38, 6, 'Day-14 Shimla-Chandigarh (129 Kms)', 'Early Morning after breakfast check out Hotel drive to Chandigarh en route visit Rock garden,Pinjore Garden. In the evening at <b>Sukhana Lake</b> check in hotel<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Chandigarh'),
(39, 6, 'Day-15 Chandigarh-Home Town', 'Early Mornning after breakfast check out hotel transfer to Airport.', 'Tour End'),
(40, 8, 'Arrive at Bangalore', 'On arrival, transfer to the hotel, later visit<b> Lalbagh</b>, Vidana Soudha, Museum and ISKON temple.<b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bangalore'),
(41, 8, 'Drive to Mysore', 'After breakfast, check-out and proceed to<b> Mysore</b>. Enroute visit Srirangapatna (Dariya Daulat Bagh, Gumbaz, Tippu Fort and Ranganathaswamy Temple). Check in to Hotel on arrival. Evening proceed to <b>Brindavan Gardens</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mysore'),
(42, 8, 'Mysore sightseeing', 'After breakfast, proceed for a city tour in which we will see Maharaja\'s Palace, <b>Chamundi Hill</b>, Big Bull, St. Philomena\'s Church, Jagan Mohan Palace(Art Gallery) and Zoo.<b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mysore'),
(43, 8, 'Drive to Ooty', 'After breakfast checkout and proceed to Ooty<b></b>, on arrival in Ooty check-in to a hotel. Later visit Ooty lake, Botanical Gardens.<b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Ooty'),
(44, 8, 'Ooty sightseeing', 'After breakfast, proceed to <b>Coonoor</b>. Where we will see Sim\'s Park\' lam\'s Rock, Dolphin Nose, Tea factory and tea Gardens. We can also visit <b>Doddabetta Peak</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Ooty'),
(45, 8, 'Drive to Kodaikanal', 'After morning breakfast checkout and proceed to <b>Kodaikanal</b>. Check in to hotel on arrival. In the evening visit Cookers walk, Green valley view, and the Lake.<b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kodaikanal'),
(46, 8, 'Kodaikanal', 'After morning breakfast, proceed to visit <b>Pillar\'s Rocks</b>, Silent Valley View, Silver cascade falls.<b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kodaikanal'),
(47, 8, 'Kodaikanal to Bangalore Airport', 'After breakfast checkout and proceed to<b> Bangalore</b> to board your flight.<b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(48, 8, 'Kodaikanal to Coimbatore Airport', 'After breakfast checkout and proceed to Coimbatore to board your flight.', 'Tour Ends'),
(49, 7, 'Arrival at Srinagar', 'On arrival at <b>Srinagar Airport</b> you will meet to our representative and transfer you to Houseboat. In the evening enjoy Boat ride \'<b>Shikara</b>\' around Dal Lake (By own/included).<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Houseboat/Srinagar'),
(50, 7, 'Srinagar to Pahalgam ', 'After breakfast leave from Srinagar and drive to <b>Pahalgam</b> (Vale of Kashmir). Pahalgam is the most famous place for Film industry.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pahalgam'),
(51, 7, 'Pahalgam local sightseeing', 'Full day enjoyment in <b>Pahalgam</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pahalgam'),
(52, 7, 'Pahalgam to Gulmarg', 'After breakfast leave from Pahalgam and drive to <b>Gulmarg</b>. In the way visit saffron fields and en-route Avanti Raja\'s ruined Palace You can enjoy a pony ride and also enjoy a Gondola ride (cable car)(by own) to<b> Khilanmarg</b>. Evening is free to explore the charm & natural beauty of Gulmarg Valley, \', in the evening return to <b>Srinagar</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Gulmarg'),
(53, 7, 'Gulmarg to Srinagar', 'After breakfast leave from Gulmarg and drive to Srinagar, After fresh up leave for <b>Mughal Gardens Nishat</b>, Shalimar & Shankaracharya.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Srinagar'),
(54, 7, 'Srinagar - Sonamarg - Srinagar', 'After breakfast leave from Srinagar and drive to <b>Sonamarg</b>, full day excursion to Sonamarg. Sonamarg is known as \'Gateway of Ladakh\', in the evening return to Srinagar.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Srinagar'),
(55, 7, 'Pahalgam to Katra', 'After breakfast transfer to <b>Katra</b>. Evening arrive at Katra. Check in to hotel. Evening free for Shopping.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Katra'),
(56, 7, 'Mata Vaishnodevi Darshan', 'Early morning start for trek of <b>Mata Vaishnodevi</b>. Evening back to hotel from Darshan.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Katra'),
(57, 7, 'Katra Jammu drop', 'After breakfast transfer to <b>Jammu Airport</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour End'),
(58, 9, 'Arrive Cochin & local sightseeing', 'Morning pick up from <b>Cochin Airport/Station</b>, later transfer to Hotel, check in and proceed for Local Kochi Sightseeing-Visit Chinese Fishing Net, Portuguese Synagogue, Mattancherry Spice Market, <b>Bolgatti Palace</b>.', 'Cochin'),
(59, 9, 'Arrive Cochin & overnight stay', 'Morning pick up from <b>Cochin Airport/Station</b>, later transfer to Hotel, check in the hotel.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Cochin'),
(60, 9, 'Cochin to Munnar travel', 'In the morning after breakfast, check out from hotel, and proceed towards<b> Munnar</b>, this is called as \'nature lover\'s Paradise\' with sprawling tea plantations. On arrival here, check in to the Hotel. In the evening proceed to <b>Mettupatty dam</b>, visit Echo point & shooting point.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Munnar'),
(61, 9, 'Munnar local sightseeing', 'After breakfast, proceed for Munnar local sightseeing, covering Mattupetty dam, Eco Point, On the way take photo stop at tea Plantation. The we will visit<b> Tea Museum</b>.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Munnar'),
(62, 9, 'Munnar to Thekkady', 'After breakfast check out, proceed to <b>Periyar</b>. A scenic Journey past mist capped mountains, spice plantations and open grasslands lined with Spectacular Water falls & delightful trekking trails form the access to your hide way here. On arrival check into Hotel. In the afternoon take a <b>boat tour in Periyar Lake</b>. Later in the evening you can enjoy <b>Kathakali show</b> (at extra cost).<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Thekkady'),
(63, 9, 'Thekkady to Alleppey', 'After Breakfast check out and visit to <b>Spice Garden</b>, where you can purchase spices for yourself. Later Proceed to <b>Alleppey/Kumarakom</b>, on arrival check in to the Hotel. Later on you may proceed to enjoy<b> Backwater ride</b>. (At extra cost).<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Alleppey'),
(64, 9, 'Alleppey to Kanyakumari ', 'Early Morning after Breakfast Start for Full day <b>Kanyakumari</b>, same day Arrival, visit Vivekananda Memorial, Amman Temple, Evening Enjoy Sunset, Afterwards Start back to Hotel.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Kanyakumari'),
(65, 9, 'Kanyakumari to Trivandrum/Kovalam', 'Morning breakfast at hotel and drive to<b> Trivandrum</b>. Enroute you can visit <b>Sucheendram Temple</b>. On arrival transfer to hotel, check in. Evening spend time on beautiful <b>Kovalam Beach</b>. Night halt at Trivandrum/Kovalam.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Trivandrum'),
(66, 9, ' Trivandrum/Kovalam local sightseeing', 'Morning breakfast at hotel. Leave for city tour of <b>Trivandrum</b> visiting the <b>ancient Temple </b>of Sri Padmanabhaswamy is one of the major attractions in the city of Thiruvananthapuram and also visit Napier museum, Sri Chitra Art Gallery and Botanical Gardens. Evening at leisure.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Trivandrum'),
(67, 9, 'Trivandrum airport drop', 'Morning after Breakfast Check out Hotel, later depart to <b>Trivandrum Airport</b>, drop at Airport.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(68, 10, 'Kanha National Park', 'Transfer to<b> Kanha National Park</b>. Kanha\'s Sal and bamboo forests, rolling grasslands and meandering streams stretch over 940 sq km in dramatic natural splendor which form the core of the Kanha Tiger Reserve created in 1974 under Project Tiger arrive at <b>Kanha</b> Free time for relaxation.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kanha'),
(69, 10, 'Kanha National Park Safari', 'Early morning proceed to <b>Kanha Wild Life Safari</b>. Expect encounter with exotic creatures of the jungle. After lunch free time for relaxation.\nSafari Timing -6:00 Am & 2:00 Pm<b></b><b></b><b></b><b></b>', 'Kanha'),
(70, 10, 'Travel Kanha-Jabalpur', 'After breakfast check out hotel & drive to <b>Jabalpur</b>. En route visit Beda Ghat (famous for marble rocks), and Dhuwadhar Waterfalls. Check in to the hotel & free time for relaxation.<b></b><b></b><b></b><b></b>', 'Jabalpur'),
(71, 10, 'Jabalpur -Panchmarhi', 'After breakfast check out hotel & drive to <b>Panchimarhi </b>check in the hotel & free time for relaxation.<b></b><b></b><b></b><b></b>', 'Panchamarhi'),
(72, 10, 'Panchamarhi local sightseeing', 'After breakfast, proceed for <b>Panchmarhi</b> Sightseeings. Visit Pandav Caves, Handi Kho, Priyadarshani Valley, Gupt Mahadeo Mandir and Bada Mahadev Mandir. After visit <b>Jatashankar Temple</b> and <b>Sunset point </b>(Rajendra Giri).<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Panchamarhi'),
(73, 10, 'Panchamarhi', 'After breakfast check out from the hotel & drive to Airport for your onward journey with a <b>life time memories</b>.<b></b><b></b><b></b><b></b>', 'Tour Ends'),
(74, 13, 'Jaipur arrival', 'Arrive in Jaipur. Proceed to enjoy a half day sightseeing tour of <b>Jaipur</b>. Visit the City palace and local market etc<b></b><b></b><b></b>', 'Jaipur'),
(75, 13, 'Arrival Mount Abu', 'Arrive at <b>Mt.Abu Road station</b>,Enjoy the unique experience of Sunset.<b></b><b></b><b></b>', 'Mount Abu'),
(76, 13, 'Mount Abu City Tour', 'After breakfast full day city tour includes <b>Dilwara temple</b>, The sun set point, <b>Prajapita Bramhakumari Ashram and University</b>-\'The impartation of Spiritual knowledge and meditation and picturesque Nakki Lake<b></b><b></b><b></b><b></b><b></b><b></b>', 'Mount Abu'),
(77, 13, 'Travel Mount Abu to Udaipur', 'After breakfas, drive toward the <b>Udaipur </b>on the way Visit to famous<b> jain temples</b> of Ranakpur, later visit haldighati maharana pratap museum.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Udaipur'),
(78, 13, 'Udaipur local sightseeing', 'After breakfast,Later start to city sight seeing tour of <b>Udaipur</b>.Visit the City Palace museum, Saheliyo ko badi, Bhartiya Lok Kala Mandir ( Folk art museum) and the Pratap Memorial. Rest of the day at leisure.<b></b><b></b><b></b>', 'Udaipur'),
(79, 13, 'Travel Udaipur-Chittorgarh-Ajmer-Pushkar', 'After breakfast, drive toward to <b>Ajmer </b>and Enroute visit Chittorgarh Fort -Ranakumbha, Meera mandir, Vijay stambha and Padmini\'s palace. Arrive at Ajmer and visit<b> Dargah Shariff</b>, at Ajmer.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Pushkar'),
(80, 13, 'Pushkar-Jaipur', 'After breakfast, proceed to <b>Jaipur</b>. Enroute visit Bramha mandir and Pushkar lake, Arrive at Jaipur. Transfer to hotel.<b></b><b></b><b></b>', 'Jaipur'),
(81, 13, 'Jaipur city sightseeing', 'Today after breakfast enjoy a full day sightseeing tour of <b>Jaipur</b>. Visit Amer Fort, Hawa Mahal, <b>Jantar Mantar</b>, City Palace, Museum, Govinddev Temple and Jalmahal.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Jaipur'),
(82, 13, 'Travel Jaipur to Bikaner', 'After breakfast drive to<b> Bikaner</b>. Upon arrival, check in to the hotel. In the evening visit a Camel breeding farm and the world famous <b>Karni Mata Temple</b>, also known as Deshnok Temple. Evening is at leisure.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Bikaner'),
(83, 13, 'Travel Bikaner to Jaisalmer', 'After breakfast visit <b>Junagarh fort.</b> Later proceed to Jaisalmer - \'The Golden City\' of Rajasthan. <b>Jaisalmer</b> is famous for its yellow sandstone structures, dusky landscape and romantic sand dunes. Jaisalmer was the window of the Thar, connecting India to Central Asia, Persia, Egypt and the west, thus making the city a cultural cauldron.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Jaisalmer'),
(84, 13, 'Jaisalmer sightseeing & Desert safari', 'After breakfast, visit the <b>Golden Fort </b>of Jaisalmer, Patwon Ki Haveli\'s and Salim Singh ki Haveli. See the manmade Gadsisar lake and the royal cenotaphs at Bada Bagh. In the evening experience <b>camel safari </b>in the rolling sand dunes and enjoy dinner.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Jaisalmer'),
(85, 13, 'Travel Jaisalmer to Jodhpur', 'After an early breakfast, proceed to <b>Jodhpur</b>. Upon arrival check in at the hotel. In the afternoon enjoy Jodhpur sightseeing. Visiting the best preserved fort of Rajasthan -<b>the Mehrangarh fort</b>. Later see the <b>marble cenotaph</b> at Jaswant Thada.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Jodhpur'),
(86, 13, 'Jodhpur Local sightseeing', 'After breakfast leave for <b>Jodhpur </b>local-Jodhpur-the stronghold of the fierce Rathore clan, was founded in 1459 by Prince Jodha. Visit<b> the Mehrangarh Fort</b>, situated on a low sandstone hill. Within the fort, visit Moti Mahal and Phool Mahal and Umaid Bhavan Palace.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Jodhpur'),
(87, 13, 'Day-14 Jodhpur Ajmer/Pushkar', 'After breakfast checkout from the hotel and visit <b>Umaid Bhawan Palace</b> and vintage car museum. Then proceed to <b>Pushkar</b>. Upon arrival check in at hotel. In the afternoon enjoy the sightseeing of Pushkar visiting <b>Lord Bramha Temple</b>, Holy Lake Pushkar and thr local colourful market.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pushkar'),
(88, 13, 'Day-15 Pushkar Jodhpur Departure', 'After breakfast checkout from the hotel and visit the <b>Ana sagar lake</b> and <b>Dargah</b>. Later transfer to railway station / Airport at Jaipur for your onwards destination. Return home with eternal memories of you tour with Mango Holidays!<b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour End'),
(89, 14, 'Arrival at Bagdogra', 'Arrival at Bagdogra / New Jalpaiguri-to <b>Darjeeling</b>. Check out from the hotel.<b></b><b></b>', 'Bagdogra'),
(90, 14, ' Tiger Hil, Ghoom Monastery,Padmaja N. Zoological Garden', 'Early morning proceed to <b>Tiger Hill </b>to watch the spectacular sunrise and its amazing effects on the <b>Mt. Kanchendzonga</b>, \nVisit Ghoom Monastery and Batashia Loop War Memorial while returning to the Hotel. Breakfast at the Hotel followed by half day local Best points sightseeing. Visit Padmaja N. Zoological Garden Himalayan Mountaineering Institute, Tibetan Refugee Self-help Center, Ropeway. Evening visit Mall and Local Market for shopping & individual activity.<b></b><b></b><b></b><b></b>', 'sikkim'),
(91, 14, 'Trip to Tsomgo Lake Baba Mandir Meals', 'After breakfast Excursion Trip to <b>Tsomgo Lake Baba MandirMeals</b>. Evening free for individual activity and leisure.<b></b><b></b>', 'sikkim'),
(92, 14, 'Travel to Gangtok to LachungMeals', 'After breakfast proceed to<b> Gangtok</b> to LachungMeals, Visit Chortan( Stupa) Institute of Tibetology, Institute of Handicrafts and handlooms, Ranka Monastery & Jakhri water falls.<b></b><b></b>', 'sikkim'),
(93, 14, 'Travel to  Yumthang Valley Meals', 'After breakfast proceed to <b>Yumthang ValleyMeals</b>. Day trip to <b>Tsomgo lake</b> ,32kms from Gangtok City. Evening free at Gangtok for shopping and individual activity.<b></b><b></b><b></b><b></b>', 'sikkim'),
(94, 14, 'Travel to airport', 'After breakfast proceed to<b> GangtokMeals</b> Transfer to Bagdogra Airport / New Jalpaiguri Railway Station. Tour with<b> sweet memories</b>.<b></b><b></b><b></b><b></b>', 'Tour Ends'),
(95, 15, 'Arrive Madurai', 'Arrive Madurai Railway Station/Airport. Report to our representative & transfer to hotel. Evening visit <b>Meenakshi Temple</b>. Evening free time for Shopping.<b></b><b></b><b></b><b></b><b></b>', 'Madurai'),
(96, 15, 'Travel Madurai-Tiruchirappalli-Thanjavur', 'After breakfast check out from hotel & proceed to <b>Tiruchirappalli</b>- formerly called Trichinopoly in English, nicknamed Tiruchi. On arrival visit<b> Srirangam Temple</b> of Lord Vishnu. After Lunch proceed to Thanjavur.<b></b><b></b>', 'Thanjavur'),
(97, 15, 'Thanjavur local sightseeing', 'After breakfast proceed to visit <b>Thanjavur</b> local sightseeing. Visit <b>Brihadeshwara Temple </b>of Shiva the famous temple in Tanjore, Thanjavur Fort -Sivaganga Tank, The Palace, Art Gallery, Royal Museum & Serfoji Memorial Hall. In the evening free time for leisure.<b></b><b></b>', 'Thanjavur'),
(98, 15, 'Thanjavur Vellore', 'After early breakfast check out from hotel & proceed to <b>Vellore</b>. On arrival visit Vellore Fort, Fort Museum, Jalakandeswarar Temple. After visit check-in at hotel.<b></b>', 'Vellore'),
(99, 15, 'Vellore-Kanchipuram-Mahabalipuram', 'After breakfast check out from hotel & visit <b>Vellore Golden Temple</b>. After visit proceed to <b>Kanchipuram</b>. On arrival visit Kanchi Kamakshi Temple & Shankaracharya Math. In the evening proceed to Mahabalipuram On arrival check-in at hotel.<b></b><b></b>', 'Mahabalipuram'),
(100, 15, 'Mahabalipuram-Chennai', 'After breakfast check out from hotel & visit Group of <b>Monuments-Shore Temples</b>, Krishna\'s Butter Ball, Rock cut Mandapam, Panch Ratha. After lunch proceed to <b>Chennai</b>. On arrival drop at Chennai Airport /Railway station to board your flight/train to your hometown.<b></b><b></b>', 'Tour Ends'),
(101, 15, 'Departure from Chennai airport', 'After breakfast check out from hotel & drop at<b> Chennai Airport /Railway station </b>to board your flight/train to your hometown.<b></b>', 'Tour Ends'),
(102, 17, 'Delhi - Mussoorie', 'Welcome Greetings on arrival at Delhi or Dehradun airport and transfer to<b> Mussoorie</b> known as queen of hill station. Evening reached and check in to hotel and night stay.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mussoorie'),
(103, 17, 'Mussoorie Sightseeing', 'Breakfast and get ready to visit <b>Kempty Falls</b>-it offers a mesmerising panoramic view as the water falls from the mountains, , Company garden, Mussoorie lake, Later we enjoy Ropeway Ride at <b>Gun Hill point </b>on direct payment which is a favourite place for viewing picturesque Himalayan range. At Gun Hill point you can photograph yourself in a Pahadi outfit.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mussoorie'),
(104, 17, 'Rishikesh to Haridwar', 'Breakfast and proceed to <b>Haridwar</b> via Rishikesh where you can enjoy rafting on direct payment, Parmarth ashram, Laxman jhula visit and evening participate in Ganga aarti and Night stay.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Haridwar'),
(105, 17, 'Travel to Corbett national park', 'Breakfast and take holy bath at <b>Ganga</b> at Har ki Pauri and proceed to visit <b>Mansa devi temple</b> by cable car on direct payment, after that drive to Wildlife destination Corbett national park. Evening reached and night stay.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Corbett'),
(106, 17, 'Nainital Safari', 'Early morning proceed to <b>safari </b>and after that visit Garjiya temple and Corbett fall and museum and drive to Nainital, queen of Lake in Uttarakhand.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Nainital'),
(107, 17, 'Nainital Sightseeing', 'Breakfast and proceed to<b> Naina devi Temple darshan</b>, Cable car on direct payment to experience snow view point which offers a panoramic view of the mighty Himalayas. Later we see <b>Raj Bhawan</b> - The Governor\'s House, followed by a visit to H<b>anumangarhi temple</b> - one of the most popular temples of Lord Hanuman and Chidiyaghar Zoo - a high altitude zoo situated in Nainital. In the evening we experience boat ride on direct payment at Naini Lake, followed by free time for shopping at Nainital\'s beautiful Mall road.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Nainital'),
(108, 17, 'Departure', 'Breakfast and proceed to Delhi airport journey after completing memorable <b>uttarakhand </b>trip.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(109, 17, 'Delhi to Haridwar', 'On arrival at Delhi airport / Railway station & drive to<b> Haridwar</b> check in Hotel evening visit Hari Ki Pairi for <b>Ganga Aarti</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Haridhwar'),
(110, 17, 'Haridwar-Rishikesh-Mussoorie', 'Morning after breakfast check out Hotel drive to<b> Mussoorie </b>enroute visit Kankhal,Bharat Mata Temple, Geeta Bhavan and Laxman Zhulla at Rishikesh check in Hotel. Evening free for leisure O/N stay at Mussoorie.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mussoorie'),
(111, 17, 'Mussoorie Local Sightseeing', 'After Breakfast Visit <b>Kempty Falls</b>. Enjoy Rope way ride, Gunhill point and Kulri market in the evening. Photograph yourself in pahadi outfit at Gunhill point. O/N stay at Mussoorie.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mussoorie'),
(112, 17, 'Mussoorie-Corbett Park', 'After breakfast, check out Hotel drive to<b> Jim Corbett National Park</b>. Corbett Park is famous for its wild population of tigers, leopards and elephants.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Corbett'),
(113, 17, 'Corbett Local sightseeing', 'Early morning proceed for a <b>Jungle Safari</b> in the National Park, wherein you may encounter wildlife within the Jungle like Tiger, Elephant, Wild Boar, Deer, Peacock, Jackals, and Leopards etc.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Corbett'),
(114, 17, 'Corbett Park-Nainital', 'After breakfast check out hotel and proceed to Nainital. En-route visit <b>Ranikhet</b> check in Hotel evening enjoy boating at Naini Lake and visit <b>Nainadevi Temple</b>. Free time for shopping.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Nainital'),
(115, 17, 'Day-14 Nainital-Delhi-Home Town', 'Early Morning after breakfast check out hotel & transfer to Railway station/Airport for your onward journey with a life time memories.', 'Tour Ends'),
(116, 41, 'Arrive Hyderabad', 'Pick up from Airport or station Proceed to Hotel after freshen up, Visit <b>Salarjung Museum houses</b> part of the huge collection of Nawab Salarjung 3rd a Nizam\'s prime minister, Husain Sagar Lake to visit Granite Rock Statue of Buddha, Lumbini Park, Lasers show, NTR Garden, and overnight stay at the respective hotel Hyderabad.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hyderabad'),
(117, 41, 'Hyderabad local sightseeing', 'After Breakfast visit <b>Golconda Fort</b> is one of the most wonderful monuments, located 11 km. from Hyderabad, Snow World- India\'s biggest first snow fall theme Park, Birla Mandir is a Hindu Temple of Lord Venkateshwara, built entirely of white marble.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hyderabad'),
(118, 41, 'Hyderabad local sightseeing', 'After Breakfast Visit <b>The Nehru Zoological Park</b>, also known as the Hyderabad Zoo, is one of the largest zoos in India, Sudha Car Museum which is the first and only handmade Wacky Car museum, Chowmahalla Palace which was the official residence of the Nizams of Hyderabad while they ruled their state and this palace was built by Nizam Salabat Jung, and Shopping at Laad Bazar.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hyderabad'),
(119, 41, 'Hyderabad to Sri Sailyam', 'Morning after breakfast checkout hotel and depart for <b>Sri Sailyam</b>, afternoon arrival & transfer to hotel-later visit: Mallikarjuna Swamy temple<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Sailyam'),
(120, 41, 'Travel Sri Sailyam to Nagarjunasagar', 'After breakfast checkout hotel, visit: other local temples Paladara / Panchadara, Sakshi Ganapati, Sikharam, Dam and depart for <b>Nagarjunasagar</b>, evening transfer to hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Nagarjunasagar'),
(121, 41, 'Travel Nagarjunasagar to Hyderabad', 'After breakfast visit: Nagarjunakonda island museum, Anupu, <b>Ettipotala waterfalls</b> & depart for Hyderabad. Evening drop at station /Airport.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(122, 30, 'Arrive Kathmandu', 'Arrival at<b> Kathmandu International airport</b>. Meet & welcome by our representative & transfer to hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kathmandu'),
(123, 30, 'Local sightseeing of Kathmandu', 'Proceed for the full-day sightseeing tour to <b>Kathmandu valley</b> covering Pashupatinath temple- holiest and oldest Hindu temple, <b>Boudhanath</b> stupa- one of the biggest stupa of the world and Swoyambhunath stupa known as <b>monkey temple</b>- oldest Buddhist stupa situated on a hillock overlooking Kathmandu valley and eastern Himalayan ranges. <b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kathmandu'),
(124, 30, 'Drive Kathmandu to Nagarkot', 'Return & checkout from the hotel and drive for <b>Nagarkot</b>. En-route visit <b>Bhaktapur Durbar square</b>- the finest durbar square of the valley where one can visit golden gate, Palace of 55 windows, Nyatapole temple etc. Finally arrive Nagarkot and check into the hotel. Evening enjoy <b>golden panoramic </b>view of eastern Himalaya with sunset. Overnight in Nagarkot.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Nagarkot'),
(125, 30, 'Nagarkot to Kurintar', 'Enjoy early morning sunrise view. After breakfast proceeds for <b>Kurintar</b>. Check in to the hotel. You can visit <b>Manakamanna temple</b> by cable car on your own.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kurintar'),
(126, 30, 'Kurintar to Pokhara', 'After breakfast drive to <b>Pokhara</b> observing the scenic views on the national highway along the<b> Trishuli River</b>. Upon arrival, check into the hotel. Evening walk around the tourist area of Lake Side and enjoy the view of western Himalayan ranges with Mt Fishtail.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pokhara'),
(127, 30, 'Pokhara Tour', 'Wake up early to witness the breathtaking sunrise and <b>Himalayan </b>view from your hotel rooftop. After breakfast, leave for sightseeing tour of <b>Pokhara valley</b> covering Davis Fall, Tibetan Refugee Camp, Seti gorge &Fewa Lake with1 hour boat ride on Lake Fewa. Rest of the day visit around Lake areas.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pokhara'),
(128, 30, 'Drive Pokhara to Chitawan', 'After breakfast, check-out and drive to <b>Chitawan National Park</b>. Proceed for jungle activities.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Chitawan'),
(129, 30, 'Chitawan Safari Activities', 'Breakfast & start <b>jungle safari</b> on Elephant back to see different kinds of deer, rhinoceros, wild boar, leopard, monkeys, birds and many other smaller animals. After elephant back safari tour proceed for <b>Dugout Canoe Ride</b> along with Dungre / Raptiriver to see 2 type of rare species of crocodile. Visit elephant breeding farm & drive back to the lodge. Late afternoon Village walk can be organized nearby Tharu village. Walk / drive back to the lodge/resort. Evening enjoy <b>\'Tharu Tribal Dance</b>\' presented by the local Tharu villagers.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Chitawan'),
(130, 30, 'Drive Chitawan to Kathmandu', 'After breakfast , check-out and drive back to <b>Kathmandu</b>. Arrive Kathmandu and check into hotel. Rest of the day is free to explore your own.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kathmandu'),
(131, 30, 'Departure from Kathmandu', 'Breakfast & check out from hotel. Timely transfer to the airport for flight to your onward destination.', 'Tour Ends'),
(132, 40, 'Paro Airport- Thimphu', 'Meet & Greet on arrival at Paro Airport and transfer to <b>Thimphu</b> (7,710 ft.) the capital city of Bhutan. On arrival check in at the hotel. Evening explore the Thimpu town by walk<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Thimphu'),
(133, 40, 'Arrival at Bagdogara Airport proceed to Phuentsholing', 'On arrival at Bagdogara Airport & proceed to<b> Phuentsholing</b>. Check in at Hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Phuentsholing'),
(134, 40, 'Phuentsholing to Thimphu', 'After breakfast, complete the immigration formalities and proceed to <b>Thimphu</b> (7,710 ft.) -The capital city of Bhutan. On arrival check in to hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Thimphu');
INSERT INTO `itinerary_master` (`entry_id`, `dest_id`, `special_attraction`, `daywise_program`, `overnight_stay`) VALUES
(135, 40, 'Travel Thimphu - Punakha', 'Post breakfast take the transfer to Punakha / Wangdue Phodrong via Do-Chula Pass (10000 ft). Check-in to your hotel on arrival. Post lunch local tour including visit to <b>Punakha Dzong</b> and the confluence of Po chu & Mo chu.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Punakha'),
(136, 40, 'Transfer from Punakha-Paro', 'After breakfast take the transfer to<b> Paro</b>. Check-in to your hotel on arrival.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Paro'),
(137, 40, 'Paro Local Sightseeing', 'Post breakfast embark on a full day local sightseeing tour of Paro covering Drugyel Dzong, Paro Dzong, Taksthang Monastery (also known as Tiger Nest) view point.', 'Paro'),
(138, 40, 'Paro to Phuentsholing', 'After breakfast, visit Kyichu Monastery & proceed to <b>Phuentsholing</b>. On arrival check in at hotel. Evening free time for leisure.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Phuentsholing'),
(139, 40, 'Thimphu Local Sightseeing', 'After breakfast visit <b>Kuensel Phodrang</b> (Buddha Statue) a place for refreshing with a huge statue of Buddha on the top of the Kuensel Phodrang, National Memorial Chorten (Monument) & Folk Heritage Museum. Afternoon visit Sangaygang View Point, Changangkha Monastery, Takin Preserve Centre, the national animal of Bhutan can be seen here. In the evening visit <b>Tashichho Dzong</b> (Fortress of the Glorious Religion).<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Thimphu'),
(140, 40, 'Thimphu- Punakha/Wangdue Sightseeing', 'After breakfast drive to <b>Punakha</b>. Arrival at Punakha check in at hotel. Visit Punakha Dzong - built in 1637 by Zhabdrung Ngawang Namgyal. The Dzong was named Druk Pungthang Dechen Phodrang (Palace of Great Happiness). Visit the <b>Chhimi Lhakhang.</b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Punakha '),
(141, 40, 'Excursion to Gangtey (Phobjikha)', 'After breakfast, start for full day excursion trip to <b>Gangtey</b> (9,840 ft.). Gangtey is the home of Black Necked Crane which migrates from the arid plains of Tibet in the north. It is a beautiful valley of Bhutan. You can also visit <b>Gangtey Gompha</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Punakha'),
(142, 40, 'Punakha Sightseeing', 'Alternatively, instead of going to <b>Gangtey</b> (Phobjikha), you also have an option spending the day in Punakha Valley itself. After breakfast hike Khamsum Yuelley Namgyal Chorten easy hike to the top of the hill. It offers a breathtaking view of the <b>Punakha Valley</b>. Also visit Punakha Suspension Bridge and Sangchhen Dorji Lhuendrup Nunnery. <b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Punakha'),
(143, 40, 'Free for leisur', 'Full day free for leiser', 'Punakha'),
(144, 40, 'Paro Sightseeing', 'After breakfast hike to the famous <b>Taktsang Monastery</b> - called Tigers Nest. Later visit Drukgyel Dzong & Kyichu Monastery.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Paro'),
(145, 40, 'Day-14 Paro Airport', 'After breakfast check out from hotel and drop at<b> Paro Airport </b>for your onward journey.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Departure'),
(146, 40, 'Day-15 Phuentsholing - Bagdogara Airport', 'After early breakfast, proceed to Bagdogara Airport. On arrival board your Flight to your hometown.', 'Departure'),
(147, 39, 'On arrival in Dubai Airport', 'On arrival in Dubai check-in to your hotel. Later Proceed to <b>Dubai Marina Cruise</b> it is a sight to behold and cruising through the canal beside it promises unparalleled views of the buildings that have become landmarks on the international map. Among the many sights you will pass by, some that you should not miss are the Burj Al Arab, Hotel Atlantis the Palm, Palm Jumeirah, Dubai Marina Yatch Club Promenade, and the Dubai Marina Mall. You will also get a chance to admire the unique architecture that surrounds the area in form of residential buildings, recreational spaces, and office buildings in evening or in night-time cruise you can see New Dubai glittering under the dark sky. Enjoy <b>Marina Dhow Cruise </b>with delicious dinner.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(148, 39, 'Half Day Dubai City Tour & Desert Safari with BBQ Dinner', 'Today after breakfast you will get an opportunity to get acquainted with Dubai city Tour Visit to Dubais famous landmarks such as the sail-shaped <b>Burj Al-Arab </b>hotel and beautiful Jumeirah Mosque, and learn interesting details about each attraction from a local guide. Take in views of the citys most picturesque palaces and residential areas, and venture into<b> Bastakiya</b>, Dubais inspiring old quarter. Cross Dubai Creek by abra (water taxi) and visit the Spice Soul. Vening<b> Enjoy Desert Safari with BBQ Dinner & Belly Dancing</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(149, 39, 'Dubai Frame & Dhow Cruise Dinner', 'Visit <b>Dubai Frame</b> - known as the biggest picture frame on the planet. Later in the evening we will embark on the <b>Dhow Dinner Cruise</b>- enjoy amazing view of the Dubai skyline.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(150, 39, 'Miracle Garden, Desert Safari with Belly dance show', 'Today we visit <b>Miracle Garden</b> (if operational) -This is the largest natural flower garden in the world. After that we enjoy thrilling <b>Desert Safari </b>by four wheeled drive Land Cruiser through Sand dunes followed by amazing Belly Dance show along with Dinner.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(151, 39, 'Dubai Aquarium-Underwater Zoo-Burj Khalifa', 'Today morning after breakfast proceed for <b>Dubai mall </b>and be part of the mesmerizing <b>Dubai Aquarium & Underwater Zoo</b>, it offers fascinating insight into the worlds most mysterious marine life. Later in the evening proceed to visit the Burj Khalifa Described as both a \'Vertical City\' and \'A Living Wonder\', Burj Khalifa, developed by Dubai-based Emaar Properties PJSC, is the world\'s tallest building. Later enjoy the <b>musical fountain show</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(152, 39, 'Abu Dhabi City tour-Ferrari World', 'Today after breakfast proceed for <b>Abu Dhabi city tour</b> with Ferrari world , the leading seasonal cultural extravaganza in the region and one of the best things to do in Dubai each time you visit.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(153, 39, 'Snow Park', 'After breakfast, proceed for <b>Snow Park</b>.It is a part of the Mall of the Emirates, one of the largest shopping malls in the world, located in Dubai.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(154, 39, 'Dubai Park Access', 'In the morning after breakfast get transferred to <b>dubai park </b>access. Lapita is the first park of its kind in the world. In five fascinating zones, you can experience (Any 2 Park Access) different environments inspired by the greatest Bollywood blockbusters.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Dubai'),
(155, 39, 'Dubai-Leisure', 'Today morning after breakfast spend the day as leisure to explore the city on your own and for shopping.', 'Dubai'),
(156, 39, 'Dubai-Departure', 'After Breakfast at hotel Check out from hotel and get transferred to the airport to catch your flight back to your destination. <b>Tour End</b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(157, 37, 'Depart to Bangkok', 'Depart <b>Bangkok</b> by Air & overnight stay<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bangkok'),
(158, 37, 'Travel Bangkok-Pattaya', 'Bangkok arrival and after immigration and customs, transfer to <b>Pattaya</b>. Enroute Shri Racha Tiger Zoo, B/F stop. Arrival checkin in to the Hotel. Evening visit colorful <b>Alcazar Show OR Colosium show</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pattaya'),
(159, 37, 'Pattaya-Koh-lan Coral Island', 'Today we enjoy a high speed boat ride to <b>Coral Island</b>. On arrival, we will enjoy the beauty of the Island by taking a thrilling Para sailing ride, banana boats, scuba diving, scornelling and after lunch back to Pattaya and in the evening visit tropical gardens of <b>noong nooch village</b>, Cultural & Elephant show.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pattaya'),
(160, 37, 'Pattaya Sightseeing', '<b>Pattaya </b>local sightseeing<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Pattaya'),
(161, 37, 'Bangkok local sightseeing', 'The day is free for optional. Evening <b>Chao- phrya river</b> cruise with musicals & dinner.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bangkok'),
(162, 37, 'Departure from Bangkok', 'Morning free for last minute <b>shopping</b> & in the evening depart  Timely transfer to the airport for flight to your onward destination.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(163, 45, 'Arrive at Mauritius', 'Arrive at Mauritius International Airport and after receiving your arrival Visa from the Immigration Counter. Our Representative will transfer you to the Hotel. The day is free for leisure. <b>Mauritius</b> is an Ideal Holiday Destination to experience unique sights, sounds & water sports.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mauritius'),
(164, 45, 'Mauritius South Tour', 'After breakfast drive to <b>Floreal Shopping Factories</b> / ADAMAS Diamand factory / Trou aux Cerfs dead volcano crater. Return back to hotel for overnight stay.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mauritius'),
(165, 45, 'Mauritius East Tour', 'After breakfast Proceed to the <b>island </b>by coach/Car from your hotel and transfer by speed boat to the island.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mauritius'),
(166, 45, 'Mauritius North Tour', 'After breakfast proceed for <b>Port Louis </b>The Capital of Mauritius/Marie Reine De La Paix/Citadel Fort/SPEND 2 HOURS IN Caudan Waterfront Cap Malheureux /Riche Terre Mall, Overnight stay at hotel in Mauritius.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Mauritius'),
(167, 45, 'Departure', 'After breakfast, proceed to airport to catch your flight. You will be transferred by Coach. Leave Mauritius with<b> lifetime experience & unforgettable memories.</b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(168, 35, 'Arrival in Sri Lanka-Kandy', 'Upon arrival at the Colombo Bandaranayke International Airport. You will then be escorted to your vehicle to begin your holiday in <b>Sri Lanka.</b> <b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Colombo'),
(169, 35, 'Drive Colombo to Sigria', 'Arrive Colombo & transfer to Sigiriya & evening visit to <b>Lion Rock</b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Sigiriya'),
(170, 35, 'Drive to Kandy', 'Meet our tour representative who will escort you to the cab to drive to <b>Kandy</b>. While on your tour you will visit one of the world heritages as well as a sacred place for the Buddhists all over the world; namely the Temple of tooth Relic known to the Sri Lankans as <b>Dalada Maligawa</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kandy'),
(171, 35, 'Travel Kandy to Pinnawala', 'Enjoy a delicious breakfast at your hotel. Today visit Elephant Orphanage in Pinnawala, you can visit one of the most important tourist attractions in Sri Lanka, <b>the Pinnawala Elephant Orphanage</b>. Your next visit will be to the <b>Peradeniya Botanical Gardens</b> which is a paradise for nature lovers.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kandy'),
(172, 35, 'Travel Kandy to Nuwara Eliya', 'Enjoy a delicious breakfast at your hotel. Today you will visit <b>NuwaraEliya</b>. NuwaraEliya is a city in the hill country of the Central Province, Sri Lanka. En-route visits the famous Ramboda waterfall, Sri Lankan tea plantation and a working tea factory, in NuwaraEliya you will visit the main attractions of the town which include the golf course, trout streams, Victoria Park, and boating or fishing on Lake Gregory.  You can also add Seethe Eliya and Haggala Gardens. See the<b> Eliya </b>is a temple which was mentioned in the famous epic Ramayana. Haggala is a temperate hill-country garden where languid low-country lotus and water lily float in their serene.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Nuwara eliya'),
(173, 35, 'Travel Nuwara Eliya to Bentota', 'Enjoy a delicious breakfast at your hotel. Today you will visit <b>Bentota</b>. Bentota is the city of the Golden Beaches. You will be able to relax and feel the spirit of the sea and the warmth of the soft sand. Bentota provides the perfect turf for unfurled vacation at the beach. While enjoying the sun, sea and sand the water sports lovers can enroll themselves in various water sports bringing in the unique pleasure of this locale.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bentota'),
(174, 35, 'Bentota City sightseeing', 'Enjoy a delicious breakfast at your hotel. Today you will visit Bentota. City tour Bentota: On your city tour you will enjoy a boat ride along the <b>Maadu River</b>. It is a scenic tour relaxing and interesting while passing many islets forested with mangroves and experience the natural rhythms as well. If you are looking for more exclusive experience visit the turtle hatchery too. The<b> Turtle Hatchery</b> is the prime turtle nesting site which was open by the Wild life Protection Society in 1981. Visitors can see huge tanks filled with new born turtle hatchlings.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bentota'),
(175, 35, 'Travel Bentota-Colombo', 'Enjoy a delicious breakfast at your hotel. Today you will visit <b>Colombo</b>. Colombo is the largest city and commercial capital of Sri Lanka. Located on the west coast, it is a busy and vibrant city with a mixture of modern and colonial impressions. Colombo has wildly varying architecture that span centuries and depict various styles. Many colonial buildings influenced by the Portuguese, Dutch and British exist alongside structures built in Buddhist, Hindu, Islamic, Indian and Contemporary architectural styles. Colombo also boasts many shopping malls and department stores that offer brand name clothing at highly discounted prices. City Tour: you can visit famous places including <b>Galle Face Green</b>, the Viharamahadevi Park, National Museum, Twin World Trade Center towers, Old Parliament Building, Fort district, Independence Hall at Independence Square, and prominent Buddhist, Hindu, Islam and Christian places of worship.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Colombo'),
(176, 35, 'Departure Colombo To Airport', 'After breakfast, rest at hotel until it is time to depart to airport to catch the return flight.', 'Tour Ends'),
(177, 77, 'Baku Arrival', 'Welcome to <b>Azerbaijan! Meeting </b>our representative at the Baku at Airport and transfer to the hotel. Leisure time after transferring to our hotel and settling into the hotel.<b></b><b></b>', 'Baku'),
(178, 77, 'Explorer Baku on Arrival', 'You participate in the panoramic tour of <b>Baku city</b> to explore Baku, to be held in the evening and visit luxurious shopping centers. Then you are transferred to the hotel. <b></b><b></b>', 'Baku'),
(179, 77, 'Full day Baku City tour', 'After breakfast at the hotel, visit<b> Highland Park</b> that offers a 360 degree panoramic view of the Baku city, which resembles a massive amphitheater that gently slopes down to the adjoining Caspian Sea! After we depart for <b>Baku Old City Tour</b>. The excursion tour begins with a visit to the Old Town - Icheri Sheher. Visit several caravan-palaces, mosques, baths, etc. Visit to Maiden Tower - \'Baku\'s symbol\'. You can spend a pleasant time in the restaurants that you can taste dishes from national Azerbaijan cuisine. After lunch we will be passing by Baku Boulevard, one of the favorite retreat centers for tourists and inhabitants. Visit historical milestones namely; Baku Promenade, National Carpets Museum, House of the Government, Governor\'s Garden, Magomayev Philharmonic Theatre, Cultural Center Complex, Heydar Aliyev Center, museum and auditorium.<b></b><b></b><b></b><b></b>', 'Baku'),
(180, 77, 'Drive Baku to Shahdag', 'After breakfast. We shall depart for <b>Shahdag Skiing tour</b>. Shahdag, is the most popular and elegant Ski resort in Azerbaijan and yet it offers many and for absolute beginners as well as experienced adults. If you wish to Experience skiing Shahdag. You can easily rent skiing equipment when you are there. It is definitely the right address for fantastic<b> ski tour</b>.<b></b><b></b><b></b><b></b>', 'Baku'),
(181, 77, 'Drive Shahdag to Baku', 'Today after breakfast checkout from Hotel in <b>Shahdag</b> and proceed to baku.<b></b><b></b>', 'Baku'),
(182, 77, 'Drive Baku to Quba', 'Breakfast in Hotel Transfer to <b>Quba city </b>for tour There is about 70 natural monuments in the region. Of these, Gelinqayasi, Qizilqaya, Guljahan dashy, Khatadara, Jafar valley, Nana-Huy valley, Khan spring\', \'Stone brides, Tree House, Ateshgah Khaltan water, Khasi hot water, Sona spring, Qirkhbulag, Khan plane, Road guard, Pyrite depression, Oak Forest, Forests, Gyzylagaj forests are natural miracles. There are sulphur water springs located on the banks of <b>Khachinchay </b>in Guba region. The hot water from a narrow ravine has a curative importance. The white-haired eagles living in this ravine were included in the Red Book of Azerbaijan. Guba-Baku transfer Arrival to Baku hotel for refreshment.<b></b><b></b><b></b><b></b>', 'Baku'),
(183, 77, 'Drive Baku to Gabala', 'Breakfast in Hotel Departure to <b>Gabala Shamaxi </b>tour on the way: visiting Shamakhi Mosque Arrival to Gabala city, transfer to Gabala Tufandag Summer-Winter Complex Resort cable car Transfer for Check-in to Gabala hotel and Transfer to Gabaland, entertainment center Returm to the hotel for refreshment.<b></b><b></b>', 'Gabala'),
(184, 77, 'Drive Gabala to Baku', 'Breakfast in Hotel Arrive in<b> Baku </b>and can go for shopping.<b></b><b></b>', 'Baku'),
(185, 77, 'Absheron Peninsula and Shopping', 'Refresh yourselves with breakfast and be ready and your <b>Baku holidays begin</b>. You will start your journey to <b>Ateshgah</b> for Temple visit. The guest room cells of the chapel are now reconstructed as a Museum for the tourists. After Absheron Peninsula Tour, you will start off for <b>Mehemmedli village</b> visit. From the village you will proceed to Yanardag Fire Mountain which lies next to the village. Glowing continuously for several thousand years by means of natural gas, this mountain is one of its kind and a true nature\'s wonder. After Absheron Peninsula tour. In the evening hours our guide will organize Evening Boat Ride at <b>Caspian See</b> and <b>Ferris Wheel Ride</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Baku'),
(186, 77, 'Departure Baku', 'After breakfast, check out from the hotel. We are transferred to the airport. We see our guests off at the airport and the end of Tour! We hope you have a <b>memorable time in Azerbaijan / Baku</b> and we look forward to seeing you in the future. Have a safe trip back home and thank you for choosing us.<b></b><b></b>', 'Tour Ends'),
(187, 23, 'Welcome to Bali', 'Arrive into <b>Bali,</b> you will be greeted by our representative at the airport. Proceed to the hotel and check-in.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bali'),
(188, 23, 'water sports Tour & Uluwatu sunset tour', 'Breakfast will be at the hotel. An ideal Bali holiday is incomplete without <b>Bali water sports</b>. You can enjoy your water sports package with parasailing/flying fish, banana boat & Jet Ski etc. A great <b>southern Bali trip</b> in the evening introduces you to the heart of southern part of the island. The beautiful <b>Uluwatu temple</b>, built on the top of a cliff about 825 feet high facing the vast deep blue Indian Ocean. See the traditional kecak dance and then enjoy a romantic dinner.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bali'),
(189, 23, 'Visit Gili Island', 'After breakfast take a speed boat to <b>Gili Island</b>. Check in to your hotel & enjoy rest of the day at leisure.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Gili Island'),
(190, 23, 'Day at leisure', 'Enjoy your day at leisure.', 'Gili Island'),
(191, 23, 'Sunset Cruise', 'Return by speed boat to <b>Bali</b>. In the evening proceed for romantic <b>sunset dinner cruise</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bali'),
(192, 23, 'Balinese Massage', 'Enjoy an authentic<b> Balinese massage</b>. Rest of the day at leisure.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Bali'),
(193, 23, 'Departure from Bali', 'Enjoy breakfast at the hotel. Check out from the hotel and proceed for the airport to board your return flight back home with <b>eternal memories of your Bali holiday</b>!<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(194, 34, 'Welcome to Singapore', 'Today Arrive at<b> Singapore Airport</b>. We shall then proceed to the Hotel and check-in first. Freshen up and relax in the comfort of your hotel room.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Singapore'),
(195, 34, 'Night Safari', 'Today after break the day is free, Later in the Evening proceed to <b>Night Safari</b>. Travel in an open tram through varied terrain that\'s home to more than 1,000 animals, ranging from fierce predators to timid forest dwellers. Under subtle moon glow lighting, which enables you to see the animals but doesn\'t distract them, you can watch Cape buffalo, African bongo, blue sheep, striped hyena, golden jackal, the rare great one-horned rhinoceros and other creatures playing, prowling or feeding in the Night Safari lush grounds.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Singapore'),
(196, 34, 'Half Day City Tou, Flyer, Sentosa Tour', 'After breakfast Proceed to City Tour, an Exciting experience of the metropolis Singapore, proceed for city tour, an exciting experience of the metropolis of Singapore. See Swissotel<b> The Stamford</b>- one of the tallest hotels in the world, City Hall and Parliament House. Visit <b>Mount Faber</b> for a splendid view of the harbour and the city of Singapore. From the waterfront, enjoy the sight of Merlion- Singapores famous symbol and the citys business district. Visit <b>Chinatown</b>- an opportunity to buy souvenirs at bargain prices for your near and dear ones also, Proceed to Singapore Flyer. Later in Afternoon enjoy tour of the unique <b>Sentosa Island</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Singapore'),
(197, 34, 'Visit Universal Studios', 'After Breakfast at the hotel, enjoy a full day excursion to <b>Universal Studios</b>. Enter the thrilling world of movie magic as you \'ride the movies\' on roller coasters and other movie-themed attractions. Be dazzled and delighted by an immersive entertainment experience that brings the silver screen to life.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Singapore'),
(198, 34, 'Visit Gardens by the Bay', 'After Breakfast day is kept free, later in Evening proceed to visit<b> Gardens by the Bay</b>. Gardens by the Bay is a nature park spanning 101 hectares of reclaimed land in central Singapore, adjacent to the Marina Reservoir. The park consists of three waterfront gardens: Bay South Garden, Bay East Garden and Bay Central Garden.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Singapore'),
(199, 34, 'Departure from Singapore', 'Breakfast in the hotel. Later Check Out from the hotel and get transferred to the Airport to catch your flight for departure', 'Tour Ends'),
(200, 38, 'Arrival in Istanbul', 'Arrive at <b>Istanbul </b>and you will be transferred to the hotel. Rest of the day is free.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Istanbul'),
(201, 38, 'Istanbul city tour', 'We depart from the hotel for the <b>Istanbul City Tour</b>. We will be visiting \'<b>TOPKAPI PALACE</b>\' The great palace of the Ottoman sultans from the 15th to the 19th centuries. <b> Robes worn </b>by the sultans and their families, the famous jewels of the Imperial Treasury, miniatures, and the Holy Mantle; enshrining relics of the Prophet Mohammed. After a short we head to the <b>Grand Spice Bazaar</b> for shopping. After the shopping tour come back to Hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Istanbul'),
(202, 38, 'Istanbul Bosphorus Cruise tour Flight to Izmir', 'After breakfast depart for <b>Bosphorus Cruise tour</b>. Enjoy the array of sites you can see from the boat including: Grand Bazaar. BOSPHORUS BY BOAT a traditional excursion by boat along the waterway separating Europe and Asia. After the lunch depart for Istanbul Ataturk airport for domestic flight to<b> Izmir.</b> On arrival proceed to the hotel and check in to your hotel in.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kusadasi'),
(203, 38, 'Kusadasi-Ephesus Tour-Turkish Village Sirince', 'Depart from hotel for fully guided tour of<b> Ephesus</b>, one of the best preserved ancient sites in the world en-route, visiting the Temple of Artemis, Curetes street, famous Roman baths, Celsus Library and Grand theatre. After we will visit a place which continues to perform one of the oldest arts of Turkey a carpet weaving centre. Later we will do a <b>Turkish Village Tour</b>. Sirinces construction style today belongs to Anatolian Greeks. <b>Sirince Village</b> also has a fantastic reputation for making some of the best wines in Turkey - especially fruit wines.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kusadasi'),
(204, 38, 'Kusadasi To Pamukkale Tour', 'After breakfast, depart for <b>Pamukkale Tour</b>. On arrival visit the calcium terraces of Pamukkale (cotton castle) and the ruins of Hierapolis, then walk around this natural phenomenon and have the option of lying in the waters of the natural springs.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Kusadasi'),
(205, 38, 'Pamukkale to Antalya', 'After breakfast, depart for <b>Antalya</b>. On arrival check-in to the hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Antalya'),
(206, 38, 'Antalya Old City Tour And Waterfalls', 'After breakfast, drive to Antalya old City ( Kaleici ) Marina, Clock Tower, Hadrians Gate, Broken Minaret, Hidirlik Tower: <b>Kaleici </b>is a small historic part of Antalyas modern city, also known as the Old City of Antalya. Later depart for <b>Duden waterfalls.</b> All the streams of the region aim at finding their way into the Mediterranean and they pour down the slopes of the Taurus, sometimes overland sometimes underground and reaching their destination, result in lovely waterfalls, of which there are more than twenty.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Antalya'),
(207, 38, 'Drive Antalya-Konya-Cappadocia', 'After breakfast early in the morning drive to <b>Konya</b>. On arrival in Konya visit the imposing green - tiled Mausoleum of Mevlana, the mystic founder of the Sufi sect (Whirling Dervishes). After the Konya Mevlana tour drive to <b>Cappadocia</b>. On arrival check-in to the hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Cappadocia'),
(208, 38, 'Cappadocia underground City & Goreme Open Air Museum', 'After breakfast drive to Ozkonak Underground City, one of the best preserved Underground cities in Cappadocia. Than visit to <b>Uchisar Castle</b>, the highest point of Cappadocia. After Uchisar, you visit Goreme Open Air Museum, the Heart of Cappadocia. <b>Goreme Open Air Museum</b> is famous for frescoes dating to 10th century describing the life of Jesus Christ and monks. Next stop is <b>Cavusin</b>, which is an abandoned village with old cave Greek houses. Later, visit a pottery work shop, to see how to make potteries. Then you go<b> Love valley</b> where you can see three - headed fairy chimneys. After Love valley you visit another workshop to see Cappadocian handwoven carpets and kilims. Next stop is Devrent Valley and many other sightseeings and you will be returned back to your hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Cappadocia'),
(209, 38, 'Return to Home', 'After breakfast, check-out and depart for<b> Kayseri Airport</b> for our domestic flight to Istanbul and then back to home.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(210, 78, 'Arrive in New York / New Jersey', 'Your delightful <b>America tour</b> begins today. Proceed to your hotel to check in and relax for a while.<b></b>', 'New York'),
(211, 78, 'Statue of Liberty, New York City Tour, World Trade Center', 'After breakfast proceed on a guided city tour of <b>New York</b>. Take a ferry to the Statue of Liberty Island. Admire the symbol of American freedom- The <b>Statue of Liberty</b>. See the Ground Zero, Rockefeller Centre, Wall Street, China Town, UN Headquarters and the observatory at One World Trade Center to view the spectacular New York Skyline. In the evening proceed for a delicious dinner.<b></b><b></b>', 'New York'),
(212, 78, 'Washington-Smithsonian Air & Space Museum', 'After an American breakfast checkout of the hotel and proceed to <b>Washington D. C</b>. the capital of USA. Proceed on to guided city tour of this beautiful Capital City. See the Capitol Building, drive past the Potomac River, and see the famous memorials, Pentagon and White House. Visit the popular \'Smithsonian Air & Space Museum\' which houses the largest collection of space and aircrafts in the world. See the \'<b>Spaceship One</b>\', drone and even touch a lunar rock.<b></b><b></b>', 'Washington'),
(213, 78, 'Hershey\'s Chocolate World, Niagara Falls', 'After breakfast proceed to Niagara. En-route we visit <b>Hershey\'s Chocolate World</b>, where we will get a chance to jump into the world of Chocolate. Proceed to <b>Niagara Falls</b>.<b></b><b></b>', 'Niagara'),
(214, 78, 'Maid of the Mist, Cave of the Winds', 'After breakfast visit the falls for it\'s breathtaking view by a boat- \'<b>Maid of the Mist</b>\'- that will take you through the dense mist inside the spectacular falls. Later proceed on a tour of \'<b>Cave of the Winds</b>\', ride an elevator into the Niagara Gorge a lifetime experience. Then you take a helicopter ride to get a magnificent view of the glorious<b> Niagara Falls</b> (weather permitting/optional).<b></b><b></b><b></b>', 'Niagara'),
(215, 78, 'Visit NASA - Kennedy Space Centre', 'Take a flight to Orlando. Visit <b>NASA - Kennedy</b> Space Centre Launch Headquarters, unique chance to visit NASAs launch and landing facilities. Experience interactive simulators, live shows and jaw-dropping encounters with massive rockets, as well as have the opportunity to meet a real member of <b>NASAs Astronaut Corps</b>.<b></b><b></b>', 'Orlando'),
(216, 78, 'Orlando Epcot Centre', 'Proceed on a full day visit to the <b>Epcot Centre</b>. One of the Theme Parks at the Walt Disney Park, it is the ultimate park combining futuristic technology and entertainment. Feel the excitement, thrill and rush of traveling to a stimulated Space Adventure at its best. Then experience the extraordinary illumination show (time permitting).<b></b>', 'Orlando'),
(217, 78, 'Sea World', 'After breakfast, proceed to <b>Sea World</b>. See the Californian Sea Lions and Harbor seals; encounter Shamu - the killer whale. You can see many famous shows and have a gala time.<b></b>', 'Orlando'),
(218, 78, 'Francisco City Tour', 'Today, take a flight to San Francisco. Proceed to board the famous <b>Bay Cruise sail</b> past the infamous Island of Alcatraz, which was formerly a prison. See the San Francisco skyline and watch a breathtaking view of the famous <b>Golden Gate Bridge</b>. Then proceed on a city tour of San Francisco. Visit the famous Lombard Street, Civic Centre, Nob Hill, Twin Peaks, Park Presidio and Union Square, China Town.<b></b><b></b>', 'San Francisco'),
(219, 78, 'Las Vegas', 'Today we take a flight to<b> Las Vegas</b>. After arrival proceed to check in to the hotel. Rest of the day is free for shopping or visit some of the best-known Casinos / Hotels in the world.<b></b>', 'Las Vegas'),
(220, 78, 'Grand Canyon, Hoover Dam, V Show', 'Today you proceed on an Air Tour excursion to <b>Grand Canyon.</b> It is created by the Colorado River cutting a channel over thousands of years and attaining a depth of more than 1600 meters. After that you will be visiting<b> Hoover Dam</b>, which stands 725 feet above the Colorado River, is a breathtaking sight every tourist must experience and you will be experiencing this exclusively with Mango Holidays!! Stroll around the dam and admire the massive man-made wonder. In the evening specially included is the world famous<b> \'V\' Show</b>. In the end you are bound to say, \'Never seen anything like this before\'.<b></b><b></b><b></b>', 'Las Vegas'),
(221, 78, 'Calico Ghost Town- Los Angeles', 'Today we proceed to Los Angeles. Visit <b>Calico Ghost Town</b>. Embark on a City Tour of Los Angeles. Stroll on the famous Hollywood Boulevard; visit Kodak Theatre, which is the place for the famous Academy Awards, Chinese Grauman\'s. Ride on infamous Sunset Boulevard, Doheny Drive, famous Beverly Hills and the most expensive street Rodeo Drive, the shopping place for the Rich and Famous personalities.<b></b>', 'Los Angeles'),
(222, 78, 'Universal Studios', 'After breakfast, visit the famous Hollywood\'s \'<b>Universal Studios</b>\'. You can ride on to the famous Tram, enjoy the Jurassic Park Roller coaster, Revenge of the Mummy and visit the latest Simpson\'s Ride. In the evening enjoy dinner.<b></b>', 'Los Angeles'),
(223, 78, 'Day-14 Return home with eternal memories', 'After breakfast, proceed to the airport to board your flight back home. Then it is time to say goodbye to your new friends and take home <b>memories</b> of your <b>amazing tour</b><b></b><b></b>', 'Tour End'),
(224, 79, 'Arrive Calgary Airport and transfer to Banff', 'Arrive Calgary and transfer from Calgary International Airport to <b>Banff</b>. On arrival, check-in at hotel. Rest of the day at leisure.<b></b>', 'Banff'),
(225, 79, 'Banff Wildlife Tour', 'After breakfast, proceed on Discover Banff and Wildlife Tour. <b>Visit Banff</b> viewpoints, landmarks and historic places on this popular half day sightseeing tour. Enjoy the stunning scenery and short walks to the must see locations, taking photos and watching for wildlife. Afternoon, take an optional Snowshoeing Tour to <b>Marble Canyon</b>.<b></b><b></b>', 'Banff'),
(226, 79, 'Banff Icewalk Tour & free at leisure', 'After breakfast, day is free at leisure. Go on an optional Johnston Canyon Icewalk Tour. The <b>Johnston Canyon Icewalk</b> traverses a series of steel catwalks that give spectacular views of the Johnston Canyon below. Afternoon go on an optional <b>Horse drawn Sleigh Ride Tour</b>. The sleigh ride will take you through the Bow River Valley showing you the remote areas around Banff.<b></b><b></b>', 'Banff'),
(227, 79, 'Banff to Lake Louise', 'After breakfast, check-out of hotel and transfer to Lake Louise. <b>Lake Louise</b> is an icon for Canada and a stunning place to visit. Afternoon go on an optional Dogsledding Tour. <b>Dogsledding </b>is the most popular winter activity and an adventure suitable for anyone. Evening at leisure.<b></b><b></b>', 'Lake Louise'),
(228, 79, 'Lake Louise-Try Ice Skating across a frozen lake', 'After breakfast, day is free at leisure. Try <b>Ice Skating</b> across a frozen lake, breathing in the icy cold air, surrounded by incredible mountains. Afternoon try exploring Snow Tubing on own. It is similar to tobogganing. <b>Tubing </b>is a great activity for all ages, including children. This exhilarating outing can be enjoyed at the Mt. Norquay.<b></b><b></b>', 'Lake Louise'),
(229, 79, 'Lake Louise to Calgary Airport', 'After breakfast, check-out of hotel and transfer to <b>Calgary Airpor</b>t to connect flight to onward destination.<b></b>', 'Tour Ends'),
(230, 22, 'Arrival at Hong Kong', 'Arrive at <b>Hong Kong airport</b>. On arrival, check-in at hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hong Kong'),
(231, 22, 'Hong Kong City Tour', 'Proceed to <b>Hong Kong</b> \'City Tour\', Aberdeen Village, Jewellery Factory, and Madame Tussaud\'s Wax Museum, Victoria peak.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hong Kong'),
(232, 22, 'Hong Kong-Ocean World', 'After breakfast Half day visit to <b>Amusement park of Ocean World</b>, Rare glimpse of Black Panda. Evening free at your Leisure.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hong Kong'),
(233, 22, 'Disneyland Tour', 'After breakfast visit to<b> Disneyland</b>, located on scenic Lantau Island. Magical experiences ranging from Broadway-style shows hilarious 3D movies & thrilling music adventure to signature Disney. Spectacular fireworks and parades.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hong Kong'),
(234, 22, 'Hong Kong-Macau', 'You can Experience the 60 minutes Ferry Ride to <b>Macau</b>. On arrival check in into the hotel and relax. Evening free for shopping / Casinos<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hong Kong'),
(235, 22, 'Macau-City Tour', 'Visit ruins of St. Paul Catheral / Chruch, Speed jet Ride, Senado Square, Kum Iam Status and Lotus Square. Experience heights of <b>Macau Tower</b> at the 223 meters & enjoy panoramic view of Macau City & ferry to Hong Kong Airport to take a return flight.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(236, 46, 'Arrival at Cairo International Airport', 'Arrival at Cairo International Airport, greeted by our representative who will assist the group through immigration and customs formalities. Transfer to the hotel and check in.', 'Cairo'),
(237, 46, 'Cairo visit pyramids of Giza and Sphinx', 'Proceed with a full day tour to visit (<b>The great pyramids</b> of Giza and Sphinx, The Egyptian museum & Khan El Khalili Old Bazaars).Transfer back to the hotel.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Cairo'),
(238, 46, 'Cairo Nile Cruise (Monday/Wednesday/Friday)', 'Transfer to Cairo airport for the flight to <b>Aswan</b>. Upon arrival, Proceed with the visits of Aswan including (The high dam, The unfinished obelisk & The temple of Philae). Embarkation. Afternoon tour by Felucca around (Elephantine island, Botanical garden & Agha Khan). Dinner and Overnight on board cruise ship in Aswan.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Aswan'),
(239, 46, 'Nile Cruise', 'Breakfast on board. Lunch will be served on board while sailing to <b>Kom Ombo</b>. Visit the temple of Kom-Ombo, dedicated for gods Sobek and Haroeris. Afternoon sail to Edfu Dinner and overnight on board cruise ship in Edfu.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Edfu'),
(240, 46, 'Nile Cruise', 'Breakfast on board. Visit the temple of<b> Edfu</b>, dedicated to the god Horus. Lunch on board during sailing to Esna. cross Esna lock and sail to Luxor. Overnight on board of the cruise ship in <b>Luxor</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Luxor'),
(241, 46, 'Hurghada', 'Breakfast and Disembarkation from the cruise. Proceed to visit the <b>west bank </b>including (The two colossi of Memnon, The temple of Queen Hatshepsut &The valley of the kings). Proceed to visit the east bank including (Karnak temple & Luxor temple). Transfer to Hurghada by a private A/C <b>modern coach</b>. Upon arrival, Transfer to the hotel and check in.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Hurghada'),
(242, 46, 'Hurghada', 'Breakfast at the hotel. Free Day at Leisure. Lunch & Dinner will be served at the hotel.', 'Hurghada'),
(243, 46, 'Departure from Hurghada', 'Buffet breakfast at the hotel and check out. Transfer to Hurghada airport for the final departure flight via <b>Cairo</b>.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(244, 57, 'Arrive Keflavik, Aurora Museum, Reykjavik', 'Arrive Keflavik International airport. After Customs & Immigrations. Later drive towards Reykjavik & and Check in at Hotel. Evening visit<b> Aurora Museum</b>. The Museum possesses detailed information on Northern lights, science behind it, where all can it be seen, followed by a video of <b>Northern lights shot</b> in Iceland.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Reykjavik'),
(245, 57, 'Golden Circle Tour', 'Today we proceed towards Golden Circle; Our first destination will be<b> Pingvellir National Park</b>. The park is a place of great beauty located on the biggest lake of Iceland (Thingvellir Lake) where the Tectonic Plates of North America and Euro Asia continent drifts apart each year. The park is a UNESCO World Heritage Site. Later continue the journey towards Geysir - home to the Littli Geysir & the great <b>Strokkur Geyser</b> which erupts about every 8 minutes. It truly is a sight to behold. Followed by Geysir is the <b>Gullfoss Waterfall,</b> one of the most impressive waterfalls in Europe that falls in two folds.\n<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Reykjavik'),
(246, 57, 'Drive Reykjavik-Akureyri', 'Today we proceed towards the Capital of North of Iceland- <b>Akureyri</b>, for a Long drive that passes through various landscapes and is one of the most scenic drives. En-route photo stop at Turf farmhouses at <b>Glaumbaer Museum</b> (from outside) Evening enjoy a stroll and walking orientation tour of Akureyri town covering the Church, Fjord waterfront, Akureyri Botanical garden and old town pedestrian street. Later check in at hotel.\n<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Akureyri'),
(247, 57, 'Diamond Circle tour', 'Today we enjoy North Icelands most famous<b> Diamond Circle tour.</b> We stop first on route at Godafoss waterfall, the waterfall of the pagan gods. Then we continue to the Lake Myvatn area where we spend the day exploring the wonders around the lake, which is one of Icelands most interesting regions with pseudo craters, dimmuborgir lava fields, Namaskard geothermal boiling mudpool area, etc. Later visit the beautiful <b>Myvatn nature baths</b> for a relaxing geothermal bath in a stunning natural lagoon. Evening proceed back to Akureyri.\n<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Akureyri');
INSERT INTO `itinerary_master` (`entry_id`, `dest_id`, `special_attraction`, `daywise_program`, `overnight_stay`) VALUES
(248, 57, 'Akureyri into the glacier Borgarnes', 'Today morning - we begin our journey towards <b>Langjokull </b>(second largest glacier in Iceland). Our first stop will be at Deildartunguhver, hot spring in Reykholtsdalur, Iceland Later on, we visit most picturesque waterfall \'Hraunfossar & Barnafos\'. Here we have a 10 min walking trail. Later we continue to get Up close and personal on a glacier - the best way to experience Iceland! <b>The walking tour inside the Glacier </b>is of an hour plus the to and from journey in <b>Super Jeep</b> is of 45 mins each way. This is truly a once in a lifetime experience which you might not encounter anywhere else in your life.\n<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Borgarnes'),
(249, 57, 'Borgarnes-Snaefellsnes-peninsula-Lava Cave', 'This tour takes you to west from Reykjavik on a scenic route to Borgarfjorour and the <b>village of Borgarnes</b>. Shortly after entering Snaefellsnes peninsula, by Ytri-Tunga Farm you all get a chance to spot local wildlife at the beach which is home to a seal colony and variety of sea birds. Next is a visit to the <b>idyllic Arnarstapi village</b> where you will take a walk to view the extraordinary landscape along the precipitous shoreline. We start our next adventure by visiting<b> Vatnshellir Cave</b>. Later we visit Grundarfjrur is home to one of the peninsulas\'s most iconic and photographed landmarks, the symmetrical mountain Kirkjufell that towers 1500 ft. up from the shoreline.\n<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Borgarnes'),
(250, 57, 'Borgarnes-Seljalandsfoss-Skogafoss-Black Sand Beach', 'Today morning - we checkout and proceed towards <b>Vik</b>. We begin our journey towards South Iceland. Our first stop will be at most picturesque waterfall \'Seljalandsfoss & Skogafoss\' followed by Black Sand Beach. We visit the very first location of<b> Gerua fame waterfall</b>- Seljalandsfoss, then we continue journey towards Skogafoss. During the journey we enjoy charming views and scenery. 2nd waterfall Skogafoss on a bright sunny day at least 2 rainbows are visible at a time. Later we visit <b>BLACK SAND BEACH</b> (one of its only kind in the world). Later Check in at Hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Vik'),
(251, 57, 'VIK Skaftafell National Park-Jokulsarlon Glacier Lagoon-Diamond Beach-VIK', 'Today we continue east and drive past Eldhrun lava fields, followed by <b>Skaftafell National park beneath Vatnajokull Glacier</b>. Our journey continues till we reach the glacier lagoon Jokulsarlon, one of the most spectacular sights in Iceland. Here we will take photo-stop and walk around the lagoon to enjoy this amazing landscape. Opposite to the lagoon is the<b> Diamond Beach </b>where you have the icebergs that are at the shore making it beautiful location to photograph at. Evening back to hotel.\n<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Vik'),
(252, 57, 'VIK Flyover Iceland Raykjavik Orientation Tour', 'Today we check out & will be proceeding towards <b>Flyover Iceland</b> in Reykjavik. Later we proceed towards Reykjavik orientation tour where we cover all sightseeing points such as Sun Voyager, Harpa concert house, City Hall, Parliament House, etc. Later afternoon we proceed towards the famous <b>Blue Lagoon</b>. The Blue Lagoon is a unique sight where guests enjoy relaxing in warm geothermal water surrounded by magical black lava fields. The Blue Lagoon\'s warm water and natural active ingredients; mineral salts, silica and blue green algae, help you relax and escape the stress and strain of daily life Later Check in at Hotel.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Keflavik'),
(253, 57, 'Departure', 'Today we proceed towards Airport to catch return flight back home or onwards destination.\n', 'Tour Ends'),
(254, 28, 'Arrive Maldives', 'Welcome to the tropical paradise of <b>Maldives</b>! After reaching there, get transferred by a Big boat to your resort and check-in to your room. Spend the day relaxing and admiring the views of crystal clear waters ebbing sandy beaches.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Maldives'),
(255, 28, 'Maldives Day Free', 'After a hearty breakfast today, we have many recommendations for you. You may choose to take a sun bath on the beach, go for a swim or do absolutely nothing! If adventure is what you like, opt for some water sports like snorkelling, wind surfing or have fun on a banana boat ride.', 'Maldives'),
(256, 28, 'Maldives Day Free', 'After a delicious breakfast today, we recommend you pamper yourself with an indulgent<b> spa treatment. Choose</b> from a relaxing aroma therapy treatment or a rejuvenating body spa wellness After a relaxing day, enjoy a comfortable.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Maldives'),
(257, 28, 'Maldives Day Free', 'After Breakfast the day is kept free. Enjoy the stay in Resort or have a <b>body spa </b>or else Enjoy <b>water sports</b> on Own.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Maldives'),
(258, 28, 'Departure Flight', 'Enjoy a hearty breakfast at the hotel and then check-out. A speed boat will await you for your transfer to the airport. Fly back home with<b> wonderful memories of an amazing trip</b>!<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(259, 74, 'Arrive at Muscat Airport', 'On arrival at <b>Muscat Airport,</b> you will be met by our local representative and transferred to your hotel. The rest of the day is free to explore the city on your own.<b></b><b></b><b></b>', 'Muscat'),
(260, 74, 'Muscat City Sightseeing', 'Today you visit the 5 largest mosque in the world, the <b>Sultan Qaboos Grand Mosque</b>. Passing by the diplomatic quarter, you will be taken to the oldest and largest market in the country,<b> Muttrah souq</b>. This is a time for you to shop for your Omani souvenirs. Walk through its narrow alleys where the air is filled with the smell of frankincense and sandalwood. Next stop is the <b>Al Alam Palace</b> where the Sultan receives his state guests. The palace is flanked by two Portuguese fortresses, Al Jalali (1578) to the right and Al Mirani (1581) to the left. At a museum, you will witness traditional artefacts and traces of history and pre-history of Muscat.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Muscat'),
(261, 74, 'Visit Nizwa-the cultural capital', 'Today you will start your fascinating roundtrip by exploring the cultural capital of the <b>country Nizwa</b>. If it is a Friday, you have the opportunity where the herders bring their cattle to be auctioned once a week. Explore the cultural capital of the country where its souq is still the best place to buy silver in the country. This is followed by a visit to the most visited national monument - <b>Nizwa Fort</b>. Entry is optional. Then you visit Omans most beautiful castle from the 17th century, Jabreen, and another UNESCO site, Bahla Fort, the oldest and biggest fort in the country.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Muscat'),
(262, 74, 'Visit Jabal Shams', 'Today morning you procced to<b> Al Hamra</b>. Here, the village women demonstrate old practices such as milling, coloring, cooking and more. A truly enriching experience. To the west of Al Hamra lies the road winding up Jebel Shams, the mountain of the sun. It is the <b>highest mountain</b> of the Arabic world and reaches 3075 m above sea level. Some kilometers further you reach the abyss of the <b>Omani Grand Canyon</b>. Enjoy the breathtaking views. Then visit the mountain village of Misfah which offers rewarding views of ancient architecture seen in stone houses.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Muscat'),
(263, 74, 'Visit Wahiba Sands', 'And then its time for the desert. Enjoy the drive through the stunning<b> dunes</b>. Their forms change with the wave of the wind. After your arrival in the camp you climb up on a lonely dune to watch the miraculous sunset. The day ends under the sky of Oman while you sit together around the fire place and try <b>Omani specialties</b>.<b></b><b></b><b></b><b></b><b></b><b></b>', 'Muscat'),
(264, 74, 'Visit Wadi & Turtles', 'Start your day by visiting the celebrated <b>Wadi Bani Khalid</b>. The ever-green Wadi Bani Khalid is one of the most famous ones of the entire <b>Sharqiyah region</b>. The river never dries out completely throughout the continuous water current. Large palm-lined ponds with turquoise and sapphire colored water invite for a swim. Arriving to the fishing town of Sur, the home of Omani traditional Dhows (boat), you will visit the dhow factory in the open air museum. At night, an extraordinary experience awaits you at the <b>Turtle beach</b> where you will get the opportunity to witness sea turtles coming to the shore and laying eggs!<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Muscat'),
(265, 74, 'Muscat Coast and Wadis', 'Today we start the day with passing by <b>Bimmah Sinkhole </b>with its azure saltwater pool. Then there s a possibility of leisure hike through the twin wadis of Shab and Tiwi. You will determine the best suited itinerary for the day. There is a possibility for swimming along the way so prepare some change of clothes!<b></b><b></b><b></b>', 'Muscat'),
(266, 74, 'Departure Flight', 'And here your <b>unforgettable journey </b>ends.<b></b><b></b><b></b>', 'Tour Ends'),
(267, 80, 'Arrive in Cape Town', 'Upon arrival at Cape Town<b> International Airport</b>, transfer to your pre- booked hotel. Cape Town is one of the most popular long-haul destinations in the world. Due to its unique topography, it is also one of the easiest places in which to orientate oneself as long as you remember that with Table Mountain behind you and <b>Robben Island</b> before you; you are facing north, looking across Table Bay and up the west coast of Africa.', 'Cape Town'),
(268, 80, 'Cape Town City Tour, Table Mountain', 'After breakfast leave on a half-day Mother City tour. You will go for a scenic coastal drive through Clifton and Sea Point and later tour passes the<b> Houses of Parliament</b>, the Castle, the SA Museum, and a few other historical sights- District Six, Bo-Kaap, Slave Lodge and ending at the bustling <b>Greenmarket Square</b>. A cable car ride, takes you up the Table Mountain (weather permitting otherwise Signal Hill) for a breathtaking view over the city Return to your hotel.', 'Cape Town'),
(269, 80, 'Drive Peninsula tour', 'Breakfast is taken at the hotel. Depart on a full day<b> Peninsula tour </b>This comprehensive tour shows you the best of the spectacular Cape Peninsula and why it is called the Fairest Cape. Travel past Sea Point and Camps Bay, past the famous beaches of Clifton and Llandudno towards Hout Bay. Drive along the <b>Atlantic Seaboard</b>. Later get the photo opportunity to take some pictures at the second southern most tip of the African continent. Visit the beautiful <b>Boulders Beach</b>, and have the option to sit among the famous colony of <b>Jackass Penguins</b>. Return to the hotel.', 'Cape Town'),
(270, 80, 'Visit Oudtshoorn', 'After breakfast, check and transfer to Oudtshoorn. It is known as the<b> \'Feather Capital of the World\'</b> thanks to its huge ostrich industry. Arrive and in the afternoon, enjoy a tour of the Wildlife Ranch where you will visit a crocodile Park where you have opportunity to take pictures with <b>Cheetah</b>. Check into hotel and spend rest of evening in the comfort of your hotel.', 'Cape Town'),
(271, 80, 'Drive Cango Caves, Knysna', 'After breakfast leave for a tour of the Cango Caves - In Oudtshoorn you go underground to marvel at the icy formations in the <b>Cango Caves</b>, regarded as one of South Africa\'s most spectacular natural wonders Later enjoy a tour of the Ostrich Farm before your transfer to Knysna. Arrive in Knysna, later you will go on a cruise on the <b>vast Knysna Lagoon</b>. Enjoy an amazing view of the imposing sandstone \'Heads\' which guard the sea entrance to Knysna\'s huge tidal lagoon, and the forests, marshes and pristine beaches surrounding it. Evening, you check into the hotel.', 'Knysna'),
(272, 80, 'Knysna, George, Johannesburg, Sun City', 'After breakfast transfer to George airport to board a flight to Johannesburg. On arrival you are met by a representative for a transfer to <b>Sun City</b>. The Sun City complex is surrounded by two championship golf courses, numerous swimming pools and a huge man-made lake offering various water sports. Optional activities include <b>Hot Air Ballooning.</b>', 'Sun City'),
(273, 80, 'Sun City Sightseeing', 'After breakfast you will enjoy your day at<b> leisure.</b>', 'Sun City'),
(274, 80, 'Drive Kruger National Park', 'After breakfast transfer to <b>Kruger National Park</b>. The Kruger National Park in South Africa is one of the oldest and largest reserves in Africa. The park boasts a tremendous variety of game- The Big 5 and bird life in its numerous habitats. You should see: elephant, giraffe, zebra, buffalo, warthog, lion, spotted hyenas, baboon, hippo, impala, kudu, vervet monkey, waterbuck, Tsessebe, wildebeest, bush baby, mongoose, duiker, steenbok, klipspringer, genet, bats. You may see: leopard, wild dog, cheetah, roan antelope, sable antelope, bat-eared fox, rhino, honey badger, porcupine, rebook, aardvark, aardwolf, civet, and caracal and serval suni. Arrive and check in the lodge.', 'Kruger'),
(275, 80, 'Kruger National Park', 'Enjoy a full day <b>game drive</b>.', 'Kruger'),
(276, 80, 'Departure', 'After breakfast, transfer to OR Tambo International for flight back home. Return home with <b>eternal memories</b> of your <b>South Africa tour</b>!', 'Tour Ends'),
(277, 75, 'Arrive in Sydney', 'Arrive <b>Sydney </b>& SIC Transfer to Hotel.<b></b><b></b>', 'Sydney'),
(278, 75, 'Sydney City Tour, Sydney Showboat', 'Breakfast at the hotel. Proceed for Half Day Sydney City Tour with <b>Bondi Beach</b>. In the evening proceed for Sydney Showboat Cruise with Indian dinner.<b></b><b></b>', 'Sydney'),
(279, 75, 'Sydney Combi Tickets', 'Proceed to visit <b>attractions</b> - Sea Life Aquarium / Madame Tussauds / Sky Tower Eye / Wildlife Zoo. (optional)<b></b><b></b>', 'Sydney'),
(280, 75, 'Blue Mountain Tour', 'Breakfast at the hotel. A coach will pick you up from your hotel for transfer to the departure point of your tour. Star full day <b>Blue Mountains tour</b> from the morning. Travel over the iconic <b>Sydney Harbour Bridge</b> and head west towards the Blue Mountains. Visit the quaint <b>village of Leura</b> to purchase morning tea (own expense), then head to Scenic World and enjoy views of the Jamison Valley. You may choose to ride the Railway, Cableway or Skyway (<b>own expense</b>).<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Sydney'),
(281, 75, 'Drive Sydney to Cairns', 'Proceed to <b>Cairns.</b><b></b><b></b>', 'Cairns'),
(282, 75, 'Great Barrier Reef', 'After breakfast proceed to see the stunning Great Barrier Reef by <b>Big Cat Green Island</b> Cruise with Lunch.<b></b><b></b>', 'Cairns'),
(283, 75, 'Kuranda Village Tour with Skyrail to Caravonica ', 'After breakfast proceed to see the<b> Kuranda Village Tour</b> with Skyrail to Caravonica.<b></b><b></b>', 'Cairns'),
(284, 75, 'Cairns Gold Coast', 'After breakfast proceed to <b>Cairns Gold Coast</b>.<b></b><b></b>', ' Gold Coast'),
(285, 75, 'Sea World', 'After breakfast return SIC transfer to <b>Sea World Admission</b><b></b><b></b>', ' Gold Coast'),
(286, 75, 'Movie World', 'After breakfast return SIC transfer to <b>Movie world Admission</b><b></b><b></b>', ' Gold Coast'),
(287, 75, 'Departure', 'After breakfast, proceed to the airport to board your flight back home. Return home with eternal <b>memories of your Australian holiday</b>!<b></b><b></b>', 'Tour Ends'),
(288, 76, 'Arrive in Auckland', 'On arrival, seat in coach guests will be met and privately transferred to hotel.', 'Auckland'),
(289, 76, 'Auckland sightseeing', 'Enjoy a morning sightseeing tour of <b>Auckland city</b>. Visit Kelly Tarlton\'s Sealife Aquarium and Antarctic Encounter. The remaining of the day is free.', 'Auckland'),
(290, 76, 'Drive Auckland to Rotorua via Waitomo', 'Travel south through the fertile Waikato region to arrive at<b> Waitomo.</b> Enjoy a guided tour of the famous <b>Glowworm Caves </b>including underground boat ride. Continue to Rotorua this afternoon.', 'Rotorua'),
(291, 76, 'Rotorua sightseeing', 'Visit<b> Te Puia Thermal Reserve</b> to see boiling mudpools and roaring geysers. Following this, visit Agrodome for a farm show and Rainbow Springs to see trout, birds and wildlife. The afternoon is at leisure.', 'Rotorua'),
(292, 76, 'Rotorua to Cristchurch', 'Depart on your domestic flight from Rotorua to <b>Christchurch</b> (airfare optional)', 'Christchurch'),
(293, 76, 'Cristchurch-MT Cook-Queenstown', 'Travel across the fertile Canterbury Plains to Lake Tekapo and the Church of the Good Shepherd before continuing on to New Zealand\'s highest mountain - Mt Cook. Depart Mt Cook and follow the shores of Lake Pukaki south through the historic Central Otago region to the \'Alpine Resort\' of <b>Queenstown.</b>', 'Queenstown'),
(294, 76, 'Queenstown', 'Enjoy a <b>Queenstown Highlights city tour</b> today (seat in coach guests), including AJ Hackett Bungy Centre, Arrowtown and Gibbston Valley Winery. The remaining of the day is at leisure.', 'Queenstown'),
(295, 76, 'Milford Sounds', 'Follow the southern arm of Lake Wakatipu to Lumsden, and onward to<b> Lake Te Anau.</b> Enter the Eglinton Valley and travel through the breath taking man made Homer Tunnel to reach <b>Milford Sound</b>. Enjoy a cruise on this world famous fiord, dominated by Mitre Peak and the cascading Bowen Falls. Return to <b>Queenstown</b>.', 'Queenstown'),
(296, 76, 'Queenstown', 'A free day to explore the<b> endless optional </b>attractions available. (Not included in the tour price)', 'Queenstown'),
(297, 76, 'Departure', 'After breakfast SIC customers will be transferred to airport in a shared vehicle.', 'Tour Ends'),
(298, 31, 'Arrival at Phuket Airport', 'Arrival at <b>Phuket </b>airport. Transfer to hotel. Check in to the hotel. Evening proceed for the fantasia show.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Phuket'),
(299, 31, 'Phi-Phi island tour', '<b>Phi-Phi island</b> tour : Spectacular Cruise to Phang Nga Bay, explore mangrove forest, sea caves, limestone sea rock formations and James Bond Island<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Phuket'),
(300, 31, 'Phuket City Tour ', 'Beautiful architecture and scenic views Dolphin shows <b>Cape Promthep</b> : Picturesque cape and stunning sunset<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Phuket'),
(301, 31, 'Phuket-Krabi', 'Check-out from hotel. A romantic ride by speed boat to<b> Krabi island </b>Check in to the hotel. Evening at leisure.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Krabi'),
(302, 31, 'Krabi city tour', 'Emerald Pool & Hot water spring with <b>elephant trekking</b> Evening at leisure<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Krabi'),
(303, 31, 'Krabi Bangkok', 'Check out from hotel and airport transfer. Arrive at <b>Bangkok</b>. Afternoon free for shopping.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Tour Ends'),
(304, 33, 'Arrival to Riyadh', 'Arrival to<b> Riyadh </b>& transferred to your hotel. Check in hotel. Night Tour (optional)<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Riyadh'),
(305, 33, 'Riyadh Historical Tour', 'After breakfast, Start your tour visiting the <b>National Museum of Saudi Arabia</b>. Then enjoy the National museum park walks through the outdoor gardens one of the best gardens you will visit in Saudi Arabia. Then proceed to the <b>Hall of King Abdulaziz </b>where there is a showroom of old cars that were used by the king. Next visit to <b>Murraba palace </b>is among the most important palace built by King Abdulaziz. Then you will visit the <b>Dira Souq</b> traditional Saudi market which is famous for its variety of old copper and brass objects including silver daggers, silver Beduin\'s Jewelry and dresses. Then visit The <b>Imam Turki bin Abdullah Mosque</b> is an active place of worship in Riyadh.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Riyadh'),
(306, 33, 'Edge of The World Tour', 'After breakfast, Drive to<b> Jebel Fihrayn</b> popularly known as \'the Edge of the World\'. These cliffs rise dramatically from the desert, stretching toward the sky like a great natural wall.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Riyadh'),
(307, 33, 'Ushaiqer Heritage Village Tour', 'After breakfast, Drive to <b>Ushaiqer heritage village</b> will introduce you to the charming nature and ancient architecture of Saudi Arabia. <b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Riyadh'),
(308, 33, 'Riyadh Free day', 'After breakfast, free day. (Discover Al-Qara Hill & Jawatha AlAhsaa Tour- Optional)', 'Riyadh'),
(309, 33, 'Fly to Al Ula', 'After breakfast, transfer to Riyadh airport to take your flight to <b>Al Ula</b>, Start your tour visiting  <b>Jabal lkmah-Rock Art</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Al Ula'),
(310, 33, 'Madain Saleh', 'After breakfast, Start your tour visiting  <b>Dadan- An</b> Ancient Arabian Kingdom.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Al Ula'),
(311, 33, 'Hegra-Fly to Jeddah', 'After breakfast, Experience <b>Hegra-A UNESCO World</b> Heritage Site Journey through time in a breathtaking landscape and discover the archeological highlights of Hegra. Then transfer to Al Ula airport to take your flight to Jeddah.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Jeddah'),
(312, 33, 'Jeddah Historical Tour', 'After breakfast, Start your tour to visit Jeddah\'s historical downtown area (Al-Balad) which is the historical area well known as the \'Old Town\'. Then you will visit <b>Al Tayebat International City Museum</b>. After that, you will enjoy a ride along <b>The New Jeddah Corniche</b> is the 30 km coastal resort area of the city of Jeddah.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Jeddah'),
(313, 33, 'Al Wahbah Crater', 'After breakfast, Drive to A wonderful, and still relatively unknown place in the heart of <b>Saudi Arabia</b>.In western Saudi Arabia is a natural wonder that intel recently was pretty unknown to the outside world.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Taif'),
(314, 33, 'Taif City Tour', 'After breakfast, Pick you up from your hotel in<b> Taif</b>. Start the tour with <b>Shubra Palace</b>. Then will take you to Al Rudaf Park.Its a great place to relax and enjoy the beauty of nature! Then visit old <b>Souq</b> in Taif city. Then go to the oldest and best shopping mall in Taif, <b>Taif\'s Heart Mall</b>. Then visit Al Shafa mountain and Al Hada mountain,It\'s considered as one of the most beautiful and important mountain roads in the region. Nice drive up <b>Al Shafa mountain </b>is the highest mountain in the area of the town.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Jeddah'),
(315, 33, 'Jeddah- Fly to Abha', 'After breakfast, Transfer to Jeddah airport to take your flight to <b>Abha</b>, Arrival and transfer to start your tour visiting the <b>Jabal Sawda</b> is the highest point in Saudi Arabia.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Abha'),
(316, 33, 'Trip to Rijal Almaa', 'After breakfast, We will take you to<b> Rijal Almaa village</b> which is famous for its typical Arabian traditional architecture that can be found throughout the whole country, each region having its own specificity.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Jeddah'),
(317, 33, 'Day-14 Departure', 'After breakfast, transfer to the airport.', 'Tour Ends'),
(318, 71, 'Welcome to London', 'The Tour Manager / Station Manager / local representative will meet you outside the arrival hall after you collect your baggage. Proceed for hotel and check in.', 'London'),
(319, 71, 'Guided City Tour of London-Visit Tower of London-Ride on London Eye', 'Today, proceed for a guided city tour of <b>London</b>: See the Buckingham Palace, Hyde Park, Big Ben, Westminster Abbey, Houses of Parliament, Trafalgar Square, Tower Bridge and Thames River. Next visit the Tower of London-housing Britain\'s Crown Jewels including the Kohinoor Diamond. Later enjoy a ride on the London Eye.<b></b><b></b><b></b><b></b>', 'London'),
(320, 71, 'Windsor Castle-Madame Tussauds Wax Museum-Lords Cricket Ground', 'This morning, proceed for a visit of the famous <b>Windsor Castle</b> - Queen of England-s favorite weekend home. Next visit the famous <b>Madame Tussauds Wax Museum</b>. Later proceed for guided tour of Lords Cricket Ground.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'London'),
(321, 71, 'Oxford University-Cadbury World-Manchester', 'Today, check-out and proceed to Manchester for guided tour of <b>Oxford</b> with visit to a University. Continue the drive to Birmingham to visit <b>Cadbury World</b>. Later proceed to Manchester.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Manchester'),
(322, 71, 'Old Trafford Stadium-Steam Train Ride-Lake Windermere Cruise ', 'This morning, check-out and proceed to visit the famous <b>Old Trafford Stadium</b> - home to Manchester United Club. Visit the home changing room, sit in the dugout & run down the tunnel to the roar of the crowd. Later go for a Steam Train ride in Lake district and also a cruise on the <b>Lake Windermere</b>.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Carlisle'),
(323, 71, 'Gretna Green-Gretna Gateway Outlet Village', 'Today, check-out and proceed to <b>Gretna Green</b> - one of the World\'s most popular runaway Wedding Destinations. Next visit Gretna Gateway Outlet Village and spend some free time for shopping.<b></b><b></b><b></b><b></b>', 'Glasgow'),
(324, 71, 'Guided City Tour of Edinburgh-Visit Edinburgh Castle', 'This morning, proceed for a guided City Tour of<b> Edinburgh</b>: Visit Edinburgh castle, see the Scottish Parliament and many more interesting sights. Next proceed for a Scottish <b>whiskey experience tour</b>. Next spend some free time for shopping at the Royal Mile.<b></b><b></b><b></b><b></b><b></b><b></b><b></b><b></b>', 'Glasgow'),
(325, 71, 'Fly back home with pleasant memories', 'Proceed to the airport for your flight back home. Do spare a few minutes to share your feedback with your Tour Manager. Your valued suggestions will be most appreciated. Arrive home with <b>pleasant memories of your European tour</b>, which we are sure you will treasure for a lifetime.<b></b><b></b><b></b><b></b>', 'Tour End');
