(1, 1, 'Package Quotation', '', '<span class=\"fontstyle0\"><b><br><br>Booking Amount And Final Payment:</b><br><ul><li><span class=\"fontstyle2\">We require a minimum deposit as booking amounts as per the below chart per person at the time</span></li><li><span class=\"fontstyle2\">of</span></li><li><span class=\"fontstyle2\">booking.</span></li><li><span class=\"fontstyle2\">Your service provider will require amounts towards the bookings which amounts are nonrefundable,</span></li><li><span class=\"fontstyle2\">non-transferable and interest free amounts.</span></li><li><span class=\"fontstyle2\">Final payment for the relevant booking is required no later than 6 weeks prior to departure unless</span></li><li><span class=\"fontstyle2\">otherwise stated on your invoice.</span></li><li><span class=\"fontstyle2\">Some airfares or services must be paid in full at the time of booking.</span></li></ul></span><span class=\"fontstyle0\"><br></span><div><span class=\"fontstyle0\"><b>Cancellation Policy:</b><br><ul><li><span class=\"fontstyle2\">In the event of cancellation of tour / travel services due to any avoidable / unavoidable reason/s</span></li><li><span class=\"fontstyle2\">we must be</span></li><li><span class=\"fontstyle2\">notifed of the same in writing.</span></li><li><span class=\"fontstyle2\">Cancellation charges will be effective from the date we receive advice in</span></li><li><span class=\"fontstyle2\">writing, and cancellation charges would be as follows:</span></li><li><span class=\"fontstyle2\">45 days prior to arrival: 10% of the Tour / service cost</span></li><li><span class=\"fontstyle2\">15 days prior to arrival: 25% of the Tour / service cost</span></li><li><span class=\"fontstyle2\">07 days prior to arrival: 50% of the Tour / service cost</span></li><li><span class=\"fontstyle2\">48 hours prior to arrival OR No Show: No Refund</span></li></ul></span><span class=\"fontstyle0\"><br></span></div><div><span class=\"fontstyle0\"><b>Foreign Exchange:</b><br><ul><li><span class=\"fontstyle2\">Foreign Exchange utilization for the purpose of Land arrangements/ self use will be done from the</span></li><li><span class=\"fontstyle2\">individual BTQ Quota only.</span></li><li><span class=\"fontstyle2\">Payments will be accepted in accordance with the rules and regulations laid down by Reserve</span></li><li><span class=\"fontstyle2\">Bank of</span></li><li><span class=\"fontstyle2\">India.</span></li><li><span class=\"fontstyle2\">You shall be required to provide such KYC documents as may be requested by Travel Tours at the</span></li><li><span class=\"fontstyle2\">time</span></li><li><span class=\"fontstyle2\">of booking/ receiving the booking amounts.</span></li></ul></span><span class=\"fontstyle0\"><br><b>Booking Amendments :</b><br><ul><li><span class=\"fontstyle2\">If you wish to transfer from one trip to another or transfer your booking to a third party you must</span></li><li><span class=\"fontstyle2\">notify</span></li><li><span class=\"fontstyle2\">us at least 40 days prior to the departure date.</span></li><li><span class=\"fontstyle2\">No charges are applied.</span></li></ul></span><span class=\"fontstyle3\"><br><i>Note </i>: This is only a quotation. No booking is made yet. The costing may differ as per availability.</span><br style=\" font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: -webkit-auto; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; \"></div>', 'Active', '2025-04-03 14:56:00', 0),
