(15, 1, 'Transport Service Voucher', '', '<ul><li><span class=\"fontstyle2\">We require a minimum deposit as booking amounts as per the below chart per person at the time</span></li><li><span class=\"fontstyle2\">of</span></li><li><span class=\"fontstyle2\">booking.</span></li><li><span class=\"fontstyle2\">Your service provider will require amounts towards the bookings which amounts are nonrefundable,</span></li><li><span class=\"fontstyle2\">non-transferable and interest free amounts.</span></li><li><span class=\"fontstyle2\">Final payment for the relevant booking is required no later than 6 weeks prior to departure unless</span></li><li><span class=\"fontstyle2\">Otherwise stated on your invoice.</span></li></ul>', 'Active', '2025-04-03 15:00:00', 0);
