(10, 'Argentina', 'Tourist Visa', 0.00, 0.00, '90 Days', '', '', '<div>1. Passport</div><div>2. Old passport</div><div>3. Photo</div><div>4. Air Ticket</div><div>5. Itinerary</div><div>6. Bank Statement</div><div>7. Income tax returns</div><div>8. Credit card</div><div>9. Authority letter</div><div>10. Credit Card Statement</div><div>11. Covering letter from applicant</div><div>12. Leave sanction letter</div><div>13. Company regeistration.</div><div>14. Hotel Voucher</div><div><br></div> ', 1, '', '', ''),
