(13, 'Australia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><div><ol><li><b>Passport:</b> Valid for at least 6 months; biodata page to be scanned and uploaded.</li><li><b>Online Application Form: </b>Filled at immi.homeaffairs.gov.au.</li><li><b>Passport-size Photo:</b> Recent, white background (45mm x 35mm).</li><li><b>Travel Itinerary:</b> Intended travel dates and activities.</li><li><b>Proof of Funds:</b> Bank statements, salary slips, income tax returns (36 months).</li><li><b>Employment Proof:</b> Letter from employer or business registration for self-employed.</li><li><b>Accommodation Proof:</b> Hotel bookings or host invitation.</li><li><b>Travel History:</b> Copies of previous visas and stamps (if applicable).</li><li><b>Cover Letter:</b> Explaining travel purpose and ties to home country.</li><li><b>Visa Fee: </b>AUD 150 (Tourist stream).</li><li><b>Processing Time:</b> 2025 working days (approx.).</li></ol></div><div><br></div><div><i \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Additional Requirements for Indian Citizens</span></i></div><div><span \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><i style=\"box-sizing: border-box;\">If you\'re an Indian passport holder, additional documents may include:</i></span></div><div><ol><li>Indian applicants must submit biometrics at a Visa Application Centre (VAC).</li><li>Health check and police clearance may be required depending on duration or purpose.</li><li>Apply via Australian ImmiAccount.</li></ol></div></div><div>&nbsp;</div>', 1, '', '', ''),
(14, 'Austria', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>2. Old passport</div><div>3. Photo</div><div>4. Air Ticket</div><div>5. Travel Insurence&nbsp;</div><div>6. Bank statement</div><div>7. Income tax return</div><div>8. Itinerary</div><div>9. Hotel voucher</div><div>10. Covering letter from applicant</div>', 1, '', '', ''),
(15, 'Azerbaijan', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport: </b>Must be valid for at least 6 months from the arrival date.</li><li><b>Passport Scan: </b>Clear scan of the biographical page.</li><li><b>Online Application Form: </b>Fill via https://evisa.gov.az.</li><li><b>Email Address: </b>For receiving visa confirmation.</li><li><b>Travel Dates: </b>Provide entry and exit dates in application.</li><li><b>Visa Fee: </b>Approx. USD 20 (standard processing); USD 50 (urgent).</li><li><b>Processing Time: </b>3 business days (standard) or 35 hours (urgent).</li></ol></div><div><br></div><div><br></div><div><div><i><b>Special for Indians:</b></i></div><div><ol><li><i>Indian passport holders are eligible for ASAN e-Visa, valid for 30 days single entry.</i></li><li><i>No invitation letter required for tourist visa.</i></li><li><i>Travel insurance is recommended, but not mandatory.</i></li></ol></div></div>', 1, '', '', ''),
