(19, 'Barbados', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Valid passport.</div><div>2. Valid return ticket out of the island.</div><div>3. Entry visa.</div><div>4. Your intended address in Barbados.</div><div>5. Arrival card.</div><div>6. Provide the financial means to support yourself for the duration of your stay.</div><div>7. Birth certificate and marriage certificate.</div><div>8. Cover letter addressed to Chief Immigration Officer bearing a return address, phone number, fax number and email address outlining the purpose of the visit, the proposed date of entry and the duration of the visit.</div><div>9. Copy of appointment letter.</div><div>10. An employment letter or letter from school, college or university.</div>', 1, '', '', ''),
