(24, 'Bermuda', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Fully completed visa application form for Bermuda and essential declaration.&nbsp;</div><div>2. Passport size photographs.&nbsp;&nbsp;</div><div>3. Valid national passport and one copy.&nbsp;</div><div>4. Original of valid visa if you\\\'re citizen of another country and one copy.&nbsp;&nbsp;</div><div>5. Your latest bank statement and one copy.&nbsp;</div><div>6. Confirmation letter from your travel insurance of Bermuda showing the coverage and one copy.&nbsp;&nbsp;</div><div>7. Proof of group travel if you\\\'re travelling in group.&nbsp;&nbsp;</div><div>8. Proof of accommodation booking reservation in Bermuda.&nbsp;&nbsp;</div><div>9. Proof of airline ticket reservation for Bermuda and one copy.</div>', 1, '', '', ''),
