(31, 'British Indian Ocean Territory', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Visa application form</div><div>2. Passport photo</div><div>3. Passport</div><div>4. Previous passport</div><div>5. Residency proof</div><div>6. Proof of funds</div><div>&nbsp; - Personal bank statement</div><div>&nbsp; - Pay slips from employer</div><div>&nbsp; - Proof of accomodation</div><div>&nbsp; - Audited accounts</div><div>&nbsp; - Tax records</div><div>&nbsp; - Credit card limit<br><br></div><div>7. Current Details</div><div>&nbsp; - Employed:</div><div>&nbsp; - A letter from your employer on company letterhead, with contact details, stating that a leave of absence has been granted, purpose and duration of the trip, and that you will be returning to your current job.</div><div>&nbsp; - Current bank statement of the latest 6 months&nbsp;</div><div>&nbsp; - Income Tax Return (ITR)</div><div>&nbsp; - Original pay slips</div><div>&nbsp;&nbsp;</div><div>&nbsp; - Self Employed:</div><div>&nbsp; - Include a copy of your business license</div><div>&nbsp; - Company bank statement of the latest 6 months</div><div>&nbsp; - Income Tax Return (ITR)</div><div><br></div><div>&nbsp; - Student:</div><div>&nbsp; - Submit an official letter from your school indicating that you are in good standing and that you are registered for the upcoming semester.</div><div>&nbsp; - No Object certificate from School or University.</div><div><br></div><div>&nbsp; - Retired:</div><div>&nbsp; - Submit proof of your retirement fund. Yes.<br><br></div><div>8. Travel itinerary&nbsp;</div><div>9. Hotel Bookings</div>', 1, '', '', ''),
