(37, 'Cameroon', 'Tourist Visa', 0.00, 0.00, '21 Days', '', '', '<div>A passport with a validity of at least Six (6) months.</div><div>1 recent Passport Size Photograph, 7 cm X 5 cm or 5 cm X 4 cm (with the name of the applicant on the back).</div><div>An International Certificate of Vaccination against Yellow Fever . However, other vaccines and treatment for malaria are recommended.</div><div>A flight ticket or reservation with the passenger(s) name showing entry and&nbsp; return dates.</div><div>A letter of invitation or a certificate of accommodation by your host legalized by competent local Cameroonian administrative authority.&nbsp;</div><div>The letter of invitation should serve as a guarantee for the accommodation of the applicant and/or the care of the applicant during his stay.&nbsp;</div><div>However Cameroonians of origin who may be unable, for various reasons, to obtain a signed letter of invitation,&nbsp; should download and sign the declaration in honour form.</div><div>Proof of means of subsistence: a signed copy of a bank statement indicating a minimum sum of 3000 dollars. However, Cameroonians of origin who have completed the declaration in honour form are exempted from presenting this document.&nbsp;</div><div>Copy of marriage certificate or declaration of common-law union (for persons who are married or in legal cohabitation).</div><div>Parental authorization for children (ages 0 to 14 ) signed in front of a notary or a commissioner of oath / legalized by administrative authorities, if done in Cameroon.</div><div><br></div><div>Complementary information for visa application for children below 14 years:</div><div><br></div><div>Attach photocopy of the passports of the parents of the child/children requesting a visa</div><div>Attach a copy of the birth certificate of the child/children intending to travel</div><div>A separate visa application form must be filled and signed for each child.</div><div><br></div>', 1, '', '', ''),
(38, 'Canada', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>2. Old passport</div><div>3. Photo</div><div>4. Air ticket</div><div>5. Travel insurance</div><div>6. Covering letter from applicant</div><div>7. Bank statement</div><div>8. Income tax returns</div><div>9. Itierary</div><div><br></div>', 1, '', '', ''),
(39, 'Cape Verde', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. One completed Cape Verde application</div><div>2. Two passport type photos</div><div>3. Physical passport with 6 months validity beyond trip completion and one blank visa page</div><div>4. Non-USA passport holders must provide a copy of green card or US Visa and I-94</div><div>5. One copy of flight itinerary</div>', 1, '', '', ''),
