(43, 'Chile', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>2. Old Passport</div><div>3. Photo</div><div>4. Air ticket</div><div>5. Yellow fever vaccination</div><div>6. Police clearance certificate PCC</div><div>7. Hotel voucher</div><div>8. Itinerary</div><div><br></div>', 1, '', '', ''),
(44, 'China', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>2. Photo</div><div>3. Old passport</div><div>4. Covering letter from applicant</div><div>5. Bank statement</div><div>6. Hotel voucher</div><div>7. Air ticket</div><div>8. Balance certificate</div><div>9. Itinerary</div>', 1, '', '', ''),
(45, 'Christmas Island', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Original, signed passport with at least 6 months of remaining validity.</div><div>2. Passport-type photographs: 2</div><div>3. Photocopies of the passport and ID card. The applicant must provide photocopies of the original passport and ID card, including a copy of all visas (valid and expired).</div><div>4. Proof of status. Copy of registration certificate/copy of visa and copy of work permit(if available).</div><div>5. Itinerary. Copy of round trip tickets or itinerary.</div><div>6. Medical check report. For staying more than 3 months in Australia or aged over 75 applicants, please enclose a chest X-ray check report and medical check receipt of the applicant from one of the designated hospitals. Other applicants who must submit the documents above please check here for the list of the hospital in different regions.</div><div>7. Bank Statement. Copy of a recent bank statement showing proof of sufficient funds.</div><div>8. Employment Letter. A letter from your employer/school (on business letterhead, with contact details), stating that a leave of absence has been granted and that you will be returning to your current job. If you are self-employed, include a copy of your business license and tax return. If you are retired please submit proof of your retirement fund.</div><div>9. Hotel Reservations.Copy of the Hotel Reservations.</div>', 1, '', '', ''),
(46, 'Cocos (keeling) Islands', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. U.S. passport must be valid for 6 months beyond the intended stay.</div><div>2. Complete the online Visa Application Form.</div><div>3. Please send a clear photocopy of your passport information page, including any amendments or name changes.</div>', 1, '', '', ''),
