(64, 'Egypt', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<div>3. Air ticket<br>4. Old passport</div><div>5. Covering letter from applicant</div><div>6. Bank statement</div><div>7. Income Tax return<br>8. Hotel voucher<br>9. Itinerary</div>', 1, '', '', ''),
