(66, 'Equatorial Guinea', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. One completed Equatorial Guinea visa application</div><div>2. One passport type photo</div><div>3. One copy of proof of vaccination for yellow fever</div><div>4. Physical passport with 6 months validity beyond trip completion and one blank visa page</div><div>5. Non-USA passport holders must provide a copy of green card or US Visa and I-94</div><div>6. One copy of flight itinerary</div>', 1, '', '', ''),
(67, 'Eritrea', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Old passport<br>2. Passport<br>3. Photo<div><br></div>', 1, '', '', ''),
(68, 'Estonia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1.&nbsp; Passport<br>2.&nbsp; Old Passport<br>3.&nbsp; Photo<br>4.&nbsp; Air ticket<div>5.&nbsp; Travel insurance<br>6.&nbsp; Bank statement<br>7.&nbsp; Income tax return</div><div>8.&nbsp; Marriage certificate<br>9.&nbsp; Relationship proof<br>10. Itinerary<br>11. Hotel voucher<br>12. Cover letter from applicant</div>', 1, '', '', ''),
(69, 'Ethiopia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Yellow fever vaccination&nbsp;<br>5. Old passport<br>6. Polio vaccination<div>7. Covering letter from applicant<br>8. Bank statement</div><div>9. Hotel voucher<br>&nbsp;</div>', 1, '', '', ''),
(70, 'Falkland Islands (malvinas)', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. A passport valid for the proposed duration of your stay. No additional period of validity beyond this is required.</div><div>2. A return air ticket</div><div>3. Evidence of accommodation with family/friends/hotel/business&nbsp;&nbsp;</div><div>4. Sufficient funds to cover your stay in the Islands</div>', 1, '', '', ''),
