(72, 'Fiji', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Air ticket<br>3. Hotel voucher<br>4. Bank statement<br>', 1, '', '', ''),
(73, 'Finland', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance&nbsp;<br>6. Bank statement<br>7. Income tax return<br>8. Itinerary<br>9. Hotel Voucher<br>10. Covering letter from applicant<br>11. NOC letter from parents/husband', 1, '', '', ''),
(74, 'France', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax return<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant', 1, '', '', ''),
(75, 'French Guiana', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with one blank visa page</div><div>2. Hold proof of sufficient funds in the form of a bank statement or cash</div><div>3. Hold proof of onward/return airline tickets</div><div>4. Hold documents showing proof of purpose of trip</div><div>5. Hold all documents required for the next destination</div><div>6. Hold a visa for the next destination, if required</div><div>7. Confirm with their airline that boarding will be permitted without a visa as these conditions are subject to change</div>', 1, '', '', ''),
(76, 'French Polynesia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)</div><div>5. Hold proof of sufficient funds relative to your intended length of stay</div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa</div>', 1, '', '', '');
