(82, 'Ghana', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Yellow fever vaccination<br>5. Old passport<br>6. Bank statement<br>7. Cover letter from applicant<br>8. Income tax returns<br>9. Hotel voucher&nbsp;', 1, '', '', ''),
(83, 'Gibraltar', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with one blank visa page</div><div>2. Hold proof of sufficient funds</div><div>3. Hold proof of onward/return flights</div><div>4. Hold all documents required for the next destination</div><div>5. Check the latest immunisation requirements at: http://www.safetravel.ch/</div>', 1, '', '', ''),
