(85, 'Greenland', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Itinerary&nbsp;<br>5. Travel Insurance', 1, '', '', ''),
