(87, 'Guadeloupe', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with one blank visa page</div><div>2. Hold proof of sufficient funds</div><div>3. Hold proof of onward/return airline tickets</div><div>4. Hold documents showing proof of purpose of trip&nbsp;</div><div>5. Hold all documents required for the next destination</div><div>6. Confirm with their airline that boarding will be permitted without a visa as these conditions are subject to change</div>', 1, '', '', ''),
(88, 'Guam', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Be travelling aboard a signatory carrier - included in the application pack</div><div>2. Hold a round-trip, non-refundable and non-transferable ticket</div><div>3. Complete and signed the Form I-736 Guam Visa Waiver information provided by the airline</div><div>4. Not travelling owards to another destination in the United States</div><div>5. Not apply for an extension of stay, adjustment of status or change of non-immigrant status</div><div>6. Hold a passport valid at least six months on entry with two blank visa pages</div><div>7. Hold proof of sufficient funds</div>', 1, '', '', ''),
