(99, 'Iceland', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<div>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns</div><div>8. Educational document<br>9. Reason letter<br>10. Itinerary<br>11. Hotel voucher<br>12. Copies of all pages of passport in color<br>13. Covering letter from applicant<br>14. NOC letter from parents/husband<br>&nbsp;</div>', 1, '', '', ''),
(100, 'India', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old Passport<br>3. Photos', 1, '', '', ''),
(101, 'Indonesia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport</b> : Valid for at least 6 months.</li><li><b>Visa Application Form&nbsp;</b>: Completed and signed.</li><li><b>Passport-size Photographs</b> : Recent, white background.</li><li><b>Flight Itinerary</b> : Confirmed onward and return tickets.</li><li><b>Hotel Booking</b> : Proof of accommodation for entire stay.</li><li><b>Financial Proof</b> : Bank statement showing sufficient funds (usually last 3 months).</li><li><b>Visa Fee</b> : Paid at embassy or consulate.</li></ol></div><div><i \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><span style=\"box-sizing: border-box; font-weight: bolder;\"><br></span></i></div><div><i \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Additional Requirements for Indian Citizens</span></i></div><div><span \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><i style=\"box-sizing: border-box;\">If you\'re an Indian passport holder, additional documents may include:</i></span></div><div><ol><li>Indian applicants must apply at Indonesian Embassy/Consulate or through authorized visa agents before travel.</li><li>Additional documents like letter of employment or business invitation letter may be requested.</li></ol></div>', 1, '', '', ''),
