(110, 'Kazakstan', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Covering letter from applicant<br>6. Bank statement<br>7. Income tax returns<br>8. Hotel voucher<br>9. Itinear&nbsp;<br>', 1, '', '', ''),
