(112, 'Kiribati', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months beyond the period of intended stay, with two blank visa pages</div><div>2. Hold proof of sufficient funds</div><div>3. Hold proof of onward/return airline tickets</div><div>4. Hold proof of purpose of trip</div><div>5. Hold all documents required for the next destination</div><div>6. Hold a visa for the next country, where applicable</div><div>7. Confirm with their airline that boarding will be permitted without a visa as these conditions are subject to change</div>', 1, '', '', ''),
(113, 'Korea', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>2. Validity - Six months</div><div>3. A photocopy of duly filled visa application form</div><div>4. Two color photographs</div><div>5. Covering letter from the applicant stating the purpose and duration of the visit</div><div>6. Original confirmed return/onward air ticket</div><div>7. Proof of hotel reservation</div><div>8. Original and photocopy of Income Tax Returns and photocopy of pan card</div><div>9. Original and photocopy of Investment documents</div><div>10. All specified documents</div><div>11. Old passports and visa</div><div>12. Copy of leave letters from employer, school or college</div><div>13. Proof of accommodation during entire stay in al Schengen countries</div><div>14. Salary slip for last 6 months</div><div>15. Income tax returns for last 3 years</div><div>16. Travel insurance</div><div>17. Retirement proof/company registration proof/school college ID and copy</div>', 1, '', '', ''),
(114, 'Kosovo', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. A completed and signed application form. Persons included in the applicants travel document shall submit a separate application form. Minors shall submit an application form signed by a person exercising permanent or temporary parental authority or legal guardianship.</div><div>2. A recent (not older than 1 month) photograph in accordance with the international standards as set out in the International Civil Aviation Organization (ICAO) document 9303 Part 1, 6th edition.</div><div>3. A copy of your travel document. Its validity shall extend at least three months after the intended date of departure from the territory of the Republic of Kosovo. It shall contain at least two blank pages.</div><div>4. documents indicating the purpose of the journey.</div><div>5. documents in relation to accommodation, or proof of sufficient means to cover his/her accommodation;</div><div>6. documents indicating that the applicant possesses sufficient means of subsistence both for the duration of the intended stay and for the return to his country of origin or residence, or for the transit to a third country into which he is certain to be admitted, or that he is in a position to acquire such means lawfully;</div><div>7. Information enabling an assessment of the applicants intention to leave the territory of the Republic of Kosovo before the expiry of the visa applied for.</div><div>8. Travel medical insurance valid throughout the territory of the Republic of Kosovo which covers the entire period of the persons intended stay or transit.</div><div>9. The visa fee payment of 40 EUR that applicants need to pay unless they are holders of diplomatic and official passports; children nder six (6) years old; or school children, students and teachers accompanying and visiting for studying or training purposes.</div>', 1, '', '', ''),
(115, 'Kuwait', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Pan card', 1, '', '', ''),
