(120, 'Lesotho', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>2. Confirmed paid Return Itinerary or Ticket</div><div>3. Invitation Letter</div><div>4. Introduction Letter</div><div>5. Bank Statement</div><div>6. Immunization Card</div><div>7. Travel Insurance</div><div>8. Other Document</div>', 1, '', '', ''),
(121, 'Liberia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Travel insurance', 1, '', '', ''),
(122, 'Libyan Arab Jamahiriya', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Two completed Libya visa applications</div><div>2. Two passport type photos</div><div>3. One copy of proof of vaccination for yellow fever</div><div>4. Physical passport with 6 months validity beyond trip completion and one blank visa page</div><div>5. Non-USA passport holders must provide a copy of green card or US Visa and I-94</div><div>6. Authorization from your host that was provided by the Libya Ministry of Foreign Affairs</div><div>7. One copy of flight itinerary</div>', 1, '', '', ''),
(123, 'Liechtenstein', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old Passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Internal air ticket<br>7. Bank statement<br>8. Income tax returns<br>9. Itineary&nbsp;<br>&nbsp;', 1, '', '', ''),
(124, 'Lithuania', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Covering letter from applicant<br>10. Hotel voucher<br>11. NOC letter from parents/husband&nbsp;<br>', 1, '', '', ''),
(125, 'Luxembourg', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance&nbsp;<br>6. Bank statement<br>7. Income tax returns&nbsp;<br>8. Itinearny<br>', 1, '', '', ''),
(126, 'Macau', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. A completed Macau Visa Application Form;&nbsp;</div><div>2. Photocopies of the bio data page and used inside pages of a valid passport/travel document.</div><div>3. Document of financial status (e.g. bank statement, deposit in savings account, tax payment receipt, employment certificate, etc.)</div><div>4. Document of transportation to Macao and accommodation arrangement (e.g. round-trip air ticket and hotel room reservation receipts, etc.)</div><div>5. Pages carrying important information in a travel document previously used to come to Macao (if any);</div><div>6. Valid entry visa or residence visa/permit of other countries or regions (if any);</div><div>7. Recent 1.5-inch full face white background color photo.</div><div>8. Proof of purpose of visit, such as:</div><div>Leisure  Tour receipt, itinerary, etc.;</div><div>Family visit  Photocopy of residence/stay document of family in Macao;</div><div>Study  Admission document of a higher institute in Macao;</div><div>Employment  Employment approval document of Macao authorities;</div><div>Residence on dependant basis  Macao identity card of family, document of kinship, etc.;</div><div>Stay as relative of non-resident worker  Approval document of Macao authorities;</div>', 1, '', '', ''),
(127, 'Macedonia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Bank statement<br>5. Travel insurance', 1, '', '', ''),
(128, 'Madagascar', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Bank statement<br>5. Air ticket<br>6. Aadhar card<br>7. Pan card<br>8. Covering letter from applicant<br>9. Hotel voucher&nbsp;', 1, '', '', ''),
(129, 'Malawi', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Bank statement<br>6. Itinerary<br>7. Covering letter from applicant<br>8. Hotel voucher&nbsp;&nbsp;', 1, '', '', ''),
(130, 'Malaysia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Valid Passport</b>: Your passport must be valid for at least 6 months from the date of entry.</li><li><b>Return or Onward Ticket</b>: A confirmed return or onward flight ticket within 30 days of arrival.</li><li><b>Proof of Accommodation</b>: Confirmed hotel booking or an invitation letter from a host in Malaysia.&nbsp;</li><li><b>Sufficient Funds</b>: Evidence of adequate financial means to cover your stay, such as at least USD 50 per day.</li><li><b>Malaysia Digital Arrival Card (MDAC)</b>: Complete the MDAC online at least 3 days before arrival.</li><li><b>Valid Passport</b>: With at least 6 months\' validity.</li><li><b>Recent Passport-Sized Photograph</b>: As per specifications.</li><li><b>Confirmed Flight Itinerary</b>: Including return or onward journey.</li><li><b>Proof of Accommodation</b>: Hotel bookings or invitation letter.</li><li><b>Financial Proof</b>: Bank statements or other evidence of sufficient funds.</li><li><b>Visa Application Form</b>: Duly completed and signed.</li></ol></div><div><br></div><div><div><i><b>In Additional Requirements for Indian Citizens</b></i></div><div><i style=\"box-sizing: border-box; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">If you\'re an Indian passport holder, additional documents may include:</i><br style=\"box-sizing: border-box; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"></div><div><br></div><div><ol><li><b>Valid passport</b></li><li><b>Return flight ticket (must be direct or via Singapore/Thailand)</b></li><li><b>Proof of accommodation</b></li><li><b>eNTRI registration printout</b></li><li><b>Proof of financial means</b></li></ol></div></div><div><br><br></div>', 1, '', '', ''),
(131, 'Maldives', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport&nbsp;</b>: Must be valid for at least 1 month from the date of entry.</li><li><b>Confirmed Return/Onward Ticket</b> : Proof of travel out of Maldives within visa duration.</li><li><b>Hotel Reservation or Stay Address</b> : Proof of confirmed booking or sponsors address in Maldives.</li><li><b>Sufficient Funds</b> : At least USD 100 + USD 50 per day, or a credit card, or proof of sponsorship.</li><li><b>Health Declaration Form</b> : Submitted online via https://imuga.immigration.gov.mv within 96 hours before travel.</li><li><b>Visa Fee</b> : Free for first 30 days; extendable up to 90 days for a fee.</li></ol></div>', 1, '', '', ''),
(132, 'Mali', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br><div>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Bank statement<br><br></div>', 1, '', '', ''),
(133, 'Malta', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Balance certificate<br>9. Aadhar card<br>10. Itinerary<br>11. Covering letter from applicant<br>12. NOC letter from parents/husband', 1, '', '', ''),
(134, 'Marshall Islands', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket', 1, '', '', ''),
(135, 'Martinique', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with two blank visa pages</div><div>2. Hold proof of sufficient funds</div><div>3. Hold proof of onward/return airline tickets</div><div>4. Hold all documents required for the next destination</div><div>5. Confirm with their airline that boarding will be permitted without a visa as these conditions are subject to change</div>', 1, '', '', ''),
(136, 'Mauritania', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Requires proof of transportation(round-trip ticket),letter of financial solvency from bank, proof of employment and an invitation letter.</div><div>2. A valid passport</div><div>3. Completed and signed applications forms</div><div>4. Passport-sized photographs</div>', 1, '', '', ''),
(137, 'Mauritius', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Air ticket<br>3. Hotel voucher<br>4. Photo<br>5. Forex receipt<br>6. Credit card', 1, '', '', ''),
(138, 'Mayotte', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport Requirements</div><div>2. Document Validity</div><div>3. Visa Issuance</div><div>4. Visa Exemptions</div><div>5. TWOV (Transit Without Visa)</div><div>6. Baggage Clearance regulations</div><div>7. Airport tax</div><div>8. Rules of Currency Import &amp; Export:</div>', 1, '', '', ''),
(139, 'Mexico', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Marriage certificate<br>6. Birth certificate<br>7. Covering letter from applicant<br>8. Bank statement<br>9. Income tax returns', 1, '', '', ''),
(140, 'Micronesia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Air ticket', 1, '', '', ''),
(141, 'Moldova', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any</div><div>2. 2 Scanned recent colour photograph. (Photo Specification);</div><div>3. Visa Application forms: completed and signed</div><div>4. Personal Covering letter: explaining purpose of travel to the country</div><div>5. Proof of Financial subsistence: during the stay in Moldova, at least 30 EUR per day, but not less than 300 EUR for a stay shorter than 10 days (cash, travel checks, credit card, etc.)</div><div>6. Air tickets: proof of return flight tickets from and back to your home country</div><div>7. Hotel reservation: proof of accommodation for your entire stay</div><div>8. Travel Insurance: with minimum coverage of EUR 30000 and valid for entire duration of stay</div>', 1, '', '', ''),
(142, 'Monaco', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Visa Application Form</div><div>2. Passport Photo</div><div>3. Hotel Bookings</div><div>4. Bank Statement</div><div>5. Travel Insurance</div><div>6. Flight Bookings</div><div>7. Previous Passport</div><div>8. Cover Letter</div><div>9. Passport</div><div>10. Current Details</div>', 1, '', '', ''),
(143, 'Mongolia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Bank statement<br>6. Income tax returns<br>', 1, '', '', ''),
