(148, 'Myanmar', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Hotel voucher<br>5. Covering letter from applicant<br>', 1, '', '', ''),
(149, 'Namibia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Yellow fever vaccination&nbsp;<br>6. Covering letter from applicant<br>7. Bank statement<br>8. Income tax returns&nbsp;<br>9. Credit card<br>', 1, '', '', ''),
(150, 'Nauru', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Completed Nauru visa application form.</div><div>2. A copy of your passport, valid for at least three more months beyond your intended stay in Nauru.</div><div>3. A recent passport photo with a white background.</div><div>4. A hotel reservation or sponsorship from a resident of Nauru.</div><div>5. Copies of your flight bookings to and from Nauru as well as any other Pacific islands you are visiting.</div><div>6. Criminal record certificate.</div><div>7. Certificate of medical fitness.</div><div>8. A certificate of employment/work contract.</div><div>9. A letter of invitation from a Nauruan citizen (for Australian and New Zealand passports only).</div><div>10. International Certificate of Vaccination for Yellow Fever required if arriving from infected area within 5 days.</div>', 1, '', '', ''),
(151, 'Nepal', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport</b> : Valid for at least 6 months from arrival.</li><li><b>Visa Application Form&nbsp;</b>: Filled online or at the airport/border.</li><li><b>Passport-size Photo&nbsp;</b>: One recent photo (hard copy or digital).</li><li><b>Visa Fee&nbsp;</b>: USD 30 (15 days), USD 50 (30 days), USD 125 (90 days), payable in cash.</li><li><b>Return Ticket/Travel Itinerary (optional)&nbsp;</b>: Shows planned exit from Nepal.</li><li><b>Hotel Booking or Local Address (optional):</b> Proof of accommodation.</li><li><b>Online submission receipt (if applying online in advance</b>)</li></ol></div><div><blockquote data-start=\"855\" data-end=\"890\"><p data-start=\"857\" data-end=\"890\"><i><strong data-start=\"859\" data-end=\"887\"><br></strong></i></p><p data-start=\"857\" data-end=\"890\"><i><strong data-start=\"859\" data-end=\"887\">Special Note for Indians</strong>:</i></p><p data-start=\"857\" data-end=\"890\"><i>Indian citizens do NOT need a visa to enter Nepal.</i></p><p data-start=\"857\" data-end=\"890\"><i>Can enter using a valid passport or any government-issued photo ID (like voter ID).</i></p><p data-start=\"857\" data-end=\"890\"><i></i></p><p data-start=\"857\" data-end=\"890\"><i>Entry is permitted by air or land (open border) with minimal formalities.</i></p></blockquote></div>', 1, '', '', ''),
(152, 'Netherlands', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<div>4. Air ticket<br>5. Travel insurance<br>6. Income tax returns<br>7. Itinerary<br>8. Hotel voucher<br>9. Covering letter from applicant<br>&nbsp;<br><br></div>', 1, '', '', ''),
(153, 'Netherlands Antilles', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<span style=\\\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">1. Passport</span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\"><span style=\\\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">2. Old passport</span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\"><span style=\\\"color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">3. Photo</span><div style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">4. Air ticket<br style=\\\"box-sizing: border-box;\\\">5. Travel insurance<br style=\\\"box-sizing: border-box;\\\">6. Income tax returns<br style=\\\"box-sizing: border-box;\\\">7. Itinerary<br style=\\\"box-sizing: border-box;\\\">8. Hotel voucher<br style=\\\"box-sizing: border-box;\\\">9. Covering letter from applicant<br style=\\\"box-sizing: border-box;\\\">&nbsp;</div>', 1, '', '', ''),
(154, 'New Caledonia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with one blank visa page</div><div>2. Hold confirmed onward or return flight confirmation</div><div>3. Hold all documents required for the next destination</div><div>4. Hold proof of sufficient funds</div><div>5. Confirm with their airline that boarding will be permitted without a visa</div>', 1, '', '', ''),
(155, 'New Zealand', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<div>3. Photo<br>4. Air ticket<br>5. Covering letter from applicant<br>6. Bank statement<br>7. Income tax returns</div><div>8. NOC letter from parents/husband</div><div>9. Itinerary<br>10. Hotel voucher&nbsp;</div>', 1, '', '', ''),
(156, 'Nicaragua', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with one blank visa page</div><div>2. Hold proof of sufficient funds</div><div>3. Hold proof of onward/return flights</div><div>4. Hold all documents required for the next destination</div><div>5. Check the latest immunization requirements at: http://www.safetravel.ch/</div>', 1, '', '', ''),
(157, 'Niger', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Yellow fever vaccination<br>2. Covering letter form applicant<br>3. Hotel voucher<br>4. Passport<br>5. Old passport<br>6. Photo<br>7. Air ticket<br>8. Bank statement<br>9. tineanry&nbsp;<br>', 1, '', '', ''),
(158, 'Nigeria', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Yellow fever vaccination<br>6. Polio vaccination<br>7. Internal air ticket<br>8. ID proof of signatory authority person<div>9. Covering letter from applicant<br>10. Bank statement<br>11. Income tax returns<br>12. Hotel voucher&nbsp; &nbsp;</div>', 1, '', '', ''),
(159, 'Niue', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with two blank visa pages</div><div>2. Hold proof of confirmed onward/return airline tickets</div><div>3. Hold proof of sufficient funds in the form of a bank statement or cash</div><div>4. Hold proof of confirmed accommodation</div><div>5. Hold documents showing proof of travel purpose (e.g., business cover or support letter, conference registrations, tour itinerary, etc.)</div><div>6. Hold all documents required for the next destination</div><div>7. Hold a visa for the next destination, if applicable</div><div>8. Confirm with their airline that boarding will be permitted without a visa as these conditions are subject to change</div>', 1, '', '', ''),
(160, 'Norfolk Island', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport Requirements</div><div>2. Document Validity</div><div>3. Warnings</div><div>4. Visa Issuance</div><div>5. Visa Exemptions</div><div>6. Additional information</div><div><br></div>', 1, '', '', ''),
(161, 'Northern Mariana Islands', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport Requirements</div><div>2. Document Validity</div><div>3. Additional information</div><div>4. Visa Issuance</div><div>5. Additional information</div><div>6. Import regulations</div><div>7. Airport tax</div>', 1, '', '', ''),
(162, 'Norway', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Covering letter from applicant<br>7. Bank statement<br>8. Income tax returns<br>9. Power of attorney<br>10. Itinerary<br>11. Hotel voucher<br>12. NOC letter from parents/husband&nbsp;', 1, '', '', ''),
(163, 'Oman', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport:</b> Valid for at least 6 months from the date of entry.<span style=\"white-space:pre\">	</span></li><li><b>Photograph:</b> Recent passport-size photo (JPEG format).<span style=\"white-space: pre;\">	</span></li><li><b>Passport Scan:</b> Bio page in clear format (PDF or JPEG).<span style=\"white-space: pre;\">	</span></li><li><b>Travel Itinerary:</b> Optional but helps with processing.</li><li><b>Visa Fee:</b> ~OMR 520 depending on visa type.<span style=\"white-space: pre;\">	</span></li><li><b>Online Application:</b> Apply at https://evisa.rop.gov.om.<span style=\"white-space: pre;\">	</span></li><li><b>Processing Time:</b> 13 working days.<span style=\"white-space: pre;\">	</span></li><li><b>Confirmed Hotel Booking:</b> Required to validate tourism intent.</li><li><b>Air Ticket: </b>Return or onward confirmed ticket.<span style=\"white-space: pre;\">	</span></li><li><b>Visa Application Form:</b> Filled and signed by sponsor.<span style=\"white-space: pre;\">	</span></li></ol></div><div><span style=\"white-space: pre; white-space: normal;\">	</span></div><div><br></div><div><br></div><div><br></div><i \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Additional Requirements for Indian Citizens</span><br style=\"box-sizing: border-box;\"></i><span \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><i style=\"box-sizing: border-box;\">If you\'re an Indian passport holder, additional documents may include:</i></span><br><div><span style=\"white-space: pre; white-space: normal;\"><i><b>	</b></i></span></div><div><ol><li>Indian citizens with a valid visa or residency for the USA, UK, Schengen, Canada, Australia, or Japan can apply for an Oman e-visa easily.<span style=\"white-space: pre;\">	</span></li><li>Others must apply through the Royal Oman Police website or embassy with more documents.<span style=\"white-space:pre\">	</span></li><li>Biometric and medical requirements are only for work and long-stay visas.<span style=\"white-space:pre\">	</span></li><li>Processing may take longer if not applying under e-Visa category.</li></ol></div><div><span style=\"white-space: pre; white-space: normal;\">	</span></div><div><span style=\"white-space: pre; white-space: normal;\">	</span></div><div><span style=\"white-space: pre; white-space: normal;\">	</span></div>', 1, '', '', ''),
