(167, 'Panama', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Covering letter of applicant<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel vocuher&nbsp;<br>', 1, '', '', ''),
(168, 'Papua New Guinea', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Medical reports<br>6. Itinerary<br>7. Bank statement<br>8. Income tax returns<br>9. Hotel voucher&nbsp;<br>&nbsp;', 1, '', '', ''),
(169, 'Paraguay', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Police clearance certificate pcc<br>5. Old passport<br>6. Bank statement<div>7. Visa application&nbsp;<br>&nbsp;</div>', 1, '', '', ''),
(170, 'Peru', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Visa application form<br>6. Bank statement<br>7. Income tax returns&nbsp;', 1, '', '', ''),
(171, 'Philippines', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Credit card<br>6. Credit card statement<br>7. Covering letter from applicant<br>8. Bank statement<br>9. Forex report<br>10. Income tax returns<br>11. Itinerary<br>12. Hotel voucher&nbsp;&nbsp;', 1, '', '', ''),
(172, 'Pitcairn', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid at least six months on entry with one blank visa page</div><div>2. Hold proof of sufficient funds relative to your intended length of stay</div><div><br></div>', 1, '', '', ''),
(173, 'Poland', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant<br>11. NOC letter from parnts/husband&nbsp;', 1, '', '', ''),
(174, 'Portugal', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant<br>11. Sponsorship letter&nbsp;<br>', 1, '', '', ''),
(175, 'Puerto Rico', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>2. Digital Photograph</div><div>3. Application form</div><div>4. Appointment booking confirmation</div><div>5. Letter of Invitation</div><div>6. Business Introduction Letter</div><div>7. Proof of Financial Means</div><div>8. Proof of Residency</div>', 1, '', '', ''),
(176, 'Qatar', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Pan card<br>4. Air ticket<br>5. Hotel vocuher', 1, '', '', ''),
(177, 'Reunion', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Two application forms instead of one.</div><div>2. A copy of the spouse\\\'s passport if they are an EU citizen.</div><div>3. A copy of the spouse\\\'s residency permits if they are not an EU citizen</div><div>4. A original copy of the marriage certificate.</div><div>5. Proof of basic german language skill.</div><div>6. Passport copies of both parents.</div><div>7. Birth certificate.</div><div>8. Proof of adoption(If applicable).</div><div>9. Custody decree(If parents are divorced).</div><div>10. Death certificate of parents(If one of the parents has passed away).</div><div>11. Letter of consent from parents.</div>', 1, '', '', ''),
(178, 'Romania', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Authority letter<br>6. Travel insurance<br>7. Wavier form<div>8. Covering letter from applicant<br>9. Bank statement&nbsp;<br>10. Income tax returns</div><div>11. Hotel voucher<br>12. Credit card<br>13. Itineanry&nbsp;<br><br></div>', 1, '', '', ''),
(179, 'Russian Federation', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Authority letter<br>6. Covering letter from applicant<div>7. Hotel vocuher</div>', 1, '', '', ''),
(180, 'Rwanda', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br><br>', 1, '', '', ''),
(181, 'Saint Helena', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Original Passport valid for 6 months from the date of arrival.</div><div>2. Visa Application Form.</div><div>3. Covering letter mentioning details of the travel.</div><div>4. 2 photos: 35 mm X 50 mm, White background, Matt Finish, face cover 3cm Head to the chin. With a clear view of the neck and shoulders along with the white background.</div><div>5. Confirmed Air Tickets with E-ticket No.</div><div>6. Original saving bank statements for last 3 months updated with bank seal &amp; sign on each and every page showing balance more than INR 30,000 per person.</div><div>7. Confirmed Hotel Bookings.</div>', 1, '', '', ''),
(182, 'Saint Kitts And Nevis', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. A valid passport with at least 6 months of validity left</div><div>2. Passport pictures from the last three months</div><div>3. Pay the application costs for the visa</div><div>4. A valid passport that will remain valid for at least 6 months after the day you leave St. Kitts and Nevis</div><div>5. Proof that you have sufficient funds to cover all of the costs associated with your trip</div><div>6. A departure voucher or ticket showing when and how you will leave St. Kitts and Nevis</div>', 1, '', '', ''),
(183, 'Saint Lucia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any</div><div>2. 2 Scanned recent colour photograph. (Photo Specification);</div><div>3. Visa Application forms: completed and signed</div><div>4. Personal Covering letter: explaining purpose of travel to the country</div><div>5. Original Bank Statement: stamped &amp; updated for last 3 months with bank seal</div><div>6. Air tickets: proof of return flight tickets from and back to your home country</div><div>7. Hotel reservation: proof of accommodation for your entire stay</div><div>8. Travel Itinerary: day-wise plan outlining all elements of the trip</div>', 1, '', '', ''),
(184, 'Saint Pierre And Miquelon', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport must be valid for a minimum of 6 months</div><div>2. Valid ID card(if required)</div><div>3. Original birth certificate (if required)</div>', 1, '', '', ''),
(185, 'Saint Vincent And The Grenadines', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. General documents</div><div>2. Birth,Death,Burial certificates</div><div>3. Marriage, Divorce certificates</div><div>4. Adoption certificates</div><div>5. Identity card</div><div>6. Police, court,prison records</div><div>7. Military records</div><div>8. Passports &amp; other travel documents</div><div>9. Other records</div><div>10. Visa issuing posts</div><div>11. Visa services</div><div><br></div>', 1, '', '', '');
INSERT INTO `visa_crm_master` (`entry_id`, `country_id`, `visa_type`, `fees`, `markup`, `time_taken`, `upload_url`, `upload_url2`, `list_of_documents`, `status`, `upload_url3`, `upload_url4`, `upload_url5`) VALUES
(186, 'Samoa', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any</div><div>2. 2 Scanned recent colour photograph. (Photo Specification);</div><div>3. Confirmed return flight ticket</div><div>4. Accommodation proof (hotel booking or invitation letter if visiting relative/friend)</div><div>5. Sufficient financial funds (while in Samoa)</div><div>6. Supporting documents relating to Business trip</div>', 1, '', '', ''),
(187, 'San Marino', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)</div><div>5. Hold proof of sufficient funds relative to your intended length of stay</div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa</div>', 1, '', '', ''),
(188, 'Sao Tome And Principe', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a biometric passport valid for at least six months with at least one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold proof of sufficient funds relative to your intended length of stay</div><div>5. Confirm with your airline prior to your travel date that boarding will be permitted without a visa</div>', 1, '', '', ''),
(189, 'Saudi Arabia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<div>5. Travel insurance&nbsp;<br>6. Covering letter from applicant<br>7. Hotel voucher<br>8. Bank statement<br>9. Bonafide letter&nbsp;</div>', 1, '', '', ''),
(190, 'Senegal', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br><div>4. Air ticket<br>5. Bank statement</div><div>6. Hotel vocuher</div>', 1, '', '', ''),
(191, 'Serbia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br><div>2. Old passport<br>3. Photo</div><div>4. Air ticket<br>5. Income tax returns<br>6. Travel insurance<br>7. Covering letter of applicants<br>8. Bank statements<br>9. Itinerary<br>10. Hotel vocuher&nbsp;&nbsp;</div>', 1, '', '', ''),
(192, 'Seychelles', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Air ticket<br>3. Bank statement<div><br><br><br></div>', 1, '', '', ''),
(193, 'Sierra Leone', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport</div><div>&nbsp; 1.1. With 6 months validity</div><div>&nbsp; 1.2. Must be original and signed</div><div>&nbsp; 1.3. With a blank page for entry stamp</div><div>2. Photographs</div><div>&nbsp; 2.1. 2*2 inches</div><div>&nbsp; 2.2. Must be in color with front view and a plain background</div><div>3. Proof of travel</div><div>&nbsp; 3.1 Requires a copy of your flight itinerary</div><div>&nbsp; 3.2 A copy of your airline ticket showing entry and exit from sierra leone&nbsp;&nbsp;</div>', 1, '', '', ''),
(194, 'Singapore', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Visa Application Form (Form 14A) :</b> Complete and sign the official visa application form.</li><li><b>Passport : </b>Your passport must be valid for at least six months from your intended date of entry into Singapore and should have a minimum of two blank pages.<span style=\"white-space: pre;\">	</span></li><li><b>Photographs : </b>Two recent passport-sized color photographs (35mm x 45mm) taken within the last three months against a white background.<span style=\"white-space: pre;\">	</span></li><li><b>Cover Letter : </b>A signed cover letter detailing the purpose of your visit, duration of stay, and travel itinerary. For self-employed individuals, this should be on company letterhead.</li><li><b>Flight Itinerary : </b>Confirmed round-trip flight bookings.</li><li><b>Proof of Accommodation : </b>Hotel reservations or an invitation letter from a host in Singapore, if applicable.</li><li><b>Bank Statements : </b>Personal bank statements for the last six months, duly stamped and signed by the bank.</li><li><b>Letter of Introduction (Form V39A) : </b>May be required if requested by the authorities. This letter should be issued by a local contact in Singapore who is a citizen or permanent resident aged 21 or above.</li><li><b>Employment Proof :&nbsp;</b></li></ol></div><div><ul><li>For employed individuals: recent salary slips and an employment ID card.&nbsp;</li><li>For self-employed individuals: business registration documents.</li></ul><div><div><br></div><div><br></div><div><i><b>Special for Indians:</b></i></div><div><ol><li><i>Indian passport holders must apply for a visa before travel.</i></li><li><i>Can apply through Authorized Visa Agents in India or Singapore High Commission.</i></li><li><i>Biometrics not required for regular tourist visa.</i></li><li><i>Indian citizens with valid visas or residence permits from the US, UK, Schengen, Australia, New Zealand, or Japan may be eligible for a Singapore e-Visa (iVisa scheme).</i></li></ol></div></div></div><div><br></div>', 1, '', '', ''),
(195, 'Slovakia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<div>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant</div><div>11. Sponsorship letter<br>12. NOC letter from parents to child</div>', 1, '', '', ''),
(196, 'Slovenia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Visa application form<br>11. Covering letter from applicant<div>12. NOC letter from parents to child</div><div>13. Marriage certificate&nbsp;</div>', 1, '', '', ''),
(197, 'Solomon Islands', 'Tourist Visa', 0.00, 0.00, '30 Days ', '', '', '1. Passport<br>2. Photo<br>3. Bank statement<br>4. Air ticket<br>5. Itinerary&nbsp;<br>6. Hotel vocuher&nbsp;', 1, '', '', ''),
(198, 'Somalia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>', 1, '', '', ''),
(199, 'South Africa', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<div>3. Photo<br>4. Air ticket<br>5. Yellow fever vaccination&nbsp;<br>6. Visa application form<br>7. Covering letter from applicant<br>8. Bank statement<br>9. Hotel voucher<br>10. NOC letter&nbsp; from parents to child&nbsp;<br>11. Relationship proof<br>12. Itinenary&nbsp;</div>', 1, '', '', ''),
(200, 'South Georgia And The South Sandwich Islands', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Visa application form</div><div>2. Passport photo</div><div>3. Passport</div><div>4. Previous passport</div><div>5. Residency proof</div><div>6. Proof of funds&nbsp;</div><div>7. Current details</div><div>8. Travel Itinerary</div><div>9. Hotel bookings</div><div><br></div>', 1, '', '', ''),
(201, 'Spain', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant<br>11. Copies of all pages of passport<br>12. NOC letter from parents to child&nbsp;<br>13. Marriage certificate&nbsp;', 1, '', '', ''),
(202, 'Sri Lanka', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport</b> : Must be valid for at least 6 months from arrival date.</li><li><b>ETA Application Form</b> : Completed online via https://www.eta.gov.lk.</li><li><b>Passport-size Photo (optional) </b>: Sometimes required depending on application method.</li><li><b>Return Air Ticket</b> : Proof of departure from Sri Lanka.</li><li><b>Proof of Accommodation</b> : Hotel booking or invitation letter.</li><li><b>Visa Fee </b>: Payable online (free or discounted for some nationalities).</li></ol></div>', 1, '', '', ''),
(203, 'Sudan', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Medical report&nbsp;', 1, '', '', ''),
(204, 'Suriname', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Yellow fever vaccination<div>7. Medical report<br>8. Bank statement</div>', 1, '', '', ''),
(205, 'Svalbard And Jan Mayen', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Cover letter from the Application Portal, signed by the applicant. If the applicant is a minor, the</div><div>cover letter must be signed by the parent(s) or legal guardian.</div><div>2. One (1) passport photo, not older than six (6) months, in color with a light background, 35  40 mm</div><div>in width.</div><div>3. Passport (both new and old), valid at least three (3) months after the intended date of departure from</div><div>the Schengen area, containing at least two blank pages, and issued within the previous 10 years.</div><div>4. Copy of passport(s) (all used pages including the bio data page)</div><div>5. Original invitation letter dated and signed by the inviter/sponsor in Svalbard/ Spitsbergen, stating</div><div>the purpose and duration of the visit, the relation with the applicant and any other information about</div><div>the applicants visit (not older than three (3) months).</div><div>6. Original Guarantee Form for Visits filled out by the inviter/sponsor in Svalbard and stamped by</div><div>Norwegian authorities + 1 copy (if the applicant does not have sufficient financial means to cover the</div><div>cost of travel).</div><div>7. Copy of inviter/sponsor passport</div><div>8. A valid travel medical insurance for the duration of the intended stay in the Schengen area with a</div><div>minimum coverage of EURO 30.000</div><div>9. Flight booking of roundtrip air ticket to Svalbard (Longyearbyen), and other travels within the</div><div>Schengen area, if applicable. Do not purchase the ticket until a visa has been granted.</div><div>10. Minors (under 18 years of age):</div><div>- student card and/or original letter from the school, mentioning:</div><div>o full address, telephone number(s) of the school</div><div>o name and function of the person giving permission</div><div>o approval for leave of absence</div><div>- Proof of relationship or guardianship.</div><div>- When applicant is travelling alone, or only with one parent: letter of permission to travel signed</div><div>by both parents or legal guardians, and copy of the passport of the parent not travelling.</div><div>11. Letter granting Power of Attorney (optional for applicants who want the sponsor or other person to</div><div>represent them in the case).</div><div>12. If applicable, a written explanation as to why the applicant cannot present any or some of the</div><div>documents</div>', 1, '', '', ''),
(206, 'Swaziland', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport requirements</div><div>2. Proof of travel arrangements</div><div>3. Special instructions</div>', 1, '', '', ''),
(207, 'Sweden', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Relationship proof<br>10. Covering letter from applicants<br>11. Hotel vocuher', 1, '', '', ''),
(208, 'Switzerland', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant&nbsp;', 1, '', '', ''),
(209, 'Syrian Arab Republic', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Guarantee letter&nbsp;<br>5. Old passport', 1, '', '', ''),
(210, 'Taiwan', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Covering letter from applicant<br>6. Bank statement<br>7. Income tax returns<br>8. Itinenry&nbsp;', 1, '', '', ''),
(211, 'Tajikistan', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Air ticket<br>3. Photo<br>', 1, '', '', ''),
(212, 'Tanzania', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br><div>2. Photo<br>3. Air ticket<br>4. Yellow fever vaccination<br>5. Covering letter from applicant</div><div>6. Bank statement<br>7. Itinerary&nbsp;</div>', 1, '', '', ''),
(213, 'Thailand', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport: </b>Valid for at least 30 days from entry, with 1 blank page.</li><li><b>Passport Photo: </b>One recent (4x6 cm), not older than 6 months.</li><li><b>Visa Application Form: </b>Filled on arrival or online via https://thaievisa.go.th.</li><li><b>Return Flight Ticket:</b> Proof of departure within 15 days.</li><li><b>Hotel Booking: </b>Confirmed accommodation for the entire stay.</li><li><b>Proof of Funds: </b>Minimum THB 10,000 per person / THB 20,000 per family (in cash or bank statement).</li><li><b>Visa Fee: </b>THB 2,000 (payable in Thai Baht, cash only, at airport).</li><li><b>COVID Insurance: </b>Not mandatory, but recommended.</li></ol></div><div><br></div><div><div><b><i>Special for Indians:</i></b></div><div><ol><li><i>Indian passport holders are eligible for Thailand Visa on Arrival.</i></li><li><i>E-VOA available via https://thailandevoa.vfsevisa.com for faster processing.</i></li><li><i>Must enter via designated airports (e.g., Bangkok, Phuket, Chiang Mai).</i></li></ol></div></div>', 1, '', '', ''),
(214, 'Togo', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Your passport, with a validity of at least another six months from the end of your stay and at least two blank pages.</div><div>2. Photocopies of the first two pages of your passport.</div><div>3. The Togo visa application form</div><div>4. Two recent passport-size pictures, with the following requirements:</div><div>5. Dimensions: 4.5 x 3.5 cm</div><div>6. White background</div><div>7. Neutral facial expression</div><div>8. Your face and head must be fully visible (headgear only accepted for religious purposes, provided it does not obstruct the face)</div><div>9. Proof you have purchased or booked a return flight ticket.</div><div>10. Travel insurance for the duration of your stay, or proof you have paid a repatriation deposit</div><div>11. Yellow Fever Certificate or the vaccination notebook</div><div>12. Proof of accommodation in Togo, such as a hotel reservation</div>', 1, '', '', ''),
(215, 'Tokelau', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport validity</div><div>2. Blank visa pages</div><div>3. Tokelau visa application form</div><div>4. Original, signed United State passport</div><div>5. (2) passport photographs</div><div>6. An itinerary of your trip</div><div>7. Proof of yellow fever vaccine</div><div><br></div>', 1, '', '', ''),
(216, 'Tonga', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Passport with minimum six months validity beyond intended stay and with two blank pages</div><div>2. 2 Scanned recent colour photograph. (Photo Specification);</div><div>3. Confirmed return flight ticket</div><div>4. Hotel Reservation or Invitation letter (If visiting family or friends)</div><div>5. Updated bank statement of last three months</div><div>6. Invitation letter from the host company (For Business Visa)</div><div>7. Birth Certificate for children</div><div>8. Enough funds to support the entire trip to Tanzania</div>', 1, '', '', ''),
(217, 'Trinidad And Tobago', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a Machine Readable passport valid at least six months on entry with one blank visa page</div><div>2. Hold proof of sufficient funds in the form of a bank statement or cash</div><div>3. Hold proof of onward/return airline tickets</div><div>4. Hold documents showing proof of purpose of trip</div><div>5. Hold all documents required for the next destination</div><div>6. Hold a visa for the next destination, if required</div><div>7. Confirm with their airline that boarding will be permitted without a visa as these conditions are subject to change</div>', 1, '', '', ''),
(218, 'Tunisia', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>', 1, '', '', ''),
(219, 'Turkey', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<div>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Travel insurance</div><div>6. Income tax returns<br>7. Covering letter from applicants<br>8. Bank statements<br>9. Hotel vocuher&nbsp;</div>', 1, '', '', ''),
(220, 'Turkmenistan', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Bank statement<div><br></div>', 1, '', '', ''),
(221, 'Turks And Caicos Islands', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)</div><div>5. Hold proof of sufficient funds relative to your intended length of stay</div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa</div>', 1, '', '', ''),
(222, 'Tuvalu', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photos<br>3. Air ticket', 1, '', '', ''),
(223, 'Uganda', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br><div>2. Photo<br>3. Air ticket</div>', 1, '', '', ''),
(224, 'Ukraine', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Photo<br>3. Air ticket<br>4. Old passport<br>5. Travel insurance&nbsp;<br>6. Bank statement<br>7. Income tax returns<br>8. Itineanry&nbsp;&nbsp;', 1, '', '', ''),
(225, 'United Arab Emirates', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<p class=\"MsoListParagraphCxSpFirst\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255); text-indent: -18pt; line-height: 24px;\">   1.<span style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">    </span><span style=\"box-sizing: border-box; font-weight: bolder;\">Passport :</span>A color copy of your passport\'s bio page, valid for at least six months from your intended date of arrival in the UAE.<o:p style=\"box-sizing: border-box;\"></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255); text-indent: -18pt; line-height: 24px;\">   2.<span style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"></span><span style=\"box-sizing: border-box; font-weight: bolder;\">Photograph :</span>A recent passport-sized color photograph with a white background.<o:p style=\"box-sizing: border-box;\"></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255); text-indent: -18pt; line-height: 24px;\">   3.<span style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"></span><span style=\"box-sizing: border-box; font-weight: bolder;\">Visa Application Form</span>: A completed visa application form.<o:p style=\"box-sizing: border-box;\"></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255); text-indent: -18pt; line-height: 24px;\">   4.<span style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-positio