: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"></span><span style=\"box-sizing: border-box; font-weight: bolder;\">Financial Proof:</span>A bank statement for the last six months showing a balance of at least USD 4,000 or its equivalent in foreign currency.<o:p style=\"box-sizing: border-box;\"></o:p></p><p class=\"MsoListParagraphCxSpLast\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255); text-indent: -18pt; line-height: 24px;\">   7.<span style=\"box-sizing: border-box; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\"></span><span style=\"box-sizing: border-box; font-weight: bolder;\">Health Insurance:</span>Valid health insurance coverage applicable in the UAE.</p><div style=\"text-align: justify;\"><font color=\"#212529\" face=\"system-ui, -apple-system, Segoe UI, Roboto, Helvetica Neue, Noto Sans, Liberation Sans, Arial, sans-serif, Apple Color Emoji, Segoe UI Emoji, Segoe UI Symbol, Noto Color Emoji\"><br></font></div><i \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Additional Requirements for Indian Citizens</span><br style=\"box-sizing: border-box;\"></i><span \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255);\"><i style=\"box-sizing: border-box;\">If you\'re an Indian passport holder, additional documents may include:</i><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: bolder;\"><i style=\"box-sizing: border-box;\">1.</i>PAN Card:</span><i style=\"box-sizing: border-box;\">A colored scanned copy of your PAN card</i><br style=\"box-sizing: border-box;\"></span><i style=\"box-sizing: border-box; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-weight: bolder;\">2.</span></i><span style=\"box-sizing: border-box; font-weight: bolder; color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255);\">Flight Tickets:</span><span style=\"color: rgb(33, 37, 41); font-family: system-ui, -apple-system, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Noto Sans\", \"Liberation Sans\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Noto Color Emoji\"; font-size: 16px; background-color: rgb(255, 255, 255);\">Confirmed return flight tickets, which are mandatory for processing.</span>', 1, '', '', ''),
