(232, 'Vietnam', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div><ol><li><b>Passport:</b> Valid for at least 6 months from date of entry.</li><li><b>e-Visa Application:</b> Apply online at https://evisa.xuatnhapcanh.gov.vn.</li><li><b>Passport-size Photo:</b> Recent (white background, no glasses).</li><li><b>Scanned Passport Page:</b> JPEG or PNG format.</li><li><b>Travel Itinerary:</b> Entry and exit dates, airport/land/sea port details.</li><li><b>Payment of Visa Fee:</b> USD 25 (single entry) or USD 50 (multiple entry), paid online.</li><li><b>e-Visa Approval Letter:</b> Must be printed and shown at immigration.</li></ol></div><div><br></div><div><i \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Additional Requirements for Indian Citizens</span></i></div><div><span \\\\\\\\\\\\trebuchet\\\\?\";\"=\"\" segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" \"noto=\"\" sans\",=\"\" \"liberation=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" font-size:=\"\" 16px;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; color: rgb(33, 37, 41);\"><i style=\"box-sizing: border-box;\">If you\'re an Indian passport holder, additional documents may include:</i></span></div><div><ol><li>Indian citizens are eligible for Vietnam e-Visa.</li><li>Processing time: ~3 working days.</li><li>Only enter/exit through listed ports specified in the e-Visa.</li></ol></div>', 1, '', '', ''),
(233, 'Virgin Islands', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page</div><div>2. Hold proof of onward and return flights</div><div>3. Hold all documents required for the next destination</div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)</div><div>5. Hold proof of sufficient funds relative to your intended length of stay</div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa</div>', 1, '', '', ''),
(234, 'Wallis And Futuna', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Original passport with at least 6-month validity.</div><div>2. A scanned copy of passport bio page.</div><div>3. Online visa application forms.</div><div>4. 2 Recent passport-size photos: 35 X 45 mm, white background Matt finish, 80% face size.</div><div>5. Return ticket.</div><div>6. Previous Yemen visa - if applicable.</div><div>7. Original saving bank statements last 6 months updated with a healthy balance.</div><div>8. Enough blank pages in your passport to fit the required entry visa.</div><div>9. Bank Statement.&nbsp; Copies of bank statements from the past 3 months.</div><div>10. Confirmation of round-trip airline ticket or airline ticket to another destination.</div><div>11. Medical travel insurance (Schengen). with a minimum coverage of 30,000 and validity for all Schengen states.</div><div>12. Employment Letter. A letter from your employer/school (on business letterhead, with contact details), stating that a leave of absence has been granted and that you will be returning to your current job. If you are self-employed, include a copy of your business license and tax return. If you are retired please submit proof of your retirement fund.</div><div>13. Pay Stubs. Copies of 3 most recent pay stubs.</div><div>14. Hotel Reservations. Copy of the Hotel Reservations.</div><div>15. Personal Invitation. If visiting friends or family, you must provide letter of invitation with the contact information of the host and visitor,&nbsp;</div><div>purpose and duration of the visit, confirmation of accommodation including the address, signature and date.&nbsp;</div><div>You will also need to provide proof of the host\\\'s status in Wallis Futuna Islands ie.&nbsp;</div><div>copy of their Wallis Futuna Islands passport\\\'s information page, or, if they are not a citizen of Wallis Futuna Islands,&nbsp;</div><div>copies of their Wallis Futuna Islands residence permit and their national passport\\\'s information pages.</div>', 1, '', '', ''),
(235, 'Western Sahara', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '<div>1. Visa Application Form</div><div>2. Passport Photo</div><div>3. Passport</div><div>4. Passport Copy</div><div>5. Residency Proof</div><div>6. Hotel Bookings(Hotel Itinerary)</div><div>7. Flight Bookings</div><div>8. Travel Insurance</div><div>9. Current Details</div><div>10. Invitation Letter</div><div><br></div>', 1, '', '', ''),
(236, 'Yemen', 'Tourist Visa', 0.00, 0.00, '30 Days', '', '', '1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Approval from ministry&nbsp;', 1, '', '', ''),
